INSERT INTO `sl_language_detail` (`id`, `language_id`, `ref_id`, `name`, `type`, `detail`, `detail_2`, `detail_3`) VALUES
(1, 1, 1, 'คณะวิทยาการจัดการ', 0, '<p><strong>บรรยากาศการสอบสัมภาษณ์นักศึกษา ภาคปกติ ระบบ </strong><strong>TCAS รอบที่ 3</strong><strong>การรับตรงร่วมกัน คณะวิทยาการจัดการ&nbsp; ประจำปีการศึกษา 2562</strong></p>\r\n', '<p><span style=\"font-family:courier new,courier,monospace\"><strong>วันที่ 14 พฤษภาคม 2562 &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา ดำเนินการจัดสอบสัมภาษณ์คัดเลือกบุคคลเข้าศึกษา ในระดับปริญญาตรี ภาคปกติ ระบบ TCAS รอบที่ 3 การรับตรงร่วมกัน ประจำปีการศึกษา 2562&nbsp; โดยคณะวิทยาการจัดการ&nbsp; มีนักเรียนเข้าสอบสัมภาษณ์ในแต่ละสาขาวิชา&nbsp; ได้แก่ กลุ่มสาขาวิชาบริหารธุรกิจ กลุ่มสาขาวิชานิเทศศาสตร์ &nbsp;&nbsp;ซึ่งการสอบสัมภาษณ์ผ่านไปด้วยดี&nbsp; ประกาศรายชื่อผู้มีสิทธิ์เข้าศึกษา &nbsp;ในวันที่ 17 พฤษภาคม 2562 &nbsp;ทาง &nbsp;http://admission.ssru.ac.th และ &nbsp;<a href=\"http://student.mytcas.com/\" target=\"_blank\">http://student.mytcas.com</a></strong></span></p>\r\n', NULL),
