(71, 1, 23, 'บุคลากรสายวิชาการ', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p><span style=\"font-size:18px\"><strong><span style=\"font-family:kanit,sans-serif\">ชื่อ</span></strong></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"text-align:center\">\r\n			<p><span style=\"font-size:18px\"><strong><span style=\"font-family:kanit,sans-serif\">ข้อมูลส่วนบุคคล</span></strong></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/f4af86f7a95faff3fe985ce0d527d64a67dc3469(1).jpg\" style=\"height:212px; width:150px\" />&nbsp;</p>\r\n\r\n			<p>นางสาว นิภาวรรณ ธาราศักดิ์<br />\r\n			หัวหน้าสำนักงานคณบดี</p>\r\n			</td>\r\n			<td><strong>ปริญญาโท :&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;ครุศาสตรมหาบัณฑิต (การจัดการคุณภาพ) มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<strong>ปริญญาตรี :&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;วิทยาศาสตรบัณฑิต(วิทยาศาสตร์สุขภาพ) มหาวิทยาลัยราชภัฏพระนครศรีอยุธยา</span><br />\r\n			<strong>ตำแหน่งปัจจุบัน :</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;หัวหน้าสำนักงานคณบดี</span><br />\r\n			<strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ผู้อำนวยการกองนโยบายและแผน</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ผู้อำนวยการกองกลาง</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/30ebcae95ad5b626efff646074bff6ff7051937a.jpg\" style=\"height:212px; width:150px\" /></p>\r\n\r\n			<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">นาย สิริธนธราธร จิรทีปต์ธนชาติ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">รักษาการหัวหน้าฝ่ายบริหารงานทั่วไป</span></p>\r\n			</td>\r\n			<td>\r\n			<address><strong>ปริญญาโท :&nbsp;</strong>วิทยาศาสตรมหาบัณฑิต&nbsp;(สถิติประยุกต์และเทคโนโลยีสารสนเทศ),สถาบันบัณฑิตพัฒนบริหารศาสตร์&nbsp;<br />\r\n			<strong>ปริญญาตรี :&nbsp;</strong>บริหารธุรกิจบัณฑิต&nbsp;(บริหารธุรกิจ),&nbsp;สถาบันราชภัฏสวนดุสิต<br />\r\n			<strong>ตำแหน่งปัจจุบัน :</strong>&nbsp;หัวหน้างานฝ่ายฝ่ายบริหารงานทั่วไป<br />\r\n			&nbsp; &nbsp; &nbsp;&nbsp;<strong>:</strong>&nbsp;นักวิชาการคอมพิวเตอร์&nbsp;<br />\r\n			<strong>ประวัติการทำงาน :</strong><br />\r\n			2549 &ndash; ปัจจุบัน นักวิชาการคอมพิวเตอร์, คณะวิทยาการจัดการ, มหาวิทยาลัยราชภัฏสวนสุนันทา<br />\r\n			2547 &ndash; 2549 เจ้าหน้าที่ระบบสารสนเทศ, ศูนย์หนังสือ, สถาบันราชภัฏสวนดุสิต</address>\r\n\r\n			<div>&nbsp;</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/4b63ef66e2e0163470d6f5c8b3a7dfa2972d8e84.jpg\" style=\"height:212px; width:150px\" /></p>\r\n\r\n			<p>นาย วชิรศักดิ์ ถิ่นทวี<br />\r\n			นักวิชาการคอมพิวเตอร์</p>\r\n			</td>\r\n			<td>\r\n			<address><strong>ปริญญาโท :&nbsp;</strong>บริหารธุรกิจมหาบัญฑิต (บธม.) การจัดการทั่วไป มหาวิทยาลัยราชภัฏสวนสุนันทา</address>\r\n\r\n			<address><strong>ปริญญาตรี :&nbsp;</strong>บริหารธุรกิจบัณฑิต (บธบ.) คอมพิวเตอร์ธุรกิจ&nbsp;มหาวิทยาลัยราชภัฏราชนครินทร์</address>\r\n\r\n			<address><strong>ตำแหน่งปัจจุบัน :&nbsp;</strong>นักวิชาการคอมพิวเตอร์</address>\r\n\r\n			<address><strong>ประวิติการทำงาน :</strong></address>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">2010&nbsp;- Present &nbsp; : &nbsp;นักวิชาการคอมพิวเตอร์ ,มหาวิทยาลัยราชภัฏสวนสุนันทา</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">2008 - 2010 &nbsp; &nbsp; &nbsp;: &nbsp;นักวิชาการคอมพิวเตอร์ ,มหาวิทยาลัยราชภัฏราชนครินทร์</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
