(127, 1, 34, 'ประวัติความเป็นมา', 1, '<div class=\"col-md-12 mb-3\">\r\n<p>ประวัติความเป็นมา</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>คณะวิทยาการจัดการ สถาบันราชภัฏสวนสุนันทาเป็นหน่วยงานตามพระราชบัญญัติสถาบันราชภัฏ พ.ศ. 2538มีภาระกิจ</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>ในการให้การศึกษาวิชาการ และวิชาชีพแขนงวิชาต่าง ๆ การทำวิจัย การให้บริการทางวิชาการแก่สังคมการปรับปรุง</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>ถ่ายทอดและพัฒนาเทคโนโลยี และการทำนุบำรุงศิลปวัฒนธรรม คณะวิทยาการจัดการได้เริ่มก่อตั้งขึ้นในปี พ.ศ. 2538</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>ซึ่งขณะนั้นสถาบันราชภัฎสวนสุนันทายังมีฐานะเป็น วิทยาลัยครูสวนสุนันทาและคณะวิทยาการจัดการใช้ชื่อว่า</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>คณะวิชาวิทยาการจัดการคณะทำงานที่ร่วมกันก่อตั้งคณะ วิชาประกอบด้วย อาจารย์จากภาควิชาเศรษศาสตร์และ รัฐศาสตร์</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>คณะวิชามนุษยศาสตร์และสังคมศาสตร์ จำนวน 3 ท่าน คือ อาจารย์รัชพิณ รัชตะนาวิน อาจารย์เชวง แสนทวีสุข และอาจารย์อภิชาต</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>กำภูมิประเสริฐ รวมทั้งบุคลากรจาก หน่วยงานอื่นอีก 2 ท่าน ได้แก่ อาจารย์เปรมจิตต์ สระวาสี จากคณะวิชาวิทยาศาสตร์และอาจารย์สมศักดิ์ ขาวลาภ</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>จากหน่วยศึกษานิเทศน์ กรมการฝึกหัดครู กระทรวงศึกษาธิการ โดยวิทยาลัย มอบหมายให้อาจารย์เปรมจิตต์ สระวาสี</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>เป็นหัวหน้าคณะทำงานในการก่อตั้งคณะวิชาวิทยาการจัดการ ระยะแรกของโครงการก่อตั้งคณะนั้นได้</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>ทดลองเปิดสอนในหลักสูตร โปรแกรมวิชาธุรกิจศึกษาก่อน หลังจากนั้น ในปี พ.ศ. 2530จึงดำเนินการพัฒนาหลักสูตรอนุปริญญาศิลปศาสตร์</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', NULL, NULL),
(128, 2, 34, 'History', 1, '<div class=\"col-md-12 mb-3\">\r\n<p>History <!-- p--> <!-- div--></p>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>Rajabhat Institute Suan Sunandha Rajabhat Institute is a unit under the Rajabhat Institute Act 1995 has a mission. <!-- P--> <!-- div--></p>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p><!-- P--></p>\r\n\r\n<p><!-- div--></p>\r\n\r\n<div class=\"col-md-12 mb-2\">\r\n<p>And to maintain the arts and culture. The Faculty of Management Science was established in 1995. <!-- p--> <!-- div--></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', NULL, NULL),
(129, 1, 35, 'ปรัชญา วิสัยทัศน์ พันธกิจ', 1, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\"><u>ปรัชญา วิสัยทัศน์ พันธกิจ</u></span></td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\">ปรัชญา&nbsp; :&nbsp;</span><br />\r\n			&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&ldquo;คุณภาพและคุณธรรม&rdquo;</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\">วิสัยทัศน์&nbsp; :<br />\r\n			&ldquo;คณะวิทยาการจัดการ : คุณภาพและคุณธรรม ชั้นนำด้านการบริหารจัดการและนิเทศศาสตร์&quot;</span></td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&ldquo;คณะวิทยาการจัดการ : คุณภาพและคุณธรรม ชั้นนำด้านการบริหารจัดการและนิเทศศาสตร์&quot;</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><span style=\"color:#F0F8FF\">พันธกิจ&nbsp; :</span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">1. ผลิตบัณฑิตบริหารธุรกิจ และนิเทศศาสตร์ให้มีคุณภาพตรงตามความต้องการของชุมชน และสังคมยุคเศรษฐกิจ<br />\r\n			ฐานความรู้มีคุณธรรม และรู้จักใช้ชีวิตอย่างมีความสุขบนพื้นฐานแห่งความพอเพียง<br />\r\n			2. วิจัยสร้างนวัตกรรม และองค์ความรู้ทางบริหารธุรกิจและนิเทศศาสตร์สู่การพัฒนาท้องถิ่น ตลอดจนการพัฒนาภูมิปัญญาไทยสู่สากล<br />\r\n			3. ให้บริการวิชาการและถ่ายทอดเทคโนโลยีด้านบริหารธุรกิจและนิเทศศาสตร์แก่ชุมชน<br />\r\n			และสังคมอย่างมีคุณภาพ เพื่อยกมาตรฐานชุมชน สังคม และผู้ประกอบการขนาดกลางและขนาดย่อม หรือ SME สู่สากล<br />\r\n			4. ส่งเสริม และสนับสนุนการทำนุบำรุงศิลปวัฒนธรรมและธำรงไว้ซึ่งชาติ ศาสนา พระมหากษัตริย์</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(130, 2, 35, 'Vision, Mission', 1, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\"><u>Philosophy, vision, mission</u></span></td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\">ปรัชญา&nbsp; :&nbsp;</span><br />\r\n			&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&ldquo;Quality and virtue&rdquo;</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#F0F8FF\">vision&nbsp; :<br />\r\n			&ldquo;Faculty of Management Science: Quality and Morality Leading in Management and Communication Arts&quot;</span></td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&ldquo;Faculty of Management Science: Quality and Morality Leading in Management and Communication Arts&quot;</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><span style=\"color:#F0F8FF\">mission&nbsp; :</span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td><span style=\"color:#F0F8FF\">1. Graduate Business Administration And communication arts to meet the needs of the community And economic society<br />\r\n			Knowledge base with virtue And know how to live happily on the basis of sufficiency<br />\r\n			2. Innovation research And knowledge in business administration and communication to local development As well as the development of Thai wisdom to the world<br />\r\n			3. Provide academic services and transfer technology in business administration and communication to the community<br />\r\n			And quality society To raise the standard of community, society and small and medium enterprises or SME to international<br />\r\n			4. Promote and support the preservation of arts, culture and maintain the nation, religion, monarchy</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(131, 1, 36, 'อัตลักษณ์ เอกลักษณ์', 1, '<p style=\"text-align:center\">อัตลักษณ์ของบัณฑิตคณะวิทยาการจัดการ</p>\r\n\r\n<p style=\"text-align:center\">&ldquo;เป็นนักปฎิบัติ ถนัดวิชาการ เชียวชาญการสื่อสาร ชำนาญการคิด มีจิตสาธารณะ&rdquo;</p>\r\n\r\n<p style=\"text-align:center\">เอกลักษณ์ของคณะวิทยาการจัดการ</p>\r\n\r\n<p style=\"text-align:center\">&ldquo;เน้นความเป็นวัง ปลูกฝังองค์ความรู้ ยึดยั่นคุณธรรมให้เชิดชู เป็นองค์กรแห่งการเรียนรู้สู่สากล&rdquo;</p>\r\n', NULL, NULL),
(132, 2, 36, 'Identity', 1, '<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:rgb(33, 33, 33); font-family:arial,sans-serif; font-size:16px\">Identity of the Faculty of Management Science graduates &quot;Being an academic expert, expert in communication, expert in thinking, having a public mind&nbsp;The identity of the Faculty of Management Science &quot;Focus on being a palace Cultivate knowledge Adhere to virtue to glorify Is an international learning organization.&nbsp;</span></p>\r\n\r\n<p><span style=\"color:rgb(33, 33, 33); font-family:arial,sans-serif; font-size:16px\">&quot;Being an academic expert, expert in communication, expert in thinking, having a public mind&quot; The identity of the Faculty of Management Science Focus on being a palace Cultivate knowledge Adhere to virtue to glorify Is an international learning organization.&nbsp;</span></p>\r\n', NULL, NULL),
