			<td>17 ก.ค. 62</td>\r\n		</tr>\r\n		<tr>\r\n			<td>11.</td>\r\n			<td>ดาวน์โหลดเอกสารรายงานตัวและบันทึกประวัตินักศึกษา ที่ <a href=\"\">www.ssru.ac.th</a>, <a href=\"\">www.reg.ssru.ac.th</a></td>\r\n			<td>6-19 ก.พ. 62</td>\r\n			<td>28 เม.ย. -7 พ.ค. 62</td>\r\n			<td>28 เม.ย. -7 พ.ค. 62</td>\r\n			<td>18-22 พ.ค. 62</td>\r\n			<td>8-25 มิ.ย. 62</td>\r\n			<td>21-25 มิ.ย. 62</td>\r\n			<td>18-20 ก.ค. 62</td>\r\n		</tr>\r\n		<tr>\r\n			<td>12.</td>\r\n			<td>รายงานตัวและทำสัญญาทุนเพชรสุนันทา</td>\r\n			<td>&nbsp;</td>\r\n			<td>23 พ.ค. 62</td>\r\n			<td>23 พ.ค. 62</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>13.</th>\r\n			<th>รายงานตัวและชำระค่าธรรมเนียมเข้าศึกษา</th>\r\n			<th>20-21 ก.พ. 62</th>\r\n			<th>23-24 พ.ค. 62</th>\r\n			<th>23-24 พ.ค. 62</th>\r\n			<th>23-24 พ.ค. 62</th>\r\n			<th>26-27 มิ.ย. 62</th>\r\n			<th>26-27 มิ.ย. 62</th>\r\n			<th>21 ก.ค. 62</th>\r\n		</tr>\r\n		<tr>\r\n			<td>14.</td>\r\n			<td>การปฐมนิเทศ</td>\r\n			<td>(รอประกาศ)</td>\r\n			<td>(รอประกาศ)</td>\r\n			<td>(รอประกาศ)</td>\r\n			<td>(รอประกาศ)</td>\r\n			<td>(รอประกาศ)</td>\r\n			<td>(รอประกาศ)</td>\r\n			<td>(รอประกาศ)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>15.</td>\r\n			<td>ลงทะเบียนเรียน (ติดต่อคณะ/วิทยาลัย)</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>17 ส.ค. 62</td>\r\n		</tr>\r\n		<tr>\r\n			<td>16.</td>\r\n			<td>เปิดภาคเรียน</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>15 ส.ค. 62</td>\r\n			<td>17 ส.ค. 62</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>หมายเหตุ * ความสามารถพิเศษ สอบสัมภาษณ์และสอบปฎิบัติวิชาเฉพาะทาง</p>\r\n\r\n<p>ที่ กิจกรรม รอบที่2 (Quota)</p>\r\n\r\n<p>วัน - เวลา ดำเนินการ</p>\r\n</div>\r\n</div>\r\n</div>\r\n', NULL),
(139, 1, 39, 'ค่าธรรมเนียม / ค่าใช้จ่ายในการศึกษา', 1, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"text-align:center\">\r\n			<p><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\"><strong>มหาวิทยาลัยราชภัฏสวนสุนันทา</strong></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\">\r\n			<p><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">ตารางค่าธรรมเนียมการศึกษาสำหรับ นักศึกษาระดับปริญญาตรีและปริญญาตรี(ต่อเนื่อง)</span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">หลักสูตร</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">ลงทะเบียนไม่เกิน 10 หน่วยกิจ<br />\r\n			เหาจ่ายภาคเรียนละ(บาท)</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">ลงทะเบียนเกิน 10 หน่วยกิจ<br />\r\n			เหาจ่ายภาคเรียนละ(บาท)</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">1 หลักสูตรการแพทย์แผนไทย</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">7,500</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">15,000</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">2 หลักสูตรวิทยาศาสตร์</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">7,500</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">15,000</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:20px\"><span style=\"color:#F0F8FF\">3 หลัก