(141, 1, 40, 'มหาวิทยาลัยราชภัฏสวนสุนันทา', 1, '<p>บัญชีรายชื่อบัณฑิตที่ยืนยันเข้ารับพระราชทานปริญญาบัตร ประจําปี&nbsp;พ.ศ. 2561</p>\r\n', NULL, NULL),
(142, 2, 40, 'Suan Sunandha Rajabhat University', 1, '<p><span style=\"color:rgb(33, 33, 33); font-family:arial,sans-serif; font-size:16px; white-space:pre-wrap\">List of graduates who confirmed their graduation year of 2018</span><span style=\"color:rgb(33, 33, 33); font-family:arial,sans-serif; font-size:16px; white-space:pre-wrap\">List of graduates who confirmed their graduation year of 2018</span></p>\r\n', NULL, NULL),
(143, 1, 41, 'รับสมัครบุคคลคัดเลือกเข้าการศึกษา', 1, '<p>กำหนดการลงทะเบียนและรายตัวบัณฑิต เพื่อรับเอกสารสำคัญทางการศึกษา ประจำปีการศึกษา 2560 - 2561 ดังนี้&nbsp;</p>\r\n', NULL, NULL),
