(396, 2, 88, 'วันที่ 11 เดือน 12', 1, NULL, NULL, NULL),
(397, 1, 89, 'ประชาสัมพันธ์ขอเชิญเข้าร่วมพิธีไหว้บรมครูนิเทศศาสตร์ ประจำปี 2561', 1, '<p>ประชาสัมพันธ์ขอเชิญเข้าร่วมพิธีไหว้บรมครูนิเทศศาสตร์ ประจำปี 2561</p>\r\n', '<p>ประชาสัมพันธ์ขอเชิญเข้าร่วมพิธีไหว้บรมครูนิเทศศาสตร์ ประจำปี 2561</p>\r\n', NULL),
(398, 2, 89, 'Public News : Inviting to worship Communication Arts teacher 2018', 1, '<p>Public News : Inviting to worship Communication Arts teacher 2018</p>\r\n', '<p>Public News : Inviting to worship Communication Arts teacher 2018</p>\r\n', NULL),
(399, 1, 90, 'ประชาสัมพันธ์การประกวด SSRU QUEEN 2018', 1, '<p>&quot;ถูกต้องเท่าเทียม : Right and Equality&quot;<br />\r\nSSRU QUEEN 2018 ที่สุดของเวทีการประกวดเพศทางเลือกในมหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>&quot;ถูกต้องเท่าเทียม : Right and Equality&quot;<br />\r\nSSRU QUEEN 2018 ที่สุดของเวทีการประกวดเพศทางเลือกในมหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n\r\n<p>????ผู้ชนะเลิศได้ครองมงกุฎเกียรติยศมูลค่า 100,000 บาทเป็นเวลา 1 ปี สายสะพาย ถ้วยรางวัล เงินสด 10,000 บาท คอร์สเสริมความงามจากมิฟตาคลีนิกมูลค่า 20,000 บาท ผลิตภัณฑ์จากเครื่องสำอาง MTI มูลค่า 10,000 บาท บัตรชมภาพยนตร์จากเมเจอร์ซินิเพล็กซ์ มูลค่า 2,000 บาท</p>\r\n\r\n<p>????&nbsp;รองชนะเลิศอันดับที่ 1 ได้รับสายสะพาย ถ้วยรางวัล เงินสด 8,000 บาท คอร์สเสริมความงามจากมิฟตาคลีนิกมูลค่า 20,000 บาท ผลิตภัณฑ์จากเครื่องสำอาง MTI มูลค่า 5,000 บาท บัตรชมภาพยนตร์จากเมเจอร์ซินิเพล็กซ์ มูลค่า 1,000 บาท</p>\r\n\r\n<p>????&nbsp;รองชนะเลิศอันดับที่ 2 ได้รับสายสะพาย ถ้วยรางวัล เงินสด 5,000 บาท คอร์สเสริมความงามจากมิฟตาคลีนิกมูลค่า 20,000 บาท ผลิตภัณฑ์จากเครื่องสำอาง MTI มูลค่า 5,000 บาท บัตรชมภาพยนตร์จากเมเจอร์ซินิเพล็กซ์ มูลค่า 1,000 บาท</p>\r\n\r\n<p>????รางวัล The creator ได้รับเงินสด 3,000 บาท</p>\r\n\r\n<p>????popular vote ได้รับสายสะพาย&nbsp;<br />\r\nผลิตภัณฑ์จากผลิตภัณฑ์ MTI มูลค่า 5,000 บาท เข้ารอบ 10 คนโดยอัตโนมัติ</p>\r\n\r\n<p>ดาวน์โหลดใบสมัครได้ที่แฟนเพจ &ldquo;โครงการจัดตั้งคณะนิเทศศาสตร์ มหาวิทยาลัยราชภัฏสวนสุนันทา&rdquo;ตั้งแต่วัน16-31 ตุลาคม ส่งใบสมัครได้ที่ห้องสโมสรนักศึกษาคณะวิทยาการจัดการ</p>\r\n\r\n<p>รอบตัดสินวันอาทิตย์ที่ 11 พฤศจิกายน 2561 หน้าคณะวิทยาการจัดการ ตั้งแต่ 09.00 เป็นต้นไป</p>\r\n\r\n<p>&ldquo;ใครจะเป็น QUEEN ของสวนสุนันทาคนต่อไป&rdquo;</p>\r\n', NULL),
(400, 2, 90, 'PuBLIC News : SSRU Queen Contest 2018', 1, '<p>&quot;Equal Equality: Right and Equality&quot; SSRU QUEEN 2018 Most of the stage of the sex selection contest in Suan Sunandha Rajabhat University ???? Winner of crown of honor worth 100,000 baht for a year, sash cash trophy 10,000 baht beauty course from Miftalkeni worth 20,000 Baht MTI cosmetics worth 10,000 baht movie tickets from Major Cine. Duplex Value 2,000 Baht</p>\r\n', '<p>&quot;Equal Equality: Right and Equality&quot; SSRU QUEEN 2018 Most of the stage of the sex selection contest in Suan Sunandha Rajabhat University ???? Winner of crown of honor worth 100,000 baht for a year, sash cash trophy 10,000 baht beauty course from Miftalkeni worth 20,000 Baht MTI cosmetics worth 10,000 baht movie tickets from Major Cine. Duplex Value 2,000 Baht</p>\r\n', NULL),
