(409, 1, 95, 'วจก. ประชุมคณะกรรมการดำเนินงานจัดการประชุมวิชาการระดับชาติและนานาชาติ ICMSIT ครั้งที่ 5 ประจำปี 2561 พร้อมการนำเสนอผลงานสำหรับนักศึกษาปริญญาตรี', 1, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">วันที่ 19 เมษายน 2561 &nbsp; &nbsp;คณะวิทยาการจัดการ &nbsp;จัดประชุมคณะกรรมการดำเนินงานจัดการประชุมวิชาการระดับชาติและนานาชาติ &nbsp;ครั้งที่ 5 ( ICMSIT &nbsp;2018)</span></p>\r\n', '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">วันที่ 19 เมษายน 2561 &nbsp; &nbsp;คณะวิทยาการจัดการ &nbsp;จัดประชุมคณะกรรมการดำเนินงานจัดการประชุมวิชาการระดับชาติและนานาชาติ &nbsp;ครั้งที่ 5 ( ICMSIT &nbsp;2018) &nbsp;ที่จะจัดขึ้นในวันศุกร์ที่ 15 มิถุนายน 2561 &nbsp;โดยผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา &nbsp;คณบดีคณะวิทยาการจัดการ &nbsp; เป็นประธานการประชุม &nbsp; เพื่อหารือและเตรียมความพร้อมการจัดประชุมวิชาการระดับชาติและนานาชาติดังกล่าว &nbsp;รวมทั้งการดำเนินการพัฒนานักศึกษาสู่การวิจัย เพื่อเข้าสู่การจัดประชุมวิชาการและนำเสนอผลงานสำหรับนักศึกษาปริญญาตรี &nbsp; และวาระอื่นๆที่เกี่ยวข้อง &nbsp; โดยมีรองคณบดี &nbsp;หัวหน้ากลุ่มสาขา &nbsp;หัวหน้าสาขา หัวหน้าแขนง และบุคลากรที่เกี่ยวข้อง เข้าร่วมประชุม ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) &nbsp;คณะวิทยาการจัดการ</span></p>\r\n', NULL),
(410, 2, 95, 'Faculty of Management Science held the conference of Managing Knowledge Academy', 1, NULL, NULL, NULL),
(411, 1, 96, 'คณะวิทยาการจัดการ จัดประชุมติดตามการพัฒนาการให้บริการ สำหรับบุคลากรสายสนับสนุนวิชาการ', 1, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">วันที่ 24 เมษายน 2561 &nbsp;คณะวิทยาการจัดการ จัดประชุมติดตามการพัฒนาการให้บริการ สำหรับบุคลากรสายสนับสนุนวิชาการ โดยนางสาวนิภา</span></p>\r\n', '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;วันที่ 24 เมษายน 2561 &nbsp;คณะวิทยาการจัดการ จัดประชุมติดตามการพัฒนาการให้บริการ สำหรับบุคลากรสายสนับสนุนวิชาการ โดยนางสาวนิภาวรรณ ธาราศักดิ์ หัวหน้าสำนักงานคณบดี &nbsp;เป็นประธานการประชุม โดยมีบุคลากรสายสนุนวิชาการประจำคณะ &nbsp;เข้าร่วมประชุม &nbsp;ณ ห้องประชุมรวมใจการจัดการ 1 คณะวิทยาการจัดการ</span></p>\r\n', NULL),
(412, 2, 96, 'คณะวิทยาการจัดการ จัดประชุมติดตามการพัฒนาการให้บริการ สำหรับบุคลากรสายสนับสนุนวิชาการ', 1, '<p>คณะวิทยาการจัดการ จัดประชุมติดตามการพัฒนาการให้บริการ สำหรับบุคลากรสายสนับสนุนวิชาการ</p>\r\n', NULL, NULL),
(413, 1, 97, 'คณะวิทยาการจัดการ จัดโครงการอบรมให้ความรู้ทางด้านการประกันคุณภาพ ประจำปีการศึกษา 2560', 1, '<p>วันที่ 25 เมษายน 2561 ฝ่ายกิจการนักศึกษาและศิลปวัฒนธรรม คณะวิทยาการจัดการ &nbsp;จัดโครงการอบรมให้ความรู้ทางด้านการประกันคุณภาพ ประจำปีการศึกษา 2560 &nbsp;โดยอาจารย์สุพัตรา กาญจโนภาส รองคณบดีฝ่ายกิจการนักศึกษา เป็นประธานเปิดโครงการ</p>\r\n', '<p>วันที่ 25 เมษายน 2561 ฝ่ายกิจการนักศึกษาและศิลปวัฒนธรรม คณะวิทยาการจัดการ &nbsp;จัดโครงการอบรมให้ความรู้ทางด้านการประกันคุณภาพ ประจำปีการศึกษา 2560 &nbsp;โดยอาจารย์สุพัตรา กาญจโนภาส รองคณบดีฝ่ายกิจการนักศึกษา เป็นประธานเปิดโครงการ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; การจัดโครงการดังกล่าว &nbsp;มีวัตถุประสงค์เพื่อส่งเสริมและพัฒนาความรู้และทักษะเกี่ยวกับการประกันคุณภาพให้กับนักศึกษา เพื่อให้นักศึกษาได้รับความรู้และทักษะเกี่ยวกับการประกันคุณภาพการศึกษา มีทักษะการดำเนินกิจกรรม/โครงการตามกระบวนการคุณภาพมากยิ่งขึ้น พร้อมทั้งได้มีการแลกเปลี่ยนปัญหา อุปสรรค และหาแนวทางแก้ไขปรับปรุงในการดำเนินงานให้มีประสิทธิภาพมากยิ่งขึ้น &nbsp;ซึ่งได้รับเกียรติจากผู้ช่วยศาสตราจารย์ ดร.สิทธิชัย &nbsp;ธรรมเสน่ห์ &nbsp; ผู้ช่วยอธิการบดีฝ่ายวิชาการ มหาวิทยาลัยราชภัฏสวนสุนันทา &nbsp; &nbsp;เป็นวิทยากรบรรยาย หัวข้อ&ldquo;การประกันคุณภาพการศึกษาภายใน อัตลักษณ์ เอกลักษณ์ และคุณธรรมจริยธรรมสำหรับนักศึกษา&rdquo; และ ดร.พงศวีร์ สุภานนท์ กรรมการดำเนินงานกิจการนักศึกษา &nbsp;บรรยายให้ความรู้ &nbsp;หัวข้อ&ldquo;บทบาทของนักศึกษากับการประกันคุณภาพการศึกษา&rdquo; &nbsp;มีนักศึกษากลุ่มสาขาวิชาบริหารธุรกิจและนิเทศศาสตร์ เข้าร่วมอบรมโดยพร้อมเพรียงกัน &nbsp;ณ ห้องประชุมสุวพักตร์นิเวศน์(5724) คณะวิทยาการจัดการ</p>\r\n', NULL),
