(415, 1, 98, 'คณะวิทยาการจัดการ จัดประชุมเชิงปฏิบัติการ “การติดตามผลการดำเนินงานประกันคุณภาพการศึกษาภายใน ระดับหลักสูตร ประจำปีการศึกษา 2560”', 1, '<p>เมื่อวันที่ 21 พฤษภาคม 2561 ที่ผ่านมา ฝ่ายแผนงานและประกันคุณภาพ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดการประชุมเชิงปฏิบัติการ&nbsp;</p>\r\n', '<p>&nbsp;เมื่อวันที่ 21 พฤษภาคม 2561 ที่ผ่านมา ฝ่ายแผนงานและประกันคุณภาพ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดการประชุมเชิงปฏิบัติการ &nbsp;&ldquo;การติดตามผลการดำเนินงานประกันคุณภาพการศึกษาภายใน ระดับหลักสูตร ประจำปีการศึกษา 2560&rdquo; โดยมีผู้ช่วยศาสตราจารย์ ดร.ชารวี บุตรบำรุง รองคณบดีฝ่ายอผนงานและประกันคุณภาพ พร้อมด้วย ดร.กฤษณะ เชื้อชัยนาท รองคณบดีฝ่ายวิชาการ &nbsp; ให้เกียรติเป็นผู้ชี้แจง ให้ข้อมูลในการประชุม เพื่อจัดทำและติดตามการเขียนผลการดำเนินงานของหลักสูตร (มคอ.7)จำนวน 5 หลักสูตร คือ นิเทศศาสตรบัณฑิต บริหารธุรกิจบัณฑิต เศรษฐศาสตรบัณฑิต บัญชีบัณฑิต และคอมพิวเตอร์ธุรกิจ&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; การจัดประชุมเชิงปฏิบัติการในครั้งนี้ &nbsp;มีวัตถุประสงค์เพื่อติดตามผลการดำเนินงานของหลักสูตร ภาคเรียนที่ 2/2560 พร้อมให้คำแนะนำและข้อเสนอแนะ รวมทั้งเป็นการเตรียมความพร้อมรับการตรวจประเมินคุณภาพการศึกษาภายใน ระดับหลักสูตรต่อไป &nbsp;มีอาจารย์ประจำหลักสูตร ได้แก่ กลุ่มสาขาวิชาบริหารธุรกิจ และกลุ่มสาขาวิชานิเทศศาสตร์ &nbsp;เข้าร่วมประชุม &nbsp; ณ &nbsp; ห้องประชุมสุวพักตร์นิเวศน์ คณะวิทยาการจัดการ &nbsp;สำหรับการจัดประชุมดังกล่าวจะจัดขึ้นต่อเนื่องไปจนถึงวันที่ 19 มิถุนายน 2561</p>\r\n', NULL),
