(417, 1, 99, 'ประกาศรายชื่อผู้มีสิทธิ์เข้าศึกษาต่อระดับปริญญาตรี โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ (ภาคบ่าย)', 1, '<div class=\"row\" style=\"box-sizing: border-box; margin-right: -15px; margin-left: -15px; font-family: Kanit, sans-serif; font-size: 14px; margin-top: 10px;\">\r\n<div class=\"col-sm-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 855.5px;\"><span style=\"font-size:20px\">ประกาศรายชื่อผู้มีสิทธิ์เข้าศึกษาต่อระดับปริญญาตรี โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ (ภาคบ่าย)</span></div>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n', '<div class=\"row\" style=\"box-sizing: border-box; margin-right: -15px; margin-left: -15px; font-family: Kanit, sans-serif; font-size: 14px; margin-top: 10px;\">\r\n<div class=\"col-sm-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 855.5px; text-align: center;\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clearfix\" style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\">&nbsp;</div>\r\n\r\n<div id=\"mainContentArea\" style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190517/9c03f9390809def7f8c4f37a8ebc4b097f5ac53e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:611.869px; max-width:100%; text-align:center; vertical-align:middle; width:738px\" /></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190517/c1822f6e477df107ede15179ec6711b344d054db.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:957.407px; max-width:100%; text-align:center; vertical-align:middle; width:770px\" /></p>\r\n\r\n