(418, 2, 99, 'คณะวิทยาการจัดการ จัดประชุมการจัดการความรู้ สายวิชาการ ประจำปีงบประมาณ 2561', 1, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;เมื่อวันที่ 22 พฤษภาคม 2561 &nbsp;ฝ่ายแผนงานและประกันคุณภาพ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดประชุมการจัดการความรู้ บุคลากรสายวิชาการ ประจำปี 2561</span></p>\r\n', '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;เมื่อวันที่ 22 พฤษภาคม 2561 &nbsp;ฝ่ายแผนงานและประกันคุณภาพ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดประชุมการจัดการความรู้ บุคลากรสายวิชาการ ประจำปี 2561 เพื่อหารือพร้อมแลกเปลี่ยนเรียนรู้พร้อมรับข้อเสนอแนะจากผู้ทรงคุณวุฒิ &nbsp;โดยแบ่งกลุ่มการจัดการความรู้ 2 กลุ่ม &nbsp; ได้แก่ กลุ่มการจัดการเรียนการสอน ซึ่งสมาชิกกลุ่มสามารถนำความรู้ ข้อเสนอแนะจากผู้ทรงคุณวุฒิไปปรับปรุงองค์ความรู้เกี่ยวกับการพัฒนาศักยภาพนักศึกษาและการเสริมสร้างทักษะการเรียนรู้ในศตวรรษที่ 21 &nbsp; และกลุ่มงานวิจัย &nbsp;เพื่อสมาชิกกลุ่มนำข้อเสนอแนะการแลกเปลี่ยนเรียนรู้ร่วมกัน นำไปปรับปรุงแก้ไขสำหรับการเขียนข้อเสนอโครงการวิจัยต่อไป &nbsp;มีคณาจารย์ซึ่งเป็นสมาชิกกลุ่มการจัดการความรู้ เข้าร่วมประชุม &nbsp;ณ &nbsp;ห้องประชุมสุวพักตร์นิเวศน์ &nbsp;คณะวิทยาการจัดการ</span></p>\r\n', NULL),
