(421, 1, 101, '“แอน – สปาย” คว้าตำแหน่งดาว-เดือน สาขาวิชาการบัญชี ประจำปี 2561', 1, '<p>เมื่อเร็วๆนี้ ณ หอประชุมสุนันทานุสรณ์ มหาวิทยาลัยราชภัฏสวนสุนันทา สาขาวิชาการบัญชี คณะวิทยาการจัดการ จัดโครงการ &ldquo;Acting Day 2018&nbsp;</p>\r\n', '<p>เมื่อเร็วๆนี้ ณ หอประชุมสุนันทานุสรณ์ มหาวิทยาลัยราชภัฏสวนสุนันทา สาขาวิชาการบัญชี คณะวิทยาการจัดการ จัดโครงการ &ldquo;Acting Day 2018 เพื่อค้าหาผู้แทนนักศึกษาต้นแบบ และปฎิบัติหน้าที่จิตอาสาเพื่อสังคมต่อไป ผลการตัดสิน ปรากฏว่า นางสาวปานจันทร์ มุทาวัน (แอน) และนายเดชณรงค์ ศิริ (สปาย) คว้าตำแหน่งดาวและเดือนสาขาวิชาการบัญชี ประจำปี 2561 นอกจากนี้รางวัลรองชนะเลิศอันดับ 1 ได้แก่ นางสาวนันท์นภัส อุปรไมยมาศ (ฟ้า) และนายกิตติกวิน มุสิกโก(ฟิวส์)&nbsp; รางวัล Popular Vote ได้แก่ นายพงศกร อยู่คง (ทีม)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ภาพ : ณัฏฐิยา นุชนาง</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กันยากร สุจริตเนติการ : งานประชาสัมพันธ์&nbsp; คณะวิทยาการจัดการ</p>\r\n\r\n<p>www.fms.ssru.ac.th</p>\r\n\r\n<p>IG : fms_ssru<br />\r\nTwitter : @pr_fms_ssru<br />\r\nYoutube : PR. FMS SSRU&nbsp;<br />\r\nFacebook Fanpage : คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n', ''),
(422, 2, 101, '“แอน – สปาย” คว้าตำแหน่งดาว-เดือน สาขาวิชาการบัญชี ประจำปี 2561', 1, '<p>เมื่อเร็วๆนี้ ณ หอประชุมสุนันทานุสรณ์ มหาวิทยาลัยราชภัฏสวนสุนันทา สาขาวิชาการบัญชี คณะวิทยาการจัดการ จัดโครงการ &ldquo;Acting Day 2018&nbsp;</p>\r\n', '<p>เมื่อเร็วๆนี้ ณ หอประชุมสุนันทานุสรณ์ มหาวิทยาลัยราชภัฏสวนสุนันทา สาขาวิชาการบัญชี คณะวิทยาการจัดการ จัดโครงการ &ldquo;Acting Day 2018 เพื่อค้าหาผู้แทนนักศึกษาต้นแบบ และปฎิบัติหน้าที่จิตอาสาเพื่อสังคมต่อไป ผลการตัดสิน ปรากฏว่า นางสาวปานจันทร์ มุทาวัน (แอน) และนายเดชณรงค์ ศิริ (สปาย) คว้าตำแหน่งดาวและเดือนสาขาวิชาการบัญชี ประจำปี 2561 นอกจากนี้รางวัลรองชนะเลิศอันดับ 1 ได้แก่ นางสาวนันท์นภัส อุปรไมยมาศ (ฟ้า) และนายกิตติกวิน มุสิกโก(ฟิวส์)&nbsp; รางวัล Popular Vote ได้แก่ นายพงศกร อยู่คง (ทีม)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ภาพ : ณัฏฐิยา นุชนาง</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กันยากร สุจริตเนติการ : งานประชาสัมพันธ์&nbsp; คณะวิทยาการจัดการ</p>\r\n\r\n<p>www.fms.ssru.ac.th</p>\r\n\r\n<p>IG : fms_ssru<br />\r\nTwitter : @pr_fms_ssru<br />\r\nYoutube : PR. FMS SSRU&nbsp;<br />\r\nFacebook Fanpage : คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n', ''),
(423, 1, 102, 'นักศึกษาแขนงวิชาการประชาสัมพันธ์ฯ ได้รับโล่รางวัลคลิปวิดีโอยอดเยี่ยมจากสภากาชาดไทย', 1, '<p>เมื่อวันที่ 25 กันยายน 2561 สำนักงานยุวกาชาด&nbsp; ร่วมกับสหพันธ์สภากาชาดและสภาเสี้ยววงเดือนแดงระหว่างประเทศ International Federation of Red Cross and Red Crescent Societies (IFRC)&nbsp; ได้จัดพิธีมอบโล่รางวัล&nbsp; ในงาน Young Crenoactive Awards 2018&nbsp; ณ โรงภาพยนตร์พารากอน ซีนีเพล็กซ์ ชั้น 6 ศูนย์การค้าสยามพารากอน เขตปทุมวัน กรุงเทพมหานคร</p>\r\n', '<p>เมื่อวันที่ 25 กันยายน 2561 สำนักงานยุวกาชาด&nbsp; ร่วมกับสหพันธ์สภากาชาดและสภาเสี้ยววงเดือนแดงระหว่างประเทศ International Federation of Red Cross and Red Crescent Societies (IFRC)&nbsp; ได้จัดพิธีมอบโล่รางวัล&nbsp; ในงาน Young Crenoactive Awards 2018&nbsp; ณ โรงภาพยนตร์พารากอน ซีนีเพล็กซ์ ชั้น 6 ศูนย์การค้าสยามพารากอน เขตปทุมวัน กรุงเทพมหานคร</p>\r\n\r\n<p>&nbsp; โดยทีม The pigeon&nbsp; &nbsp;นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp; สร้างชื่อ คว้าโล่รางวัลการประกวดโครงการ Young PR Club เป็นการรวมพลังเผยแพร่ความรู้เครื่องหมายกาชาด เพื่อนำเสนอผลงานดีเด่นของเยาวชนด้านการทำคลิปวิดีโอเกี่ยวกับจิตอาสาและเครื่องหมายกาชาด ซึ่งแสดงถึงความ Creative&nbsp; จากผลงานคลิปวิดีโอยอดเยี่ยมเรื่อง &quot;ความรู้เครื่องหมายสภากาชาด&quot; โดยคุณเตช บุนนาค ผู้ช่วยเลขาธิการสภากาชาดไทย ฝ่ายบริหาร เป็นประธานมอบโล่รางวัล</p>\r\n\r\n<p>และในวันนี้ (26 กันยายน 2561)&nbsp; นักศึกษาทีม &ldquo;The pigeon &rdquo; พร้อมด้วยหัวหน้าแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร&nbsp; คณาจารย์ประจำแขนง&nbsp; นำโล่เกียรติยศเข้าพบผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา&nbsp; คณบดีคณะวิทยาการจัดการ โดยคณบดีกล่าวชื่นชมและแสดงความยินดีแก่นักศึกษาที่ได้รับรางวัล&nbsp; &nbsp;ณ&nbsp; สำนักงานคณบดีคณะวิทยาการจัดการ</p>\r\n\r\n<p>คณะวิทยาการจัดการ&nbsp; มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp; ขอแสดงความยินดีกับนักศึกษาที่ได้รับรางวัลมา ณ โอกาสนี้</p>\r\n\r\n<p>ภาพ/ข่าว : สุมณี บุญเพ็ง/อาสายุวกาชาด สภากาชาดไทย</p>\r\n\r\n<p>กันยากร สุจริตเนติการ : งานประชาสัมพันธ์&nbsp; คณะวิทยาการจัดการ</p>\r\n\r\n<p>www.fms.ssru.ac.th</p>\r\n\r\n<p>IG : fms_ssru<br />\r\nTwitter : @pr_fms_ssru<br />\r\nYoutube : PR. FMS SSRU&nbsp;<br />\r\nFacebook Fanpage : คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n', ''),
(424, 2, 102, 'นักศึกษาแขนงวิชาการประชาสัมพันธ์ฯ ได้รับโล่รางวัลคลิปวิดีโอยอดเยี่ยมจากสภากาชาดไทย', 1, '<p>เมื่อวันที่ 25 กันยายน 2561 สำนักงานยุวกาชาด&nbsp; ร่วมกับสหพันธ์สภากาชาดและสภาเสี้ยววงเดือนแดงระหว่างประเทศ International Federation of Red Cross and Red Crescent Societies (IFRC)&nbsp; ได้จัดพิธีมอบโล่รางวัล&nbsp; ในงาน Young Crenoactive Awards 2018&nbsp; ณ โรงภาพยนตร์พารากอน ซีนีเพล็กซ์ ชั้น 6 ศูนย์การค้าสยามพารากอน เขตปทุมวัน กรุงเทพมหานคร</p>\r\n', '<p>เมื่อวันที่ 25 กันยายน 2561 สำนักงานยุวกาชาด&nbsp; ร่วมกับสหพันธ์สภากาชาดและสภาเสี้ยววงเดือนแดงระหว่างประเทศ International Federation of Red Cross and Red Crescent Societies (IFRC)&nbsp; ได้จัดพิธีมอบโล่รางวัล&nbsp; ในงาน Young Crenoactive Awards 2018&nbsp; ณ โรงภาพยนตร์พารากอน ซีนีเพล็กซ์ ชั้น 6 ศูนย์การค้าสยามพารากอน เขตปทุมวัน กรุงเทพมหานคร</p>\r\n\r\n<p>&nbsp; โดยทีม The pigeon&nbsp; &nbsp;นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp; สร้างชื่อ คว้าโล่รางวัลการประกวดโครงการ Young PR Club เป็นการรวมพลังเผยแพร่ความรู้เครื่องหมายกาชาด เพื่อนำเสนอผลงานดีเด่นของเยาวชนด้านการทำคลิปวิดีโอเกี่ยวกับจิตอาสาและเครื่องหมายกาชาด ซึ่งแสดงถึงความ Creative&nbsp; จากผลงานคลิปวิดีโอยอดเยี่ยมเรื่อง &quot;ความรู้เครื่องหมายสภากาชาด&quot; โดยคุณเตช บุนนาค ผู้ช่วยเลขาธิการสภากาชาดไทย ฝ่ายบริหาร เป็นประธานมอบโล่รางวัล</p>\r\n\r\n<p>และในวันนี้ (26 กันยายน 2561)&nbsp; นักศึกษาทีม &ldquo;The pigeon &rdquo; พร้อมด้วยหัวหน้าแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร&nbsp; คณาจารย์ประจำแขนง&nbsp; นำโล่เกียรติยศเข้าพบผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา&nbsp; คณบดีคณะวิทยาการจัดการ โดยคณบดีกล่าวชื่นชมและแสดงความยินดีแก่นักศึกษาที่ได้รับรางวัล&nbsp; &nbsp;ณ&nbsp; สำนักงานคณบดีคณะวิทยาการจัดการ</p>\r\n\r\n<p>คณะวิทยาการจัดการ&nbsp; มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp; ขอแสดงความยินดีกับนักศึกษาที่ได้รับรางวัลมา ณ โอกาสนี้</p>\r\n\r\n<p>ภาพ/ข่าว : สุมณี บุญเพ็ง/อาสายุวกาชาด สภากาชาดไทย</p>\r\n\r\n<p>กันยากร สุจริตเนติการ : งานประชาสัมพันธ์&nbsp; คณะวิทยาการจัดการ</p>\r\n\r\n<p>www.fms.ssru.ac.th</p>\r\n\r\n<p>IG : fms_ssru<br />\r\nTwitter : @pr_fms_ssru<br />\r\nYoutube : PR. FMS SSRU&nbsp;<br />\r\nFacebook Fanpage : คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n', ''),
(425, 1, 103, 'ขอบคุณทุกน้ำใจเพื่อผู้พิการทางสายตา “Same World But Another Side โลกคู่ขนาน”', 1, '<p>แขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา และผู้จัดโครงการ &ldquo;Save World But Another Side โลกคู่ขนาน&rdquo;</p>\r\n', '<p>แขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา และผู้จัดโครงการ &ldquo;Save World But Another Side โลกคู่ขนาน&rdquo; ขอขอบพระคุณทุกท่านที่เป็นส่วนหนึ่งในการพัฒนาคุณภาพการศึกษาของผู้พิการ ทางสายตาด้วยการบริจาคกระดาษที่ไม่ใช้แล้วมากถึง 20 กิโลกรัม ภายในระยะเวลา 3 สัปดาห์ ที่ผ่านมา หลังจากที่ได้รับการบริจาคกระดาษที่ไม่ใช้แล้ว&nbsp; คณะผู้จัดโครงการฯ จะนำไปมอบให้โรงเรียนสอนคนตาบอด เขตราชเทวี เพื่อต่อยอดนำไปเป็นหนังสืออักษรเบรลล์ (หนังสือสำหรับคนตาบอด) ต่อไป</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; สำหรับท่านใดมีความประสงค์ที่จะบริจาคกระดาษที่ไม่ใช้แล้วสามารถบริจาคได้ตั้งแต่วันนี้ &ndash; วันศุกร์ที่ 19 ตุลาคม 2561 บริเวณจุดรับบริจาคกระดาษทั้งหมด 4 จุด ดังนี้</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1. ร้านถ่ายเอกสารตึกศิลปกรรมศาสตร์</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2. ตึกคณะวิทยาการจัดการ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. ร้านถ่ายเอกสารตึกวิทยาลัยนวัตกรรมและการจัดการ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4. ร้านถ่ายเอกสารด้านหลังตึกวิทยาลัยนานาชาติ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โดยโครงการนี้เป็นส่วนหนึ่งของรายวิชาโครงการพิเศษด้านการประชาสัมพันธ์และการสื่อสารองค์กร (PRC4802)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หากท่านใดมีความประสงค์บริจาคหรือสอบถามข้อมูลเพิ่มเติมได้ที่</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โทร: 09 &ndash; 5732 &ndash; 9968 คุณฟางข้าว</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โทร: 08 &ndash; 4066 &ndash; 1737 คุณนาเดียร์</p>\r\n', ''),
(426, 2, 103, 'ขอบคุณทุกน้ำใจเพื่อผู้พิการทางสายตา “Same World But Another Side โลกคู่ขนาน”', 1, '<p>แขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา และผู้จัดโครงการ &ldquo;Save World But Another Side โลกคู่ขนาน&rdquo;</p>\r\n', '<p>แขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา และผู้จัดโครงการ &ldquo;Save World But Another Side โลกคู่ขนาน&rdquo; ขอขอบพระคุณทุกท่านที่เป็นส่วนหนึ่งในการพัฒนาคุณภาพการศึกษาของผู้พิการ ทางสายตาด้วยการบริจาคกระดาษที่ไม่ใช้แล้วมากถึง 20 กิโลกรัม ภายในระยะเวลา 3 สัปดาห์ ที่ผ่านมา หลังจากที่ได้รับการบริจาคกระดาษที่ไม่ใช้แล้ว&nbsp; คณะผู้จัดโครงการฯ จะนำไปมอบให้โรงเรียนสอนคนตาบอด เขตราชเทวี เพื่อต่อยอดนำไปเป็นหนังสืออักษรเบรลล์ (หนังสือสำหรับคนตาบอด) ต่อไป</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; สำหรับท่านใดมีความประสงค์ที่จะบริจาคกระดาษที่ไม่ใช้แล้วสามารถบริจาคได้ตั้งแต่วันนี้ &ndash; วันศุกร์ที่ 19 ตุลาคม 2561 บริเวณจุดรับบริจาคกระดาษทั้งหมด 4 จุด ดังนี้</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1. ร้านถ่ายเอกสารตึกศิลปกรรมศาสตร์</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2. ตึกคณะวิทยาการจัดการ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. ร้านถ่ายเอกสารตึกวิทยาลัยนวัตกรรมและการจัดการ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4. ร้านถ่ายเอกสารด้านหลังตึกวิทยาลัยนานาชาติ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โดยโครงการนี้เป็นส่วนหนึ่งของรายวิชาโครงการพิเศษด้านการประชาสัมพันธ์และการสื่อสารองค์กร (PRC4802)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หากท่านใดมีความประสงค์บริจาคหรือสอบถามข้อมูลเพิ่มเติมได้ที่</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โทร: 09 &ndash; 5732 &ndash; 9968 คุณฟางข้าว</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โทร: 08 &ndash; 4066 &ndash; 1737 คุณนาเดียร์</p>\r\n', ''),
(427, 1, 104, 'คนดีต้องแชร์ นศ.พีอาร์ ช่วยเหลือคนแก่ประสบอุบัติเหตุ', 1, '<p>&nbsp;นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร มหาวิทยาลัยราชภัฎสวนสุนันทาช่วยเหลือคุณยายที่ประสบอุบัติเหตุ</p>\r\n', '<p>&nbsp;นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร มหาวิทยาลัยราชภัฎสวนสุนันทาช่วยเหลือคุณยายที่ประสบอุบัติเหตุ ทำความดีเป็นแบบอย่างประชาชนจิตอาสา ได้เข้าช่วยเหลือคุณยายอายุประมาณ 60 ปี ซึ่งประสบอุบัติเหตุลื่นล้มหัวฟาดพื้นช่วยเหลือตัวเองไม่ได้ โดยพยุงคุณยายขึ้นบนเตียงฉุกเฉิน ที่โรงพยาบาลวชิระ เพื่อให้แพทย์ได้วินิจฉัยอาการต่อไป ขอชื่นชมนักศึกษาซึ่งเป็นแบบอย่างที่ดีของประชาชนจิตอาสามา ณ โอกาสนี้</p>\r\n', ''),
(428, 2, 104, 'คนดีต้องแชร์ นศ.พีอาร์ ช่วยเหลือคนแก่ประสบอุบัติเหตุ', 1, '<p>&nbsp;นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร มหาวิทยาลัยราชภัฎสวนสุนันทาช่วยเหลือคุณยายที่ประสบอุบัติเหตุ</p>\r\n', '<p>&nbsp;นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร มหาวิทยาลัยราชภัฎสวนสุนันทาช่วยเหลือคุณยายที่ประสบอุบัติเหตุ ทำความดีเป็นแบบอย่างประชาชนจิตอาสา ได้เข้าช่วยเหลือคุณยายอายุประมาณ 60 ปี ซึ่งประสบอุบัติเหตุลื่นล้มหัวฟาดพื้นช่วยเหลือตัวเองไม่ได้ โดยพยุงคุณยายขึ้นบนเตียงฉุกเฉิน ที่โรงพยาบาลวชิระ เพื่อให้แพทย์ได้วินิจฉัยอาการต่อไป ขอชื่นชมนักศึกษาซึ่งเป็นแบบอย่างที่ดีของประชาชนจิตอาสามา ณ โอกาสนี้</p>\r\n', ''),
(429, 1, 105, '\"หนึ่งขวดก็มีค่า\" ร่วมทำความดีด้วยขวดน้ำ', 1, '<p>ขอเชิญชวน เพื่อน ๆ พี่ ๆ น้อง ๆ นักศึกษา มหาวิทยาลัยราชภัฏสวนสุนันทา มาร่วมเป็นส่วนหนึ่งในกิจกรรม &quot; หนึ่งขวดก็มีค่า&quot; ในโครงการ &quot; เรื่องเล่าของพ่อ ร.๙ &quot;</p>\r\n', '<p>ขอเชิญชวน เพื่อน ๆ พี่ ๆ น้อง ๆ นักศึกษา มหาวิทยาลัยราชภัฏสวนสุนันทา มาร่วมเป็นส่วนหนึ่งในกิจกรรม &quot; หนึ่งขวดก็มีค่า&quot; ในโครงการ &quot; เรื่องเล่าของพ่อ ร.๙ &quot;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;เพียงนำขวดน้ำ ที่ท่านไม่ได้ใช้แล้ว มาทิ้งลงในถังขยะแป้นบาสที่เราเตรียมไว้ ก็เป็นการร่วมทำความดีง่าย ๆ ไปกับเรา โดยเราจะนำรายได้จากการขายขวดน้ำเหล่านี้ ไปสมทบทุน ซื้อยาดม ยาหม่อง เพื่อแจกจ่ายให้กับประชาชนที่มารวมตัวกันทำความดีบริเวณท้องสนามหลวงในวันที่ ๑๓ ตุลาคม ๒๕๖๑ ซึ่งเป็นวันคล้ายวันสวรรคตในพระบาทสมเด็จพระปรมินทรมหาภูมิพลอดุลยเดช บรมนาถบพิตร มาร่วมเป็นส่วนหนึ่งในการทำความดีครั้งนี้ไปพร้อมกับเรากันนะคะ</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ภาพ/ข่าว: สุมณี บุญเพ็ง</p>\r\n\r\n<p>กันยากร สุจริตเนติการ : งานประชาสัมพันธ์&nbsp; คณะวิทยาการจัดการ</p>\r\n\r\n<p>www.fms.ssru.ac.th</p>\r\n\r\n<p>IG : fms_ssru<br />\r\nTwitter : @pr_fms_ssru<br />\r\nYoutube : PR. FMS SSRU&nbsp;<br />\r\nFacebook Fanpage : คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n', ''),
(430, 2, 105, '\"หนึ่งขวดก็มีค่า\" ร่วมทำความดีด้วยขวดน้ำ', 1, '<p>ขอเชิญชวน เพื่อน ๆ พี่ ๆ น้อง ๆ นักศึกษา มหาวิทยาลัยราชภัฏสวนสุนันทา มาร่วมเป็นส่วนหนึ่งในกิจกรรม &quot; หนึ่งขวดก็มีค่า&quot; ในโครงการ &quot; เรื่องเล่าของพ่อ ร.๙ &quot;</p>\r\n', '<p>ขอเชิญชวน เพื่อน ๆ พี่ ๆ น้อง ๆ นักศึกษา มหาวิทยาลัยราชภัฏสวนสุนันทา มาร่วมเป็นส่วนหนึ่งในกิจกรรม &quot; หนึ่งขวดก็มีค่า&quot; ในโครงการ &quot; เรื่องเล่าของพ่อ ร.๙ &quot;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;เพียงนำขวดน้ำ ที่ท่านไม่ได้ใช้แล้ว มาทิ้งลงในถังขยะแป้นบาสที่เราเตรียมไว้ ก็เป็นการร่วมทำความดีง่าย ๆ ไปกับเรา โดยเราจะนำรายได้จากการขายขวดน้ำเหล่านี้ ไปสมทบทุน ซื้อยาดม ยาหม่อง เพื่อแจกจ่ายให้กับประชาชนที่มารวมตัวกันทำความดีบริเวณท้องสนามหลวงในวันที่ ๑๓ ตุลาคม ๒๕๖๑ ซึ่งเป็นวันคล้ายวันสวรรคตในพระบาทสมเด็จพระปรมินทรมหาภูมิพลอดุลยเดช บรมนาถบพิตร มาร่วมเป็นส่วนหนึ่งในการทำความดีครั้งนี้ไปพร้อมกับเรากันนะคะ</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ภาพ/ข่าว: สุมณี บุญเพ็ง</p>\r\n\r\n<p>กันยากร สุจริตเนติการ : งานประชาสัมพันธ์&nbsp; คณะวิทยาการจัดการ</p>\r\n\r\n<p>www.fms.ssru.ac.th</p>\r\n\r\n<p>IG : fms_ssru<br />\r\nTwitter : @pr_fms_ssru<br />\r\nYoutube : PR. FMS SSRU&nbsp;<br />\r\nFacebook Fanpage : คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</p>\r\n', ''),
