(465, 1, 118, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/6f562405640497bc9d976de6cf399bc5114c7322.jpg\" style=\"height:424px; opacity:0.9; text-align:center; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>Doctor&#39;s Degree :</strong>&nbsp;Ph.D (Communication) 2006,Thesis: Thai Youth Consumption of Media: Globalisation and Thai Identity University of Westminster, London, U.K</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>ตำแหน่งปัจจุบัน&nbsp;</strong><br />\r\n			- รองอธิการบดี ฝ่ายวิชาการ มหาวิทยาลัยราชภัฏสวนสุนันทา<br />\r\n			- กรรมการสภามหาวิทยาลัยราชภัฏสวนสุนันทา<br />\r\n			- กรรมการสภาวิชาการมหาวิทยาลัยราชภัฏสวนสุนันทา<br />\r\n			- กรรมการวิชาการสภาการหนังสือพิมพ์แห่งชาติ<br />\r\n			- ประธานสภาคณบดีคณะวิทยาการจัดการมหาวิทยาลัยราชภัฏ<br />\r\n			- ประธานเครือข่ายนิเทศศาสตร์มหาวิทยาลัยราชภัฏ<br />\r\n			- อุปนายกสมาคมสังคมศาสตร์แห่งประเทศไทย<br />\r\n			- ที่ปรึกษาคณบดีคณะวิทยาการจัดการ<br />\r\n			- อาจารย์สาขาการโฆษณาและการสื่อสารการตลาด<br />\r\n			<strong><strong>Email :&nbsp;</strong><a href=\"mailto:somdech.ru@ssru.ac.th\" style=\"color: rgb(51, 122, 183); box-sizing: border-box; background-color: transparent; text-decoration-line: none;\">somdech.ru@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;</strong><a href=\"http://www.teacher.ssru.ac.th/somdech_ru/\" style=\"color: rgb(51, 122, 183); box-sizing: border-box; background-color: transparent; text-decoration-line: none;\">www.teacher.ssru.ac.th/somdech_ru/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
