(903, 1, 210, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/8effd119230a642c5630702f607e71fb282e4f1d.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก</strong>:</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; (บธ.ด.) บริหารธุรกิจดุษฏีบัณฑิต (การตลาด) ,มหาวิทยาลัยศรีปทุม</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">:&nbsp; &nbsp; &nbsp;(บธ.ม.)บริหารธุรกิจมหาบัณฑิต (การตลาด) ,มหาวิทยาลัยรามคำแหง</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">:&nbsp; &nbsp; &nbsp;(บธ.บ.) บริหารธุรกิจบัณฑิต (คอมพิวเตอร์ธุรกิจ),มหาวิทยาลัยราชภัฏพระนคร</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.ผู้บริหารการตลาด บริษัท สามารถ ไอโมบาย อินเตอร์แนทชั่นนอล จำกัด (มาเลเซีย)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2.อาจารย์ประจำสาขาการตลาด คณะบริหารธุรกิจ มหาวิทยาลัยเซนต์จอห์น</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3.อาจาย์ประจำสาขาการตลาด กลุ่มวิชาบริหารธุรกิจ คณะวิทยาการจัดการ /</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4. &nbsp;ผู้ช่วยคณบดีฝ่ายวิเทศสัมพันธ์ /</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5.ผู้ช่วยหัวหน้ากลุ่มสาขาวิชาบริหารธุรกิจ</span><br />\r\n			<strong><strong>Email :&nbsp;</strong></strong><a href=\"mailto:pisit.po@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">pisit.po@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/pisit_po/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/pisit_po/</a></strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
