(913, 1, 214, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/6e896e8904b11377243433f2c466bb6f41a3e5b6.jpg\" style=\"height:425px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก &nbsp;</strong>:</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;หลักสูตรนิเทศศาสตรดุษฎีบัณฑิต มหาวิทยาลัยธุรกิจบัณฑิต</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท &nbsp;:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;การศึกษามหาบัณฑิต (เทคโนโลยีการศึกษา) มหาวิทยาลัยศรีนครินทรวิโรฒ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;การศึกษาบัณฑิต (เทคโนโลยีทางการศึกษา) เกียรตินิยมอันดับ 2&nbsp;</span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>ตำแหน่งปัจจุบัน :</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- รองคณบดีฝ่ายบริหาร คณะวิทยาการจัดการ,</span><br />\r\n			<br />\r\n			<strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">พ.ศ. 2558 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp;รองคณบดีฝ่ายบริหาร คณะวิทยาการจัดการ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">พ.ศ. 2547 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หัวหน้าสาขาวิชาการภาพยนตร์และสื่อสารการแสดง</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><br />\r\n			<strong>กลุ่มสาขาวิชานิเทศศาสตร์ คณะวิทยาการจัดการ</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">พ.ศ. 2543 &ndash; 2547 &nbsp; &nbsp; &nbsp; &nbsp; เลขานุการ อธิการบดีสถาบันราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">พ.ศ. 2543 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กราฟิก ดีไซเนอร์ บริษัท สำนักพิมพ์แม็ค</span><br />\r\n			&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>&nbsp;</div>\r\n', NULL, NULL),
