(993, 1, 246, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/วิเศษสิงห์.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>ปริญญาโท &nbsp;</strong>: &nbsp;บริหารธุรกิจมหาบัณฑิต(การบัญชี),มหาวิทยาลัยสยาม</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>ปริญญาตรี &nbsp;</strong>: &nbsp; บริหารธุรกิจบัณฑิต(การบัญชี),สถาบันเทคโนโลยีราชมงคล</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>ตำแหน่งปัจจุบัน : &nbsp;</strong>หัวหน้าสาขาวิชาการบัญชี</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">1. &nbsp;พ.ศ. 2538-2539 &nbsp;ธนาคารศรีนคร จำกัด(มหาชน) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">2. พ.ศ. 2539-2547 &nbsp;หน่วยตรวจสอบภายใน สำนักงานสภาสถาบันราชภัฏ กระทรวงศึกษาธิการ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">3. &nbsp;พ.ศ. 2547- ปัจจุบัน &nbsp;คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>Email : &nbsp;</strong><a href=\"mailto:apinya.wi@ssru.ac.th\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">apinya.wi@ssru.ac.th</a><br />\r\n			<strong>website : &nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/apinya_wi/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/apinya_wi/</a><br />\r\n			Training :&nbsp;<a href=\"http://fms.ssru.ac.th/images/Certification/instructor/Accounting/001_Accounting/Apinya/2558_SPSS_Apinya.pdf\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\" target=\"_blank\">การใช้โปรแกรม SPSS for Windows สำหรับงานวิจัย</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
