(1081, 1, 266, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ผศ_ ปราณี ตรีทศกุล.jpg\" style=\"height:424px; width:300px\" />&nbsp;</td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท &nbsp;:</strong>&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;บัญชีมหาบัณฑิต (บัญชีบริหาร), จุฬาลงกรณ์มหาวิทยาลัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;บัญชีบัณฑิต, มหาวิทยาลัยธรรมศาสตร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งปัจจุบัน :&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์สาขาวิชาการบัญชี</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปัจจุบัน &ndash; 2553 &nbsp; &nbsp; &nbsp; &nbsp;กรรมการวิชาการ &nbsp;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปัจจุบัน &ndash; 2545 &nbsp; &nbsp; &nbsp; &nbsp;กรรมการบริหารโครงการบริหารธุรกิจมหาบัณฑิต &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2548 &ndash; 2546 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ประธานโปรแกรมบริหารธุรกิจ คณะวิทยาการจัดการ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2548 &ndash; 2546 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; หัวหน้