(1171, 1, 301, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารยรุ่งนภา สันติธรรมา.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n			<td><strong>คุณวุฒิทางการศึกษา</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">บริหารธุรกิจบัณฑิต (การจัดการ)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">บริหารธุรกิจบัณฑิต (การบัญชี)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">บริหารมหาบัณฑิต (บัญชีการเงิน)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่ง &nbsp; : &nbsp;</strong>&nbsp; &nbsp;อาจารย์สาขาวิชาการบัญชี</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">๓.ประสบการณ์การทำงาน</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- เจ้าหน้าที่ค้าต่างประเทศ (ธนาคารกรุงเทพฯ)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - ผู้จัดการบัญชีบริหาร บริษัทสินบัวหลวง (มหาชน)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - ผู้จัดการฝ่ายบัญชี บริษัทในเครือพาราวินเซอร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Group Accounting Controller บริษัทไมเนอร์กรุ๊ป</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ประสบการณ์ด้านบริการวิชาการ</span>\r\n			<ul>\r\n				<li>นักวิชาการของสภาวิชาชีพบัญชีในพระบรมราชูปถัมภ์</li>\r\n				<li>คณะอนุกรรมการโครงการพัฒนาโปรแกรมบัญชี สำหรับ SMEs ของสภาวิชาชีพบัญชีในพระบรมราชูปถัมภ์</li>\r\n				<li>ที่ปรึกษาด้านพัฒนาโปรแกรมบัญขีสำเร็จรูป ของกรมพัฒนาธุรกิจการค้า กระทรวงพาณิชย์</li>\r\n				<li>ผู้ทรงกระทรวงศึกษา พิจารณาหลักสูตรการเปิดโรงเรียนภาษีและโรงเรียนบัญชี</li>\r\n				<li>ที่ปรึกษาทางธุรกิจ SME ของกรมส่งเสริมอุตสาหกรรม (โครงการช่วย SME)</li>\r\n			</ul>\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ประสบการณ์ด้านอื่นๆ</span>\r\n\r\n			<ul>\r\n				<li>ผู้จัดการพิเศษขององค์กรปฏิรูปสถาบันการเงิน(ปรส.) กระทรวงการคลัง</li>\r\n				<li>ที่ปรึกษาบริษัทต่างประเทศ ที่ได้รับการส่งเสริมการลงทุน</li>\r\n				<li>ที่ปรึกษาบริษัท ๆ ทั้งในประเทศและต่างประเทศ</li>\r\n			</ul>\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ประสบการณ์ด้านวิทยากร</span>\r\n\r\n			<ul>\r\n				<li>อาจารย์บรรยาย วิชาการเปิดเผยข้อมูลในงบการเงิน โครงการปริญญาโท</li>\r\n			</ul>\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;มหาวิทยาลัยเกษตรศาสตร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;มหาวิทยาลัยหอการค้าไทย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;มหาวิทยาลัยสยาม</span>\r\n\r\n			<ul>\r\n				<li>วิทยากรของกระทรวงพาณิชย์</li>\r\n			</ul>\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หลักสูตรการบริหารร้านอาหาร</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หลักสูตรความรู้ต่อเนื่องเพื่อผู้ทำบัญชี</span>\r\n\r\n			<ul>\r\n				<li>วิทยากรบรรยายบริษัททางด้านอบรมสัมมนา</li>\r\n				<li>วิทยากรบรรยายโครงการต่างๆ ของมหาวิทยาลัยฯและบริษัทฯเอกชน</li>\r\n			</ul>\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๔.ผลงานวิจัย</span>\r\n\r\n			<ul>\r\n				<li>ปัจจัยที่มีผลต่อความสำเร็จของสำนักงานบัญชีไทยจากการเปิดเขตการค้าเสรี(ทุนอุดหนุนการวิจัยของสำนักงานคณะกรรมการวิจัยแห่งชาติ (งบประมาณแผ่นดิน) ปี 2550</li>\r\n				<li>ได้รับทุนอุดหนุนการวิจัยของสำนักงานคณะกรรมการวิจัยแห่งชาติ (งบประมาณแผ่นดิน) ปี 2558</li>\r\n				<li>ได้รับทุนอุดหนุนการวิจัยของสำนักงานคณะกรรมการวิจัยแห่งชาติ (งบประมาณแผ่นดิน) ปี 2559</li>\r\n				<li>ได้รับทุนอุดหนุนการวิจัยของสำนักงานคณะกรรมการวิจัยแห่งชาติ (งบประมาณแผ่นดิน) ปี 2560</li>\r\n			</ul>\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๕.ผลงานการเขียนหนังสือ &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ภาษีอากร 1</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ภาษีอากร 2</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- รายงานการเงินและการวิเคราะห์งบ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">รายงานทางการเงิน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">การบริหารภาษีอากร</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๖.คุณวุฒิอื่นๆ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ผู้สอบบัญชีภาษีอากร เลขที่ TA000755</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
