(1471, 1, 419, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ดร_ ยุทธภูมิ ธนากิจบริสุทธิ์.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก :</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">เศรษฐศาสตร์ปรัชญาดุษฏีบัณฑิต (ปร.ด) สาขาเศรษฐศาสตร์, หลักสูตรนานาชาติ, มหาวิทยาลัยหอการค้าไทย, 2558<br />\r\n			<strong>ปริญญาโท &nbsp;&nbsp;</strong><strong>:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">เศรษฐศาสตร์มหาบัณฑิต (ศ.ม.) สาขาเศรษฐศาสตร์ธุรกิจ, มหาวิทยาลัยหอการค้าไทย, 2548<br />\r\n			<strong>ปริญญาตรี &nbsp;&nbsp;</strong><strong>:&nbsp;</strong>เศรษฐศาสตร์บัณฑิต (ศ.บ.) สาขาเศรษฐศาสตร์การค้าระหว่างประเทศ, มหาวิทยาลัยหอการค้าไทย, 2544</span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ผลงานวิจัยที่ได้รับการตีพิมพ์ในวารสาร</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">Thanakijborisut, Y. (2014).&nbsp;</span><strong>Estimating Price Elasticity of Demand for Medical Care Services in Thailand.&nbsp;</strong><em>UTCC International Journal of Business and Economics</em><strong>,&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">Vol.6, No.1, 19-39.</span></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
