(1499, 1, 429, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ดร_ บัณฑิต ผังนิรันดร์.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp;Ed.D. (Higher Education) Srinakharinwirot University</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp;M.E. (Economics) Chulalongkorn University</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;B.E. (Economics) University of the Thai Chamber of Commerce</span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งทางวิชาการ</strong><strong>&nbsp;:&nbsp;</strong>&nbsp;&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; ผู้ช่วยศาสตราจารย์ระดับ 8</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งบริหาร</strong><strong>&nbsp;:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; คณบดีคณะนวัตกรรมการจัดการ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน :</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2555 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะกรรมการผู้ทรงคุณวุฒิด้านการบริหารเขตพื้นที่การศึกษา &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">สภาการศึกษา กระทรวงศึกษาธิการ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2555 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะกรรมการผู้ทรงคุณวุฒิพิจารณากลั่นกรองผลงานตีพิมพ์&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">วารสารบริหารศาสตร์ &nbsp;มหาวิทยาลัยอุบลราชธานี</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2556 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- กรรมการและเลขานุการ โครงการปรัชญาดุษฎีบัณฑิต&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">สาขานวัตกรรมการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - กรรมการ โครงการบริหารธุรกิจดุษฎีบัณฑิต</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2553 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะกรรมการผู้ทรงคุณวุฒิประเมินคุณภาพงานวิจัยหรือบทความ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ทางวิชาการ เพื่อลงตีพิมพ์ในวารสารสมาคมนักวิจัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - คณะอนุกรรมการฝ่ายนโยบายและแผนงาน สมาคมนักวิจัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; วิทยากรผู้เชี่ยวชาญทางด้านสถิติและการวิเคราะห์ข้อมูลทางสถิติแบบสมการโครงสร้าง (SEM) ด้วยโปรแกรม Amos และ Lisrel</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2553 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n			&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - คณะกรรมการกลุ่มปรับปรุงชุดวิชาหลักเศรษฐศาสตร์เบื้องต้น&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;มหาวิทยาลัยสุโขทัยธรรมาธิราช</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - คณะกรรมการกลุ่มปรับปรุงชุดวิชาเศรษฐศาสตร์การจัดการและ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;การประยุกต์ มหาวิทยาลัยสุโขทัยธรรมาธิราช</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - วิทยากรโครงการอบรมเพื่อจัดทำผลงานทางวิชาการ ระบบพี่เลี้ยง</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;ระยะยาว 3 ปี มหาวิทยาลัยเทคโนโลยีราชมงคลกรุงเทพ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ผลงานทางวิชาการ</strong></span><br />\r\n			<strong>ตำรา</strong><strong>&nbsp;/ หนังสือ</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1. &nbsp;การวิเคราะห์เชิงปริมาณ &nbsp;(สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2. &nbsp;เศรษฐศาสตร์จุลภาค &nbsp;(สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">3. &nbsp;เศรษฐศาสตร์มหภาค &nbsp;(สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">4. &nbsp;การวิจัยทางธุรกิจ (สำนักพิมพ์ธรรมสาร, &nbsp;2551)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">5. &nbsp;การบริหารการผลิต &nbsp;(สำนักพิมพ์ธรรมสาร,2548)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">6. &nbsp;การวิจัยทางการตลาด (สำนักพิมพ์ธรรมสาร, 2551)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">7. &nbsp;การบริหารธุรกิจยุคใหม่ (สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">8. &nbsp;จริยธรรมทางธุรกิจ (สำนักพิมพ์ธรรมสาร, 2546)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">9. &nbsp;การเงินธุรกิจ (สำนักพิมพ์ธรรมสาร, 2553)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">10. การบริหารการผลิต &nbsp;และการปฏิบัติการ (สำนักพิมพ์ธรรมสาร, 2551)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">11. ความรู้เบื้องต้นเกี่ยวกับการประกอบธุรกิจ (สำนักพิมพ์ธรรมสาร, 2546)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">12. ประมวลสาระชุดวิชา เศรษฐศาสตร์การจัดการและการประยุกต์ (พิมพ์ครั้งที่ 1) (มหาวิทยาลัย สุโขทัยธรรมาธิราช, 2553)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">13. &nbsp;เอกสารการสอนชุดวิชา หลักเศรษฐศาสตร์เบื้องต้น (ฉบับปรังปรุงครั้งที่ 2) (มหาวิทยาลัย สุโขทัยธรรมาธิราช, 2554)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>&nbsp;วิชาสอนที่มีความเชี่ยวชาญ</strong></span>\r\n			<ol>\r\n				<li>ระเบียบวิธวิจัยทางธุรกิจ</li>\r\n				<li>การวิจัยทางการตลาด</li>\r\n				<li>สถิติและการวิเคราะห์ข้อมูลทางสถิติแบบสมการโครงสร้าง (SEM) ด้วยโปรแกรม Amos และ Lisrel</li>\r\n				<li>ระเบียบวิธวิจัยขั้นสูงทางนวัตกรรมการจัดการ</li>\r\n				<li>ระเบียบวิธวิจัยขั้นสูงสำหรับธุรกิจ ฯลฯ</li>\r\n			</ol>\r\n			<strong><strong>Email : &nbsp;</strong></strong><a href=\"mailto:bundit.pu@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">bundit.pu@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/bundit_pu/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/bundit_pu/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(1500, 2, 429, 'ABOUT ME', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ดร_ บัณฑิต ผังนิรันดร์.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp;Ed.D. (Higher Education) Srinakharinwirot University</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp;M.E. (Economics) Chulalongkorn University</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;B.E. (Economics) University of the Thai Chamber of Commerce</span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งทางวิชาการ</strong><strong>&nbsp;:&nbsp;</strong>&nbsp;&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; ผู้ช่วยศาสตราจารย์ระดับ 8</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งบริหาร</strong><strong>&nbsp;:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; คณบดีคณะนวัตกรรมการจัดการ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน :</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2555 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะกรรมการผู้ทรงคุณวุฒิด้านการบริหารเขตพื้นที่การศึกษา &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">สภาการศึกษา กระทรวงศึกษาธิการ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2555 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะกรรมการผู้ทรงคุณวุฒิพิจารณากลั่นกรองผลงานตีพิมพ์&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">วารสารบริหารศาสตร์ &nbsp;มหาวิทยาลัยอุบลราชธานี</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2556 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- กรรมการและเลขานุการ โครงการปรัชญาดุษฎีบัณฑิต&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">สาขานวัตกรรมการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - กรรมการ โครงการบริหารธุรกิจดุษฎีบัณฑิต</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2553 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะกรรมการผู้ทรงคุณวุฒิประเมินคุณภาพงานวิจัยหรือบทความ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ทางวิชาการ เพื่อลงตีพิมพ์ในวารสารสมาคมนักวิจัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - คณะอนุกรรมการฝ่ายนโยบายและแผนงาน สมาคมนักวิจัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; วิทยากรผู้เชี่ยวชาญทางด้านสถิติและการวิเคราะห์ข้อมูลทางสถิติแบบสมการโครงสร้าง (SEM) ด้วยโปรแกรม Amos และ Lisrel</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ปี 2553 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n			&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - คณะกรรมการกลุ่มปรับปรุงชุดวิชาหลักเศรษฐศาสตร์เบื้องต้น&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;มหาวิทยาลัยสุโขทัยธรรมาธิราช</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - คณะกรรมการกลุ่มปรับปรุงชุดวิชาเศรษฐศาสตร์การจัดการและ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;การประยุกต์ มหาวิทยาลัยสุโขทัยธรรมาธิราช</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - วิทยากรโครงการอบรมเพื่อจัดทำผลงานทางวิชาการ ระบบพี่เลี้ยง</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;ระยะยาว 3 ปี มหาวิทยาลัยเทคโนโลยีราชมงคลกรุงเทพ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ผลงานทางวิชาการ</strong></span><br />\r\n			<strong>ตำรา</strong><strong>&nbsp;/ หนังสือ</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1. &nbsp;การวิเคราะห์เชิงปริมาณ &nbsp;(สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2. &nbsp;เศรษฐศาสตร์จุลภาค &nbsp;(สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">3. &nbsp;เศรษฐศาสตร์มหภาค &nbsp;(สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">4. &nbsp;การวิจัยทางธุรกิจ (สำนักพิมพ์ธรรมสาร, &nbsp;2551)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">5. &nbsp;การบริหารการผลิต &nbsp;(สำนักพิมพ์ธรรมสาร,2548)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">6. &nbsp;การวิจัยทางการตลาด (สำนักพิมพ์ธรรมสาร, 2551)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">7. &nbsp;การบริหารธุรกิจยุคใหม่ (สำนักพิมพ์ธรรมสาร, 2550)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">8. &nbsp;จริยธรรมทางธุรกิจ (สำนักพิมพ์ธรรมสาร, 2546)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">9. &nbsp;การเงินธุรกิจ (สำนักพิมพ์ธรรมสาร, 2553)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">10. การบริหารการผลิต &nbsp;และการปฏิบัติการ (สำนักพิมพ์ธรรมสาร, 2551)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">11. ความรู้เบื้องต้นเกี่ยวกับการประกอบธุรกิจ (สำนักพิมพ์ธรรมสาร, 2546)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">12. ประมวลสาระชุดวิชา เศรษฐศาสตร์การจัดการและการประยุกต์ (พิมพ์ครั้งที่ 1) (มหาวิทยาลัย สุโขทัยธรรมาธิราช, 2553)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">13. &nbsp;เอกสารการสอนชุดวิชา หลักเศรษฐศาสตร์เบื้องต้น (ฉบับปรังปรุงครั้งที่ 2) (มหาวิทยาลัย สุโขทัยธรรมาธิราช, 2554)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>&nbsp;วิชาสอนที่มีความเชี่ยวชาญ</strong></span>\r\n			<ol>\r\n				<li>ระเบียบวิธวิจัยทางธุรกิจ</li>\r\n				<li>การวิจัยทางการตลาด</li>\r\n				<li>สถิติและการวิเคราะห์ข้อมูลทางสถิติแบบสมการโครงสร้าง (SEM) ด้วยโปรแกรม Amos และ Lisrel</li>\r\n				<li>ระเบียบวิธวิจัยขั้นสูงทางนวัตกรรมการจัดการ</li>\r\n				<li>ระเบียบวิธวิจัยขั้นสูงสำหรับธุรกิจ ฯลฯ</li>\r\n			</ol>\r\n			<strong><strong>Email : &nbsp;</strong></strong><a href=\"mailto:bundit.pu@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">bundit.pu@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/bundit_pu/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/bundit_pu/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
