(1713, 1, 510, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารย์ ชุติมา คล้ายสังข์.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท :</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; บริหารธุรกิจมหาบัณฑิต มหาวิทยาลัยธุรกิจบัณฑิตย์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;:&nbsp;</strong>&nbsp;บริหารธุรกิจบัณฑิต (การตลาด) มหาวิทยาลัยธุรกิจบัณฑิย์</span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประสบการณ์ (ประสบการณ์การทำงาน):</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp;อาจารย์ประจำสาขาวิชาบริหารุรกิจตั้งแต่ปี 2555&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ผลงานวิจัย (ชื่อผลงานวิจัย/ปีที่ตีพิมพ์)</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong><strong>&nbsp; &nbsp;-&nbsp;</strong>Klaysung, C. (2016). Behaviors and Factors Affecting the Selection of Spa Services among Consumers in Amphawa, Samut Songkhram, Thailand.&nbsp;<em>World Academy of Science, Engineering and Technology, International Journal of Social, Behavioral, Educational, Economic, Business and Industrial Engineering</em>,&nbsp;<em>10</em>(12), 3852-3856.<br />\r\n			<strong>&nbsp;&nbsp;</strong>- Klaysung, Chutima. &quot;The Attention for Tourism Resources of Tourists in Amphawa, Samut Songkhram in Thailand.&quot; (2016).</strong></span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งงานปัจจุบัน :</strong>&nbsp;อาจารย์แขนงวิชาการตลาด</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>Email : &nbsp;</strong></span><a href=\"mailto:chutima.kl@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">chutima.kl@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;&nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/chutima_kl/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/chutima_kl/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
