(1741, 1, 520, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ดร_ พัฒนา ศิริโชติบัณฑิต.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก&nbsp;</strong>:</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; ปรัชญาดุษฎีบัณฑิต การจัดการสิ่งแวดล้อม สถาบันบัณฑิตพัฒนบริหารศาสตร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">:&nbsp; &nbsp; &nbsp; บริหารธุรกิจมหาบัณฑิต (การตลาด) มหาวิทยาลัยรามคำแหง</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">:&nbsp; &nbsp; &nbsp; บริหารธุรกิจบัณฑิต (การบริหารทั่วไป) มหาวิทยาลัยรามคำแหง</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งปัจจุบัน :</strong>&nbsp; อาจารย์แขนงวิชาการตลาด</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">บ. เอเบิล ซาโน่ อินดัสทรีส์ จำกัด (JV ไทย-ญี่ปุ่น)</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;- ผู้บริหารงานขาย/ผู้ช่วยผู้จัดการฝ่ายขาย (2535-2537)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">บ. อัลลายด์ คอมโพเน้นท์ จำกัด (เครือออสเตรเลีย) - ผู้จัดการฝ่ายการตลาด (2538-2539)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">บ. โมเบล วู๊ดเวอร์ค จำกัด &ndash; ผู้จัดการฝ่ายค้าส่ง/ผู้จัดการฝ่ายส่งออก (2539-2541)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">(2541 &ndash; ปัจจุบัน)- อาจารย์ประจำภาควิชาการตลาด</span><br />\r\n			<strong>Email :&nbsp;</strong><a href=\"mailto:pattana.si@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">pattana.si@ssru.ac.th</a><strong>website :&nbsp;<a href=\"http://www.teacher.ssru.ac.th/pattana_si/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/pattana_si/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
