(2161, 1, 681, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ผู้ช่วยศาสตราจารย์ สิริอร จำปาทอง.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">&nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">: &nbsp;&nbsp;&nbsp;M.B.A &nbsp; &nbsp;บริหารธุรกิจมหาบัณฑิต (การจัดการทั่วไป) &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">มหาวิทยาลัยเซาท์เทิร์นครอส ประเทศออสเตรเลีย (พ.ศ. 2541)</span><br />\r\n			<strong>ปริญญาตรี &nbsp;:&nbsp;&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">ร.บ. (รัฐศาสตร์) สาขาความสัมพันธ์ระหว่างประเทศ &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">จุฬาลงกรณ์มหาวิทยาลัย (พ.ศ. 2533)&nbsp;</span><br />\r\n			<strong>ตำแหน่งปัจจุบัน :&nbsp;&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาการบริหารทรัพยากรมนุษย์</span><strong>ประวัติการทำงาน&nbsp;</strong><strong>:</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>มหาวิทยาลัยราชภัฏสวนสุนันทา</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2542 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;อาจารย์ประจำสาขาการบริหารทรัพยากรมนุษย์ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2557 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการกองบรรณาธิการ วารสารวิจัยคณะวิทยาการจัดการ &nbsp;พ.ศ. 2555 &ndash; 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการบริหารความเสี่ยง คณะวิทยาการจัดการ &nbsp;พ.ศ. 2555 &ndash; 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการประกันคุณภาพ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2555 &ndash; 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการตรวจรับพัสดุ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2553 &ndash; 2555 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ช่วยอธิการบดีฝ่ายประชาสัมพันธ์และวิเทศสัมพันธ์ &nbsp;พ.ศ. 2552 - 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; รักษาการผู้อำนวยการศูนย์อาเซียน &nbsp;พ.ศ. 2552 &ndash; 2553 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ช่วยหัวหน้าสำนักงานอธิการบดีฝ่ายวิเทศสัมพันธ์ &nbsp;พ.ศ. 2552 &ndash; 2553 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หัวหน้ากลุ่มสาขาบริหารธุรกิจ &nbsp;พ.ศ. 2547 &ndash; 2554 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการอำนวยการวิทยาลัยนานาชาติ &nbsp;พ.ศ. 2543 &ndash; 2547 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ช่วยหัวหน้าแขนงการบริหารทรัพยากรมนุษย์ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2543 &ndash; 2546 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ประธานพัฒนาระบบการเรียนกลุ่มใหญ่ ( Mass education)</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; วิชาความรู้เบื้องต้นเกี่ยวกับการประกอบธุรกิจ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2544 &ndash; 2546 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการฝ่ายกิจการนักศึกษา คณะวิทยาการจัดการ &nbsp;พ.ศ. 2542 &ndash; 2547 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการสำนักวิเทศสัมพันธ์ มหาวิทยาลัยราชภัฏสวนสุนันทา</span><strong>&nbsp;</strong><strong>มหาวิทยาลัยรัฐอินเดียน่า</strong><strong>(สหรัฐอเมริกา)</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">พ.ศ.2543 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ประสานงานของมหาวิทยาลัยรัฐอินเดียน่า ประจำประเทศไทย</span><strong>โรงแรมโนโวเทลกรุงเทพ สยามสแควร์&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>(กลุ่มแอคคอร์ ฝรั่งเศส)</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2535 &ndash; 2537 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หัวหน้างาน ฝ่ายห้องพัก</span><strong>&nbsp;</strong><strong>โรงแรมโอเรียนเต็ล แมนดาริน กรุงเทพ</strong><strong>&nbsp; (กลุ่มแมนดาริน)</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2534 &ndash; 2535 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;พนักงานส่วนงานต้อนรับ ฝ่ายห้องพัก</span><strong><strong>Email :&nbsp;&nbsp;</strong></strong><a href=\"mailto:siriorn.ch@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">siriorn.ch@ssru.ac.th</a><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>website :&nbsp;</strong></span><strong><a href=\"http://www.teacher.ssru.ac.th/siriorn_ch/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/siriorn_ch/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(2162, 2, 681, 'ABOUT ME', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ผู้ช่วยศาสตราจารย์ สิริอร จำปาทอง.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">&nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">: &nbsp;&nbsp;&nbsp;M.B.A &nbsp; &nbsp;บริหารธุรกิจมหาบัณฑิต (การจัดการทั่วไป) &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">มหาวิทยาลัยเซาท์เทิร์นครอส ประเทศออสเตรเลีย (พ.ศ. 2541)</span><br />\r\n			<strong>ปริญญาตรี &nbsp;:&nbsp;&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">ร.บ. (รัฐศาสตร์) สาขาความสัมพันธ์ระหว่างประเทศ &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">จุฬาลงกรณ์มหาวิทยาลัย (พ.ศ. 2533)&nbsp;</span><br />\r\n			<strong>ตำแหน่งปัจจุบัน :&nbsp;&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาการบริหารทรัพยากรมนุษย์</span><strong>ประวัติการทำงาน&nbsp;</strong><strong>:</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>มหาวิทยาลัยราชภัฏสวนสุนันทา</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2542 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;อาจารย์ประจำสาขาการบริหารทรัพยากรมนุษย์ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2557 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการกองบรรณาธิการ วารสารวิจัยคณะวิทยาการจัดการ &nbsp;พ.ศ. 2555 &ndash; 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการบริหารความเสี่ยง คณะวิทยาการจัดการ &nbsp;พ.ศ. 2555 &ndash; 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการประกันคุณภาพ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2555 &ndash; 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการตรวจรับพัสดุ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2553 &ndash; 2555 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ช่วยอธิการบดีฝ่ายประชาสัมพันธ์และวิเทศสัมพันธ์ &nbsp;พ.ศ. 2552 - 2556 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; รักษาการผู้อำนวยการศูนย์อาเซียน &nbsp;พ.ศ. 2552 &ndash; 2553 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ช่วยหัวหน้าสำนักงานอธิการบดีฝ่ายวิเทศสัมพันธ์ &nbsp;พ.ศ. 2552 &ndash; 2553 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หัวหน้ากลุ่มสาขาบริหารธุรกิจ &nbsp;พ.ศ. 2547 &ndash; 2554 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการอำนวยการวิทยาลัยนานาชาติ &nbsp;พ.ศ. 2543 &ndash; 2547 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ช่วยหัวหน้าแขนงการบริหารทรัพยากรมนุษย์ คณะวิทยาการจัดการ &nbsp;พ.ศ. 2543 &ndash; 2546 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ประธานพัฒนาระบบการเรียนกลุ่มใหญ่ ( Mass education)</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; วิชาความรู้เบื้องต้นเกี่ยวกับการประกอบธุรกิจ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2544 &ndash; 2546 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการฝ่ายกิจการนักศึกษา คณะวิทยาการจัดการ &nbsp;พ.ศ. 2542 &ndash; 2547 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กรรมการสำนักวิเทศสัมพันธ์ มหาวิทยาลัยราชภัฏสวนสุนันทา</span><strong>&nbsp;</strong><strong>มหาวิทยาลัยรัฐอินเดียน่า</strong><strong>(สหรัฐอเมริกา)</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">พ.ศ.2543 &ndash; ปัจจุบัน &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผู้ประสานงานของมหาวิทยาลัยรัฐอินเดียน่า ประจำประเทศไทย</span><strong>โรงแรมโนโวเทลกรุงเทพ สยามสแควร์&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>(กลุ่มแอคคอร์ ฝรั่งเศส)</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2535 &ndash; 2537 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หัวหน้างาน ฝ่ายห้องพัก</span><strong>&nbsp;</strong><strong>โรงแรมโอเรียนเต็ล แมนดาริน กรุงเทพ</strong><strong>&nbsp; (กลุ่มแมนดาริน)</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; พ.ศ. 2534 &ndash; 2535 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;พนักงานส่วนงานต้อนรับ ฝ่ายห้องพัก</span><strong><strong>Email :&nbsp;&nbsp;</strong></strong><a href=\"mailto:siriorn.ch@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">siriorn.ch@ssru.ac.th</a><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>website :&nbsp;</strong></span><strong><a href=\"http://www.teacher.ssru.ac.th/siriorn_ch/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/siriorn_ch/</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
