(2797, 1, 921, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารย์ ส่งเสริม วจีทองรัตนา.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>คุณวุฒิทางการศึกษา (ชื่อวุฒิการศึกษา/สาขา/สถาบันการศึกษาที่สำเร็จการศึกษา)</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปริญญาตรี/ สาขาหลัก: วิทยาศาสตร์บัณฑิตการบัญชี, สาขารอง: การบัญชีนิติเวช / มหาวิทยาลัยแห่งรัฐอินดีแอนา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปริญญาโท/ วิทยาศาสตร์มหาบัณฑิตการเงินและการจัดการ/ มหาวิทยาลัยเอ็กเซตเตอร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ปริญญาโท/ วิทยาศาสตร์มหาบัณฑิตการจัดการระหว่างประเทศ/ มหาวิทยาลัยเอ็กเซตเตอร</span><br />\r\n			<strong>ประสบการณ์</strong><strong>&nbsp;(ประสบการณ์การทำงาน)</strong><br />\r\n			<strong>1 มิ.ย. 2560 &ndash; ปุจจุบัน มหาวิทยาลัยราชภัฏสวนสุนันทา กรุงเทพมหานคร</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- อาจารย์ประจำแขนงวิชาการเงินการธนาคาร กลุ่มสาขาวิชาบริหารธุรกิจ คณะวิทยาการจัดการ สอนวิชาในแขนงการเงินการธนาคารให้แก่นักศึกษาระดับปริญญาตรี ได้แก่วิชา : การเงินธุรกิจ ภาษาอังกฤ ธุรกิจ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ปฏิบัติงานสอน, งานที่ปรึกษานักศึกษา, งานนิเทศนักศึกษา, ฝึกประสบการณ์วิชาชีพ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- รับผิดชอบงานวิจัยเพื่อให้มีคุณภาพระดับการตีพิมพ์ในวารสารหรือเป็นที่ยอมรับในระดับสากล</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ปฏิบัติงานบริการวิชาการ, งานทำนุบำรุงศิลปวัฒนธรรมม และงานอื่นๆที่ได้รับมอบหมาย</span><br />\r\n			<strong>1 มิ.ย. 2560 &ndash; ปัจจุบัน</strong><br />\r\n			<strong>มิ.ย. &ndash; ก.ค. 2558 PricewaterhouseCoopers Thailand กรุงเทพมหานคร</strong><br />\r\n			<em><u>พนักงานตรวจสอบบัญชี</u></em><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ตรวจสอบบัญชีและอื่นๆที่เกี่ยวข้องแก่ลูกค้าในด้านอุตสาหกรรมต่างๆ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- วินิจฉัยและสื่อสารเกี่ยวกับปัญหาในการตรวจสอบบัญชีกับผู้จัดการและหุ้นส่วนของบริษัท</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- วินิจฉัยการเพิ่มพูนความสามารถและโอกาสต่างๆของธุรกิจ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ติดต่อสื่อสารกับลูกค้า เพื่อการทำงานร่วมกันอย่างมีประสิทธิภาพ</span><br />\r\n			<strong>&nbsp;ตำแหน่งปัจจุบัน :&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาการเงินการธนาคาร</span><br />\r\n			<strong>Email :</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">songserm.wa</span><a href=\"mailto:patriya.sr@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;<a href=\"http://www.teacher.ssru.ac.th/patriya_sr/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/songserm_wa</a></strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
