(2983, 1, 988, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/4386f06fd02a22c3e1148f1d7f44d486b4a03c4c.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\">๑.ชื่อ-สกุล</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ภาษาไทย &nbsp; &nbsp; &nbsp; &nbsp;ผศ.ณรงค์พันธุ์ &nbsp;รัตนปนัดดา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ภาษาอังกฤษ &nbsp; &nbsp; Asst.Prof.Narongphan Rattanapanadda</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๒.คุณวุฒิทางการศึกษา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;วิทยาศาสตรบัณฑิต (วท.บ.) จุฬาฯ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; วิศวกรรมศาสตรมหาบัณฑิต (วศ.ม.) จุฬาฯ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๓.ประสบการณ์การทำงาน</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Technical Support (Thai parkerizing Co.,Ltd.)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Supervisor (Teijin (Thailand) Co.,Ltd.)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๔.ผลงานวิจัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- มณชัย เดชสังกรานนท์, อมรรัตน์ สีสุกอง และ ณรงค์พันธุ์ รัตนปนัดดา. (2560). การศึกษาเบื้องต้นของการผลิตวุ้นสวรรค์จากน้ำผลผักปลังสุก. วารสารก้าวทันโลกวิทยาศาสตร์. ปีที่ 17 ฉบับที่ 1 2557. คณะวิทยาศาสตร์และเทคโนโลยี มหาวิทยาลัยราชภัฏบ้านสมเด็จเจ้าพระยา.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา. (2557). การศึกษาผลของอุลตร้าโซนิคต่อการสกัดแอนโทไซยานินจากกระเจี๊ยบแดงด้วยวิธีพื้นผิวตอบสนอง. วารสารวิจัย มสด. ตุลาคม-ธันวาคม 2557.มหาวิทยาลัยราชภัฏสวนดุสิต.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา, พัชราภรณ์ อิ่มอุไร และ วันวิสา คำมิ่ง. (2556).การสกัดไลโคปีนจากเยื่อหุ้มเมล็ดฟักข้าวด้วยคลื่นเหนือเสียง. มหาวิทยาลัยมหาสารคามวิจัย ครั้งที่ ๙. ๑๒-๑๓ กันยายน ๒๕๕๖. มหาวิทยาลัยมหาสารคาม.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ รัตนปนัดดา จุฑามาศ มามั่งคั่ง และฐิติรัตน์ เคาวสุต. (2555). ผลของเอ็นไซม์ต่อการสกัดไลโคปีนจากเยื่อหุ้มเมล็ดฟักข้าว. &nbsp;การนำเสนอผลงานวิจัยระดับชาติ มหาวิทยาลัยราชภัฏภูเก็ต. ๑๓-๑๔ ธันวาคม ๒๕๕๕. มหาวิทยาลัยราชภัฏภูเก็ต.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , จิตติมา บุตรพันธุ์ และ กนกวรรณ สุธารส. (2555). ผลของอุลตร้าโซนิคต่อการสกัดแอนโทไซยานินจากกระเจี๊ยบแดง. การประชุมทางวิชาการมอบ. วิจัย ครั้งที่ ๖. ๒๖-๒๗ กรกฎาคม ๒๕๕๕. มหาวิทยาลัยอุบลราชธานี.[ทุนอุดหนุนการวิจัยมหาวิทยาลัยราชภัฏสวนดุสิต 2554]</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , ธนูเพชร พรหมเอาะ และ กานดา วิกยานนท์. (2555). การสกัดเพคตินจากกระเจี๊ยบเขียว. การประชุมวิชาการระดับชาติ &ldquo;ราชภัฏวิชาการเพื่อท้องถิ่น&rdquo; ครั้งที่ ๕. ๑๒-๑๔ กุมภาพันธ์ ๒๕๕๕. มหาวิทยาลัยราชภัฏเชียงใหม่.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , สุปราณี โกกิละนันทน์ และ กัญชลิการ์ มุกดา.(2554) ผลของอุณหภูมิและมอลโตเดกซ์ทรินตัวต่อคุณสมบัติของผงมะเขือเทศทำแห้งแบบพ่นฝอย. การประชุมวิชาการระดับชาติ &ldquo;มหาวิทยาลัยบูรพา ๒๕๕๔&rdquo;. ๖-๗ กรกฎาคม. มหาวิทยาลัยบูรพา.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , วัชราภรณ์ &nbsp;บุญพิมพ์ และ อาทิตยา &nbsp;ศรีศัมภุวงศ์. (2554).ผลของการเคลือบไคโตซานและขนาดของแคปซูลต่อการเหลือรอดของโพรไบโอติกในเม็ดอัลจิเนต. การประชุมวิชาการระดับชาติ &ldquo;มหาวิทยาลัยบูรพา ๒๕๕๔&rdquo;. ๖-๗ กรกฎาคม. มหาวิทยาลัยบูรพา.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การศึกษากระบวนการผลิตข้าวเหนียวมูนสำเร็จรูปบรรจุกระป๋อง(ENPUS)ที่ได้รับรางวัลชมเชย ประเภท&nbsp;</span><strong>Professional Vote</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา. (2550).การใช้เทคนิค Near Infrared Spectroscopy (NIRS) ในการหาความชื้นและ โปรตีนของแป้งสาลี. วารสารวิจัย มสด. มหาวิทยาลัยราชภัฏสวนดุสิต.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๕.ผลงานการเขียนหนังสือ &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- วิศวกรรมอาหาร ๑</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- หลักการวิเคราะห์อาหาร</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๖.คุณวุฒิอื่นๆ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - ใบอนุญาตประกอบวิชาชีพวิศวกรรมควบคุม ระดับ ภาคีวิศวกร สาขาวิศวกรรมเคมี เลข ทะเบียน ภค ๑๓๒๔</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- คณะกรรมการตรวจประเมินคุณภาพสถานที่ผลิตอาหาร ของศูนย์ประสานงานพัฒนาคุณภาพผลิตภัณฑ์สุขภาพชุมชน(ศพช.) สำนักงานคณะกรรมการอาหารและยา ประจำปี 2551</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- คณะกรรมการคัดสรรสุดยอดผลิตภัณฑ์ OTOP ประจำปี 2548</span></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(2984, 2, 988, 'ABOUT ME', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/4386f06fd02a22c3e1148f1d7f44d486b4a03c4c.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\">๑.ชื่อ-สกุล</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ภาษาไทย &nbsp; &nbsp; &nbsp; &nbsp;ผศ.ณรงค์พันธุ์ &nbsp;รัตนปนัดดา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ภาษาอังกฤษ &nbsp; &nbsp; Asst.Prof.Narongphan Rattanapanadda</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๒.คุณวุฒิทางการศึกษา</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;วิทยาศาสตรบัณฑิต (วท.บ.) จุฬาฯ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; วิศวกรรมศาสตรมหาบัณฑิต (วศ.ม.) จุฬาฯ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๓.ประสบการณ์การทำงาน</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Technical Support (Thai parkerizing Co.,Ltd.)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Supervisor (Teijin (Thailand) Co.,Ltd.)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๔.ผลงานวิจัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- มณชัย เดชสังกรานนท์, อมรรัตน์ สีสุกอง และ ณรงค์พันธุ์ รัตนปนัดดา. (2560). การศึกษาเบื้องต้นของการผลิตวุ้นสวรรค์จากน้ำผลผักปลังสุก. วารสารก้าวทันโลกวิทยาศาสตร์. ปีที่ 17 ฉบับที่ 1 2557. คณะวิทยาศาสตร์และเทคโนโลยี มหาวิทยาลัยราชภัฏบ้านสมเด็จเจ้าพระยา.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา. (2557). การศึกษาผลของอุลตร้าโซนิคต่อการสกัดแอนโทไซยานินจากกระเจี๊ยบแดงด้วยวิธีพื้นผิวตอบสนอง. วารสารวิจัย มสด. ตุลาคม-ธันวาคม 2557.มหาวิทยาลัยราชภัฏสวนดุสิต.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา, พัชราภรณ์ อิ่มอุไร และ วันวิสา คำมิ่ง. (2556).การสกัดไลโคปีนจากเยื่อหุ้มเมล็ดฟักข้าวด้วยคลื่นเหนือเสียง. มหาวิทยาลัยมหาสารคามวิจัย ครั้งที่ ๙. ๑๒-๑๓ กันยายน ๒๕๕๖. มหาวิทยาลัยมหาสารคาม.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ รัตนปนัดดา จุฑามาศ มามั่งคั่ง และฐิติรัตน์ เคาวสุต. (2555). ผลของเอ็นไซม์ต่อการสกัดไลโคปีนจากเยื่อหุ้มเมล็ดฟักข้าว. &nbsp;การนำเสนอผลงานวิจัยระดับชาติ มหาวิทยาลัยราชภัฏภูเก็ต. ๑๓-๑๔ ธันวาคม ๒๕๕๕. มหาวิทยาลัยราชภัฏภูเก็ต.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , จิตติมา บุตรพันธุ์ และ กนกวรรณ สุธารส. (2555). ผลของอุลตร้าโซนิคต่อการสกัดแอนโทไซยานินจากกระเจี๊ยบแดง. การประชุมทางวิชาการมอบ. วิจัย ครั้งที่ ๖. ๒๖-๒๗ กรกฎาคม ๒๕๕๕. มหาวิทยาลัยอุบลราชธานี.[ทุนอุดหนุนการวิจัยมหาวิทยาลัยราชภัฏสวนดุสิต 2554]</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , ธนูเพชร พรหมเอาะ และ กานดา วิกยานนท์. (2555). การสกัดเพคตินจากกระเจี๊ยบเขียว. การประชุมวิชาการระดับชาติ &ldquo;ราชภัฏวิชาการเพื่อท้องถิ่น&rdquo; ครั้งที่ ๕. ๑๒-๑๔ กุมภาพันธ์ ๒๕๕๕. มหาวิทยาลัยราชภัฏเชียงใหม่.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , สุปราณี โกกิละนันทน์ และ กัญชลิการ์ มุกดา.(2554) ผลของอุณหภูมิและมอลโตเดกซ์ทรินตัวต่อคุณสมบัติของผงมะเขือเทศทำแห้งแบบพ่นฝอย. การประชุมวิชาการระดับชาติ &ldquo;มหาวิทยาลัยบูรพา ๒๕๕๔&rdquo;. ๖-๗ กรกฎาคม. มหาวิทยาลัยบูรพา.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา , วัชราภรณ์ &nbsp;บุญพิมพ์ และ อาทิตยา &nbsp;ศรีศัมภุวงศ์. (2554).ผลของการเคลือบไคโตซานและขนาดของแคปซูลต่อการเหลือรอดของโพรไบโอติกในเม็ดอัลจิเนต. การประชุมวิชาการระดับชาติ &ldquo;มหาวิทยาลัยบูรพา ๒๕๕๔&rdquo;. ๖-๗ กรกฎาคม. มหาวิทยาลัยบูรพา.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การศึกษากระบวนการผลิตข้าวเหนียวมูนสำเร็จรูปบรรจุกระป๋อง(ENPUS)ที่ได้รับรางวัลชมเชย ประเภท&nbsp;</span><strong>Professional Vote</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ณรงค์พันธุ์ &nbsp;รัตนปนัดดา. (2550).การใช้เทคนิค Near Infrared Spectroscopy (NIRS) ในการหาความชื้นและ โปรตีนของแป้งสาลี. วารสารวิจัย มสด. มหาวิทยาลัยราชภัฏสวนดุสิต.</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๕.ผลงานการเขียนหนังสือ &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- วิศวกรรมอาหาร ๑</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- หลักการวิเคราะห์อาหาร</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">๖.คุณวุฒิอื่นๆ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - ใบอนุญาตประกอบวิชาชีพวิศวกรรมควบคุม ระดับ ภาคีวิศวกร สาขาวิศวกรรมเคมี เลข ทะเบียน ภค ๑๓๒๔</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- คณะกรรมการตรวจประเมินคุณภาพสถานที่ผลิตอาหาร ของศูนย์ประสานงานพัฒนาคุณภาพผลิตภัณฑ์สุขภาพชุมชน(ศพช.) สำนักงานคณะกรรมการอาหารและยา ประจำปี 2551</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- คณะกรรมการคัดสรรสุดยอดผลิตภัณฑ์ OTOP ประจำปี 2548</span></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
