(3061, 1, 1019, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/นายเอกพล เธียรถาวร.jpg\" style=\"height:425px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\">\r\n			<p dir=\"ltr\"><strong>๑.ชื่อ-สกุล (คำนำหน้าทางวิชาการ/ตำแหน่ง)</strong></p>\r\n\r\n			<p dir=\"ltr\">นายเอกพล เธียรถาว</p>\r\n\r\n			<p dir=\"ltr\">หัวหน้าแขนงวิชาวารสารศาสต์</p>\r\n			<strong>๒.คุณวุฒิทางการศึกษา (ชื่อวุฒิการศึกษา/สาขา/สถาบันการศึกษาที่สำเร็จการศึกษา)</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- นิเทศศาสตรมหาบัณฑิต (วารสารสนเทศ) จุฬาลงกรณ์มหาวิทยาลัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ศิลปศาสตรบัณฑิต (ภาษาไทย) มหาวิทยาลัยเกษตรศาสต</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ร์</span><strong>๓.ประสบการณ์ (ประสบการณ์การทำงาน)</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- อนุกรรมการฝ่ายวิชาการและส่งเสริมวิชาชีพ สภาการหนังสือพิมพ์แห่งชาติ ปี 2559</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- อนุกรรมการฝ่ายวิชาการสมาคมนักข่าวนักหนังสือพิมพ์แห่งประเทศไทย ปี 2555</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- กองบรรณาธิการฝ่ายสื่อทั่วไป บริษัทอักษรเจริญทัศน์ จำกัด ปี 2550</span><br />\r\n			<strong>๔.ผลงานวิจัย (ชื่อผลงานวิจัย/ปีที่ตีพิมพ์)</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ปัจจัยพยากรความน่าเชื่อถือของข่าวบนสื่อสังคมออนไลน์ในประเทศไทย (2560)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- พฤติกรรมการเปิดรับและความพึงพอใจต่อข่าวออนไลน์ของนักศึกษาระดับปริญญาตรีในกรุงเทพมหานคร (2559)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- พฤติกรรมการบริโภคข่าวผ่านสมาร์ทโฟนและคอมพิวเตอร์แท็ปเล็ตของนักศึกษาระดับปริญญาตรีในกรุงเทพมหานคร (2557)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การรู้เท่าทันสื่อสังคมออนไลน์ของนักศึกษาระดับปริญญาตรีในกรุงเทพมหานคร (2556)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การสำรวจและจัดการทรัพยากรทางวัฒนธรรมเพื่อประชาสัมพันธ์การท่องเที่ยวในเขตตำบลศาลายา (2554)</span><br />\r\n			<strong>๕. บทความวิชาการ (ชื่อผลงาน/ปีที่ตีพิมพ์)</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- วารสารศาสตร์ข้อมูลกับการรายงานข่าวของสื่อไทย (2560)</span><br />\r\n			<strong><strong>Email :&nbsp;&nbsp;</strong></strong><a href=\"mailto:ekapon.th@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">ekapon.th@ssru.ac.th</a><br />\r\n			<strong>website :&nbsp;</strong><a href=\"http://www.teacher.ssru.ac.th/ekapon_th/\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">www.teacher.ssru.ac.th/ekapon_th/</a></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
