INSERT INTO `sl_language_detail` (`id`, `language_id`, `ref_id`, `name`, `type`, `detail`, `detail_2`, `detail_3`) VALUES
(3073, 1, 1023, 'ผู้ช่วยศาสตราจารย์สุรสิทธิ์ วิทยารัฐ', 0, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาวารสารศาสตร์</span></p>\r\n', NULL, NULL),
(3074, 2, 1023, 'ผู้ช่วยศาสตราจารย์สุรสิทธิ์ วิทยารัฐ', 0, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาวารสารศาสตร์</span></p>\r\n', NULL, NULL),
(3075, 1, 1024, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ผู้ช่วยศาสตราจารย์สุรสิทธิ์ วิทยารัฐ.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>การศึกษา</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">- ศิลปศาสตรบัณฑิต (เกียรตินิยมอันดับ ๒) สาขานิเทศศาสตร์ วิทยาลัยครูสวนสุนันทา- ศิลปศาสตรบัณฑิต สาขารัฐศาสตร์ &nbsp;มหาวิทยาลัยรามคำแหง- วารสารศาสตรมหาบัณฑิต คณะวารสารศาสตร์และสื่อสารมวลชน มหาวิทยาลัยธรรมศาสตร์</span><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">- ผู้ช่วยบรรณาธิการ นิตยสารในเครือบริษัท ซีเอ็ด ยูเคชั่น จำกัด (มหาชน) (ปี ๒๕๓๖ &ndash; ๒๕๓๗)- ผู้สื่อข่าว สายไอที หนังสือพิมพ์กรุงเทพธุรกิจ (ปี ๒๕๓๘ &ndash; ๒๕๔๑)- อาจารย์ประจำสาขาวิชาวารสารศาสตร์ มหาวิทยาลัยราชภัฎสวนสุนันทา (ปี ๒๕๔๑ - ปัจจุบัน)- หัวหน้าภาควิชานิเทศศาสตร์ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา (ปี ๒๕๔๗&ndash; ๒๕๕๓)- หัวหน้าสาขาวิชาวารสารสนเทศ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา (ปี ๒๕๔๑ &ndash; ปัจจุบัน)</span><br />\r\n			<strong>ผลงานวิชาการ</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">- ความรู้เบื้องต้นเกี่ยวกับสื่อสิ่งพิมพ์ (ปีที่พิมพ์ ๒๕๔๑)- การผลิตสื่อสิ่งพิมพ์ (ปีที่พิมพ์ ๒๕๔๒)- การสื่อข่าววิทยุและโทรทัศน์ (ปีที่พิมพ์ ๒๕๔๓)- การสื่อข่าว : หลักการและเทคนิค (ปีที่พิมพ์ ๒๕๔๕)- หลักการสื่อสารมวลชน (ปีที่พิมพ์ ๒๕๔๗)- การสื่อสารเพื่อการพัฒนา (ปีที่พิมพ์ ๒๕๔๙)- หลักวารสารศาสตร์ (ปีที่พิมพ์ ๒๕๔๙ &ndash;ปรับปรุง ๒๕๕๔)- เรียนรู้วิธีการและงาน : บรรณาธิการสื่อสิ่งพิมพ์ (ปีที่พิมพ์ ๒๕๔๙)- การหนังสือพิมพ์เบื้องต้น (ปีที่พิมพ์ ๒๕๕๒)- เทคนิคการสื่อข่าวและการเขียนข่าว (ปีที่พิมพ์ ๒๕๕๔)- ข่าวเชิงสืบสวน (ปีที่พิมพ์ ๒๕๕๔)</span><br />\r\n			<strong>สำนักงาน</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">ภาควิชานิเทศศาสตร์ คณะวิทยาการจัดการ &nbsp; มหาวิทยาลัยราชภัฏสวนสุนันทา &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;1 ถนนอู่ทองนอก เขตดุสิต กรุงเทพฯ 10300 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;โทรศัพท์ 02-160-1491 โทรสาร 02-160-1490 &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;มือถือ : 086- 970-4381 &nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;E &ndash; mail : surasit_test@hotmail.com &nbsp;&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">Face book : สุรสิทธิ์ วิทยารัฐ</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;<br />\r\n			<strong>Email :&nbsp;</strong><a href=\"mailto:surasit.vi@ssru.ac.th\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">surasit.vi@ssru.ac.th<br />\r\n			<strong>website</strong><strong>&nbsp;:</strong></a><a href=\"http://www.teacher.ssru.ac.th/surasit_vi/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/surasit_v</a><a href=\"mailto:surasit.vi@ssru.ac.th\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">i/</a>&nbsp;</span></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(3076, 2, 1024, 'ABOUT ME', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ผู้ช่วยศาสตราจารย์สุรสิทธิ์ วิทยารัฐ.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>การศึกษา</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">- ศิลปศาสตรบัณฑิต (เกียรตินิยมอันดับ ๒) สาขานิเทศศาสตร์ วิทยาลัยครูสวนสุนันทา- ศิลปศาสตรบัณฑิต สาขารัฐศาสตร์ &nbsp;มหาวิทยาลัยรามคำแหง- วารสารศาสตรมหาบัณฑิต คณะวารสารศาสตร์และสื่อสารมวลชน มหาวิทยาลัยธรรมศาสตร์</span><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">- ผู้ช่วยบรรณาธิการ นิตยสารในเครือบริษัท ซีเอ็ด ยูเคชั่น จำกัด (มหาชน) (ปี ๒๕๓๖ &ndash; ๒๕๓๗)- ผู้สื่อข่าว สายไอที หนังสือพิมพ์กรุงเทพธุรกิจ (ปี ๒๕๓๘ &ndash; ๒๕๔๑)- อาจารย์ประจำสาขาวิชาวารสารศาสตร์ มหาวิทยาลัยราชภัฎสวนสุนันทา (ปี ๒๕๔๑ - ปัจจุบัน)- หัวหน้าภาควิชานิเทศศาสตร์ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา (ปี ๒๕๔๗&ndash; ๒๕๕๓)- หัวหน้าสาขาวิชาวารสารสนเทศ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา (ปี ๒๕๔๑ &ndash; ปัจจุบัน)</span><br />\r\n			<strong>ผลงานวิชาการ</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">- ความรู้เบื้องต้นเกี่ยวกับสื่อสิ่งพิมพ์ (ปีที่พิมพ์ ๒๕๔๑)- การผลิตสื่อสิ่งพิมพ์ (ปีที่พิมพ์ ๒๕๔๒)- การสื่อข่าววิทยุและโทรทัศน์ (ปีที่พิมพ์ ๒๕๔๓)- การสื่อข่าว : หลักการและเทคนิค (ปีที่พิมพ์ ๒๕๔๕)- หลักการสื่อสารมวลชน (ปีที่พิมพ์ ๒๕๔๗)- การสื่อสารเพื่อการพัฒนา (ปีที่พิมพ์ ๒๕๔๙)- หลักวารสารศาสตร์ (ปีที่พิมพ์ ๒๕๔๙ &ndash;ปรับปรุง ๒๕๕๔)- เรี