(3255, 1, 1090, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารย์ กัญภัส อู่ตะเภา.jpg\" style=\"height:423px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong><strong>ปริญญาโท :&nbsp;</strong></strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">วารสารศาสตร์ มหาบัณฑิต (การบริหารสื่อสารมวลชน ), มหาวิทยาลัยธรรมศาสตร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;:&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;การศึกษาบัณฑิต (บรรรรักษศาสตร์ ),มหาวิทยาลัยศรีณรินทรวิโรฒ ภาคใต้</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong></span>\r\n			<p>- &nbsp;ผู้สื่อข่าว พิธีกร &nbsp; สถานีโทรทัศน์ ไอทีวีจำกัดมหาชน<br />\r\n			- &nbsp;หัวหน้าครีเอทีฟ และการตลาด บริษัททีนทอล์ก จำกัด<br />\r\n			- &nbsp;เขียนบท และควบคุมการผลิตงานโฆษณา บริษัท แอสซีแมชบอกซ์ จำกัด<br />\r\n			- ผลิตงานด้านสื่อสารองค์กร ,งานโฆษณาและรายการโทรทัศน์</p>\r\n			<strong>Email :&nbsp;&nbsp;</strong><a href=\"mailto:siripak.ut@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">siripak.ut@ssru.ac.th</a><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>website :&nbsp;&nbsp; &nbsp;</strong></span><strong><a href=\"http://www.teacher.ssru.ac.th/siripak_ut/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none