(3327, 1, 1120, ' ผู้ช่วยศาสตราจารย์ ดร. ประกายกาวิล ศรีจินดา', 0, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">หัวหน้ากลุ่มสาขาวิชานิเทศศาสตร์&nbsp;</span><br />\r\n<span style=\"font-family:kanit,sans-serif; font-size:14px\">หัวหน้าแขนงวิชาการโฆษณาและสื่อสารการตลาด</span></p>\r\n', NULL, NULL),
(3328, 2, 1120, 'ผู้ช่วยศาสตราจารย์ ดร. ประกายกาวิล ศรีจินดา', 0, '<p><span style=\"font-family:kanit,sans-serif; font-size:14px\">หัวหน้ากลุ่มสาขาวิชานิเทศศาสตร์&nbsp;</span><br />\r\n<span style=\"font-family:kanit,sans-serif; font-size:14px\">หัวหน้าแขนงวิชาการโฆษณาและสื่อสารการตลาด</span></p>\r\n', NULL, NULL),
(3329, 1, 1121, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ผู้ช่วยศาสตราจารย์ ดร_ ประกายกาวิล ศรีจินดา.jpg\" style=\"height:423px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาเอก&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">:&nbsp;ปรัชญาดุษฎีบัณฑิต (การสื่อสาร),มหาวิทยาลัยนเรศวร</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาโท&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;:&nbsp;นิเทศศาสตรมหาบัณฑิต (นิเทศศาสตรพัฒนาการ),</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">จุฬาลงกรณ์มหาวิทยาลัย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">:&nbsp;ศิลปศาสตรบัณฑิต (นิเทศศาสตร์),</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">สถาบันราชภัฏสวนสุนันทา</span><br />\r\n			<strong>ประวัติการทำงาน (พอสรุป):&nbsp;</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">: &nbsp; &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ประชาสัมพันธ์ บริษัท คิว มิวสิค จำกัด และบริษัท บาแรมยู จำกัด</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">(เครือแกรมมี่)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">: &nbsp; &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ครีเอทีฟ บริษัท วีอาร์ พรีเซนเตชั่น จำกัด</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">: &nbsp; &nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">ผู้จัดการแผนกสื่อสารการตลาด บริษัท เพรซิเดนท์ เบเกอรี่ จำกัด&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">(มหาชน)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งงานปัจจุบัน :</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;หัวหน้ากลุ่มสาขาวิชานิเทศศาสตร์&nbsp;<br />\r\n			&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; หัวหน้าแขนงวิชาการโฆษณาและสื่อสารการตลาด</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>อีเมลล์ :&nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\"><a href=\"mailto:prakaikavin.sr@ssru.ac.th\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">prakaikavin.sr@ssru.ac.th</a></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>เว็บไซต์</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;:&nbsp;</span><a href=\"http://www.teacher.ssru.ac.th/prakaikavin_sr/\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">www.teacher.ssru.ac.th/prakaikavin_sr/</a></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>&nbsp;</div>\r\n', NULL, NULL),
