(3499, 1, 1182, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารย์ สุภาภรณ์ วิมลชัยฤกษ์.jpg\" style=\"height:425px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ปริญญาตรี &nbsp;: &nbsp;</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">Bachelor of Art(Communication Art) &nbsp;From Bangkok University, Bangkok, Thailand</span><br />\r\n			<strong>ตำแหน่งงาน &nbsp;:&nbsp;&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาวิทยุกระจายเสียงและวิทยุโทรทัศน์</span><br />\r\n			<strong>ประสบการณ์ที่เกี่ยวข้องกับการบริหารงานวิจัยทั้งภายในและภายนอกประเทศ</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1) &nbsp; &nbsp; &nbsp;Criminal Exhibit the Feminine Violent Victim within Thai Newspaper. World Academic of Science, Engineering and Technology, International Journal of Social, Management, Economic and Business Engineering Vol:8 No6, 2014</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2) &nbsp; &nbsp; &nbsp;การศึกษาเปรียบเทียบความคาดหวังและความเป็นจริงของผู้เรียนและผู้ประกอบวิชาชีพด้านภาพยนตร์ต่อหลักสูตรปริญญาตรีสาขาวิชาการภาพยนตร์ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา , 2557, ICMSIT2014, งบรายได้มหาวิทยาลัยราชภัฏสวนสุนันทา</span><br />\r\n			<strong><strong>Email :&nbsp;&nbsp;</strong></strong><a href=\"mailto:supaporn.wi@ssru.ac.th\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14