(3613, 1, 1223, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/ดร_ กฤษณะ เชื้อชัยนาท.jpg\" style=\"height:424px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong>ปริญญาเอก&nbsp; &nbsp;:</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">นิเทศศาสตรดุษฎีบัณฑิต&nbsp;</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">,</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">มหาวิทยาลัยธุรกิจบัณฑิต</span><br />\r\n			<strong>ปริญญาโท&nbsp;&nbsp;&nbsp;&nbsp;:&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">นิเทศศาสตรมหาบัณฑิต(การโฆษณา)</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">,</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">มหาวิทยาลัยศรีปทุม</span><br />\r\n			<strong>ปริญญาตรี &nbsp;&nbsp;:</strong><strong>&nbsp;&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">ศิลปศาสตรบัณฑิต (นิเทศศาสตร์) ,มหาวิทยาลัยราชภัฏธนบุรี</span><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่ง &nbsp;:</strong></span><strong>&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">อาจารย์แขนงวิชาภาพยนตร์และสื่อดิจิทัล</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ประวัติการทำงาน (พอสรุป)</strong><strong>:</strong></span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- อาจารย์ประจำคณะนิเทศศาสตร์มหาวิทยาลัยศรีปทุม</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- อาจารย์ประจำคณะนิเทศศาสตร์มหาวิทยาลัยเซนต์จอห์น</span></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
