(3641, 1, 1233, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารย์ สมิทธินันท์ ไทยรุ่งโรจน์.jpg\" style=\"height:425px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong><strong>ปริญญาโท&nbsp;</strong>:&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">นศบ. ( วารสารศาสตร์ ) มหาวิทยาลัยกรุงเทพฯ&nbsp;เอกวารสารศาสาตร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong><strong>ปริญญาตรี &nbsp;</strong><strong>:</strong></strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">นศ.บ. (วารสารศาสตร์),มหาวิทยาลัยกรุงเทพ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งปัจจุบัน :</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;อาจารย์แขนงวิชาภาพยนตร์และสื่อดิจิทัล</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>ประวัติการทำงาน</strong><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1 .วางแผนโฆษณา ฝ่ายสื่อสารการตลาด &nbsp;บริษัท โทเทิ่ลแอ็คเซ็สคอมมูนิเคชั่น จำกัด (ดีแทค)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2. พัฒนาบริการเสริม ( ออดิโอเท็กซ์ ) บริษัท มัลติมีเดีย แอนด์ เซอร์วิสเซ็ส จำกัด ( ยูคอม )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">3. การตลาด บริษัทเวิลด์เน็ท แอนด์ เซอร์วิสเซ็ส จำกัด (ผู้ให้บริการอินเทอร์เน็ต)(ยูคอม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">4. วางแผนการตลาด &nbsp;บริษัทแปซิฟิกอินเตอร์เน็ต &nbsp;(ประเทศไทย )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">5. อาจารย์พิเศษ สถาบันราชภัฎเพชรบุรีวิทยาลงกรณ์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">6. อาจารย์ประจำ สาขาวิชาสื่อสารมวลชน &nbsp;คณะวิทยาการสารสนเทศมหาวิทยาลัยมหาสารคาม</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;6.1 กรรมการอำนวยการสถานีวิทยุมหาวิทยาลัยมหาสารคาม ( 2545- 2546)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;6.2กรรมการร่างหลักสูตร สื่อนฤมิต ( New Media ) 2544 &ndash;2545</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;6.3 อาจารย์ประจำหลักสูตรสื่อนฤมิต ( New Media ) &nbsp;2545- 2546</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">7. บริษัท อินเทอร์เน็ตประเทศไทย จำกัด (มหาชน) ผู้ให้บริการอินเทอร์เน็ตรายแรกของประเทศไทย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;7.1ผู้จัดการภาคตะวันออกเฉียงเหนือ บ.อินเทอร์เน็ตประเทศไทย จำกัด(มหาชน )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;7.2 ผู้จัดการภาคตะวันออก บ.อินเทอร์เน็ต ประเทศไทย จำกัด(มหาชน)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">8 .อาจารย์ประจำ และกรรมการหลักสูตรสาขาวิชา NewMedia (การสื่อสารผ่านสื่อใหม่ ) คณะวิทยาการจัดการ</span><br />\r\n			<br />\r\n			<strong>งานวิจัยและบริการวิชาการ</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1.โครงการวิจัยระบบสารสนเทศชุมชน &nbsp;( ทบวงมหาวิทยาลัย ) ต้นแบบระบบบริหารจัดการท้องถิ่น การศึกษา และการพัฒนาระบบสารสนเทศชุมชน จังหวัด มหาสารคาม กาฬสินธ์ ร้อยเอ็ด แหล่งทุนวิจัยทบวงมหาวิทยาลัย ปีงบประมาณ 2544 ไดัรับทุนสนับสนุนปี 2545 (5.4 ล้านบาท )(ผู้ร่วมวิจัย)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2. ศึกษาความต้องการและอบรมการใช้ระบบสารสนเทศ ระดับชุมชนให้ &nbsp;องค์การบริหารส่วนตำบล</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">แก่ 3 จังหวัด ( ร้อยเอ็ด กาฬสินธุ์ มหาสารคาม ) จำนวน 35 อบต. &nbsp;(บริการวิชาการแก่ชุมชน )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">3. โครงการวิจัยวิทยุชุมชนจังหวัดมหาสารคาม ( สกว. ) โครงการวิจัย การใช้วิทยุท้องถิ่นเพื่อส่งเสริมประชาคมจังหวัดมหาสารคาม</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;ทุนวิจัย สำนักงานกองทุนสนับสนุนการวิจัย ปี 2545- 2548</span><br />\r\n			<strong>ประสบการณ์การสอนและบรรยาย ระดับอุดมศึกษา</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การออกแบบเวปไซต์(มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- หลักการออกแบบภาพเคลื่อนไหว (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ภาพยนตร์แอนิเมชั่น (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- คอมพิวเตอร์เพื่องานภาพยนตร์ (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- หลักการสื่อสารผ่านสื่อใหม่ (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การตลาดดิจิทัล (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การออกแบบและวาดลายเส้นเพื่อการสื่อสารผ่านสื่อใหม่(มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การจัดการธุรกิจเพื่อการสื่อสารผ่านสื่อใหม่ &nbsp;(มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ความคิดสร้างสรรค์เพื่อการสื่อสารผ่านสื่อใหม่ (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- กฎหมายและจริยธรรมสื่อสารมวลชน (มหาวิทยาลัยมหาสารคาม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การเขียนข่าว (มหาวิทยาลัยมหาสารคาม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การสืื่อสารการตลาด (มหาวิทยาลัยมหาสารคาม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ติดต่อ &nbsp;&nbsp;</strong>&nbsp;สาขา การสื่อสารผ่านสื่อใหม่ &nbsp;คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; 085-4880445</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><a href=\"mailto:smithinun.t@gmail.com\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">smithinun.t@gmail.com</a>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\">&nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\"><strong>Email :</strong><a href=\"mailto:%20%3Cscript%20type=\'text/javascript\'%3E%20%3C!--%20var%20prefix%20=%20\'ma\'%20+%20\'il\'%20+%20\'to\';%20var%20path%20=%20\'hr\'%20+%20\'ef\'%20+%20\'=\';%20var%20addy22056%20=%20\'smithinon.th\'%20+%20\'@\';%20addy22056%20=%20addy22056%20+%20\'ssru\'%20+%20\'.\'%20+%20\'ac\'%20+%20\'.\'%20+%20\'th\';%20document.write(\'%3Ca%20\'%20+%20path%20+%20\'%5C\'\'%20+%20prefix%20+%20\'%3A\'%20+%20addy22056%20+%20\'%5C\'%3E\');%20document.write(addy22056);%20document.write(\'%3C/a%3E\');%20//--%3E%5Cn%20%3C/script%3E%3Cscript%20type=\'text/javascript\'%3E%20%3C!--%20document.write(\'%3Cspan%20style=%5C\'display%3A%20none;%5C\'%3E\');%20//--%3E%20%3C/script%3EThis%20email%20address%20is%20being%20protected%20from%20spambots.%20You%20need%20JavaScript%20enabled%20to%20view%20it.%20%3Cscript%20type=\'text/javascript\'%3E%20%3C!--%20document.write(\'%3C/\');%20document.write(\'span%3E\');%20//--%3E%20%3C/script%3E\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">&nbsp;</a><a href=\"mailto:smithinon.th@ssru.ac.th\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">smithinon.th@ssru.ac.th</a></div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\"><strong>website :&nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/smithinon_th/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/smithinon_th/</a></strong></div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
(3642, 2, 1233, 'ประวัติส่วนตัว', 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://www.website-thai.com/project/ssru/theme/upload/userfile/images/อาจารย์ สมิทธินันท์ ไทยรุ่งโรจน์.jpg\" style=\"height:425px; width:300px\" /></td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px;\"><strong><strong>ปริญญาโท&nbsp;</strong>:&nbsp;</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">นศบ. ( วารสารศาสตร์ ) มหาวิทยาลัยกรุงเทพฯ&nbsp;เอกวารสารศาสาตร์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong><strong>ปริญญาตรี &nbsp;</strong><strong>:</strong></strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">นศ.บ. (วารสารศาสตร์),มหาวิทยาลัยกรุงเทพ</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ตำแหน่งปัจจุบัน :</strong></span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;อาจารย์แขนงวิชาภาพยนตร์และสื่อดิจิทัล</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><strong>ประวัติการทำงาน</strong><br />\r\n			<br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1 .วางแผนโฆษณา ฝ่ายสื่อสารการตลาด &nbsp;บริษัท โทเทิ่ลแอ็คเซ็สคอมมูนิเคชั่น จำกัด (ดีแทค)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2. พัฒนาบริการเสริม ( ออดิโอเท็กซ์ ) บริษัท มัลติมีเดีย แอนด์ เซอร์วิสเซ็ส จำกัด ( ยูคอม )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">3. การตลาด บริษัทเวิลด์เน็ท แอนด์ เซอร์วิสเซ็ส จำกัด (ผู้ให้บริการอินเทอร์เน็ต)(ยูคอม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">4. วางแผนการตลาด &nbsp;บริษัทแปซิฟิกอินเตอร์เน็ต &nbsp;(ประเทศไทย )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">5. อาจารย์พิเศษ สถาบันราชภัฎเพชรบุรีวิทยาลงกรณ์</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">6. อาจารย์ประจำ สาขาวิชาสื่อสารมวลชน &nbsp;คณะวิทยาการสารสนเทศมหาวิทยาลัยมหาสารคาม</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;6.1 กรรมการอำนวยการสถานีวิทยุมหาวิทยาลัยมหาสารคาม ( 2545- 2546)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;6.2กรรมการร่างหลักสูตร สื่อนฤมิต ( New Media ) 2544 &ndash;2545</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;6.3 อาจารย์ประจำหลักสูตรสื่อนฤมิต ( New Media ) &nbsp;2545- 2546</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">7. บริษัท อินเทอร์เน็ตประเทศไทย จำกัด (มหาชน) ผู้ให้บริการอินเทอร์เน็ตรายแรกของประเทศไทย</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;7.1ผู้จัดการภาคตะวันออกเฉียงเหนือ บ.อินเทอร์เน็ตประเทศไทย จำกัด(มหาชน )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp;7.2 ผู้จัดการภาคตะวันออก บ.อินเทอร์เน็ต ประเทศไทย จำกัด(มหาชน)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">8 .อาจารย์ประจำ และกรรมการหลักสูตรสาขาวิชา NewMedia (การสื่อสารผ่านสื่อใหม่ ) คณะวิทยาการจัดการ</span><br />\r\n			<br />\r\n			<strong>งานวิจัยและบริการวิชาการ</strong><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">1.โครงการวิจัยระบบสารสนเทศชุมชน &nbsp;( ทบวงมหาวิทยาลัย ) ต้นแบบระบบบริหารจัดการท้องถิ่น การศึกษา และการพัฒนาระบบสารสนเทศชุมชน จังหวัด มหาสารคาม กาฬสินธ์ ร้อยเอ็ด แหล่งทุนวิจัยทบวงมหาวิทยาลัย ปีงบประมาณ 2544 ไดัรับทุนสนับสนุนปี 2545 (5.4 ล้านบาท )(ผู้ร่วมวิจัย)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">2. ศึกษาความต้องการและอบรมการใช้ระบบสารสนเทศ ระดับชุมชนให้ &nbsp;องค์การบริหารส่วนตำบล</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">แก่ 3 จังหวัด ( ร้อยเอ็ด กาฬสินธุ์ มหาสารคาม ) จำนวน 35 อบต. &nbsp;(บริการวิชาการแก่ชุมชน )</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">3. โครงการวิจัยวิทยุชุมชนจังหวัดมหาสารคาม ( สกว. ) โครงการวิจัย การใช้วิทยุท้องถิ่นเพื่อส่งเสริมประชาคมจังหวัดมหาสารคาม</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;ทุนวิจัย สำนักงานกองทุนสนับสนุนการวิจัย ปี 2545- 2548</span><br />\r\n			<strong>ประสบการณ์การสอนและบรรยาย ระดับอุดมศึกษา</strong><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp;</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การออกแบบเวปไซต์(มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- หลักการออกแบบภาพเคลื่อนไหว (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ภาพยนตร์แอนิเมชั่น (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- คอมพิวเตอร์เพื่องานภาพยนตร์ (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- หลักการสื่อสารผ่านสื่อใหม่ (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การตลาดดิจิทัล (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การออกแบบและวาดลายเส้นเพื่อการสื่อสารผ่านสื่อใหม่(มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การจัดการธุรกิจเพื่อการสื่อสารผ่านสื่อใหม่ &nbsp;(มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- ความคิดสร้างสรรค์เพื่อการสื่อสารผ่านสื่อใหม่ (มรฎ.สวนสุนันทา)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- กฎหมายและจริยธรรมสื่อสารมวลชน (มหาวิทยาลัยมหาสารคาม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การเขียนข่าว (มหาวิทยาลัยมหาสารคาม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\">- การสืื่อสารการตลาด (มหาวิทยาลัยมหาสารคาม)</span><br />\r\n			<span style=\"font-family:kanit,sans-serif; font-size:14px\"><strong>ติดต่อ &nbsp;&nbsp;</strong>&nbsp;สาขา การสื่อสารผ่านสื่อใหม่ &nbsp;คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; 085-4880445</span><span style=\"font-family:kanit,sans-serif; font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><a href=\"mailto:smithinun.t@gmail.com\" style=\"box-sizing: border-box; color: rgb(51, 122, 183); text-decoration-line: none; font-family: Kanit, sans-serif; font-size: 14px;\">smithinun.t@gmail.com</a>\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\">&nbsp;</div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\"><strong>Email :</strong><a href=\"mailto:%20%3Cscript%20type=\'text/javascript\'%3E%20%3C!--%20var%20prefix%20=%20\'ma\'%20+%20\'il\'%20+%20\'to\';%20var%20path%20=%20\'hr\'%20+%20\'ef\'%20+%20\'=\';%20var%20addy22056%20=%20\'smithinon.th\'%20+%20\'@\';%20addy22056%20=%20addy22056%20+%20\'ssru\'%20+%20\'.\'%20+%20\'ac\'%20+%20\'.\'%20+%20\'th\';%20document.write(\'%3Ca%20\'%20+%20path%20+%20\'%5C\'\'%20+%20prefix%20+%20\'%3A\'%20+%20addy22056%20+%20\'%5C\'%3E\');%20document.write(addy22056);%20document.write(\'%3C/a%3E\');%20//--%3E%5Cn%20%3C/script%3E%3Cscript%20type=\'text/javascript\'%3E%20%3C!--%20document.write(\'%3Cspan%20style=%5C\'display%3A%20none;%5C\'%3E\');%20//--%3E%20%3C/script%3EThis%20email%20address%20is%20being%20protected%20from%20spambots.%20You%20need%20JavaScript%20enabled%20to%20view%20it.%20%3Cscript%20type=\'text/javascript\'%3E%20%3C!--%20document.write(\'%3C/\');%20document.write(\'span%3E\');%20//--%3E%20%3C/script%3E\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">&nbsp;</a><a href=\"mailto:smithinon.th@ssru.ac.th\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">smithinon.th@ssru.ac.th</a></div>\r\n\r\n			<div style=\"box-sizing: border-box; font-family: Kanit, sans-serif; font-size: 14px; text-align: center;\"><strong>website :&nbsp;</strong><strong><a href=\"http://www.teacher.ssru.ac.th/smithinon_th/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;\">www.teacher.ssru.ac.th/smithinon_th/</a></strong></div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
