(4347, 1, 689, 'นักขายมือใหม่', 1, '<p>วันนี้มีโครงการดีๆของคณะวิทยาการจัดการ โดยแขนงวิชาการตลาด รายวิชาการบริหารการขาย &quot;นักขายมือใหม่&quot;&nbsp;</p>\r\n', '<p>วันนี้มีโครงการดีๆของคณะวิทยาการจัดการ โดยแขนงวิชาการตลาด รายวิชาการบริหารการขาย &quot;นักขายมือใหม่&quot; มีสินค้ามาจำหน่ายโดยนักศึกษาแขนงวิชาการตลาด อาทิ อาหารคาว หวาน เครื่องดื่ม ของกิ๊ฟช็อป ฯลฯ จัดขึ้นที่ใต้อาคาร 57 คณะวิทยาการจัดการ ซึ่งกิจกรรมดังกล่าวจัดถึงวันที่ 15 พฤศจิกายน 2561 ตั้งแต่เวลา 09.00 - 17.00 น.</p>\r\n\r\n<p>งานประชาสัมพันธ์ คณะวิทยาการจัดการ<br />\r\n<a href=\"http://www.fms.ssru.ac.th/?fbclid=IwAR3LipUOgyJspoEwCuWSP7I-NDLN8eZBPL65xQcTwVTFIPUQO6o2xLJyIE0\" rel=\"noopener nofollow\" style=\"color: rgb(54, 88, 153); cursor: pointer; text-decoration-line: none; font-family: inherit;\" target=\"_blank\">www.fms.ssru.ac.th</a></p>\r\n', NULL),
(4348, 2, 689, 'นักขายมือใหม่', 1, '<p>วันนี้มีโครงการดีๆของคณะวิทยาการจัดการ โดยแขนงวิชาการตลาด รายวิชาการบริหารการขาย &quot;นักขายมือใหม่&quot;&nbsp;</p>\r\n', '<p>วันนี้มีโครงการดีๆของคณะวิทยาการจัดการ โดยแขนงวิชาการตลาด รายวิชาการบริหารการขาย &quot;นักขายมือใหม่&quot; มีสินค้ามาจำหน่ายโดยนักศึกษาแขนงวิชาการตลาด อาทิ อาหารคาว หวาน เครื่องดื่ม ของกิ๊ฟช็อป ฯลฯ จัดขึ้นที่ใต้อาคาร 57 คณะวิทยาการจัดการ ซึ่งกิจกรรมดังกล่าวจัดถึงวันที่ 15 พฤศจิกายน 2561 ตั้งแต่เวลา 09.00 - 17.00 น.</p>\r\n\r\n<p>งานประชาสัมพันธ์ คณะวิทยาการจัดการ<br />\r\n<a href=\"http://www.fms.ssru.ac.th/?fbclid=IwAR3LipUOgyJspoEwCuWSP7I-NDLN8eZBPL65xQcTwVTFIPUQO6o2xLJyIE0\" rel=\"noopener nofollow\" style=\"color: rgb(54, 88, 153); cursor: pointer; text-decoration-line: none; font-family: inherit;\" target=\"_blank\">www.fms.ssru.ac.th</a></p>\r\n', NULL),
(4349, 1, 690, 'เปิดรับสมัครนักศึกษาใหม่ โครงการจัดการศึกษาภาคพิเศษ', 1, '<p><img alt=\"\" src=\"http://203.155.54.138/upload/userfile/images/f7263942f8a85c735ce6f5ce8a7d7dfeb25a7f2b.jpg\" style=\"height:1024px; width:1280px\" /></p>\r\n', '<p>The Toy ก็พาเธอไปอวกาศ&nbsp; ไม่ได้<br />\r\nแต่งาน Universe of Advertising พาเธอไปอวกาศได้นะคะ</p>\r\n\r\n<p>มาร่วมกันเรียนรู้ และแลกเปลี่ยนประสบการณ์กันตั้งแต่ขั้นตอนการคิดงานโฆษณาอย่าง Creative ไปจนถึงขั้นตอนการผลิตงานโฆษณาในส่วนของ&nbsp;<br />\r\nPro-Production<br />\r\nProduction<br />\r\nPost-Production<br />\r\nจากพี่ๆ วิทยากรผู้มากความสามารถ เพื่อให้เกิดความเข้าใจและสามารถนำไปปรับใช้ได้จริง</p>\r\n\r\n<p>ณ ห้อง Mini Theater ชั้น6 ตึก57 คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา<br />\r\n30 November 2018<br />\r\n8:00-16:00 น.</p>\r\n', NULL),
(4350, 2, 690, 'Open for new students Special Education Program', 1, '<p><img alt=\"\" src=\"http://203.155.54.138/upload/userfile/images/f7263942f8a85c735ce6f5ce8a7d7dfeb25a7f2b.jpg\" style=\"height:1024px; opacity:0.9; width:1280px\" /></p>\r\n', NULL, NULL),
(4351, 1, 691, 'เปิดรับสมัครนักศึกษาใหม่  โครงการจัดการศึกษาภาคพิเศษ  นิเทศศาสตร์  รอบที่ 3', 1, '<p><img alt=\"\" src=\"http://203.155.54.138/upload/userfile/images/4e912b912d90adc4823617e6a2ea3908134fe652.jpg\" style=\"height:1063px; width:1600px\" /></p>\r\n', '<p>เอาละ!!! จงมา จงมา ????</p>\r\n\r\n<p>&nbsp;&quot;อัญเชิญ เพื่อนพ้องน้องพี่ ญาติสนิทมิตรสหาย&nbsp;</p>\r\n\r\n<p>&nbsp;ขอเชิญชวนเข้าร่วมรับฟังโครงการบรรยายพิเศษ&nbsp;</p>\r\n\r\n<p>&nbsp;&quot; Fight to my dream &quot;</p>\r\n\r\n<p>&nbsp;&quot;ความเป็นจริง กับสิ่งที่ฝัน&quot;</p>\r\n\r\n<p>&zwj;&zwj;พบกับ คุณ ป๊อก mindset&nbsp;</p>\r\n\r\n<p>(คุณภัสสรกรณ์ จิราธิวัฒน์)</p>\r\n\r\n<p>&nbsp;วันพุธ ที่ 21 พฤศจิกายน 2561</p>\r\n\r\n<p>เวลา 13.00 - 16.00 น.</p>\r\n\r\n<p>(เริ่มลงทะเบียน 12.30 น.)</p>\r\n\r\n<p>ณ ห้องประชุมสุวพัตร์นิเวศน์</p>\r\n\r\n<p>ห้อง 5724 ชั้น 2</p>\r\n\r\n<p>คณะวิทยาการจัดการ มหาลัยราชภัฏสวนสุนันทา&nbsp;</p>\r\n\r\n<p>&hellip;.........&hellip;....................................</p>\r\n\r\n<p>&nbsp; &nbsp; มีเกมและรางวัลอีกเพียบไม่มาแล้วจะพลาดน้ะจ้ะ ????</p>\r\n\r\n<p>ติดต่อสอบถาม หรือสำรองที่นั่งได้ที่&nbsp;</p>\r\n\r\n<p>???? 098-2985691 (โจโจ้ )&nbsp;</p>\r\n\r\n<p>????099-4383336 (โบนัส)</p>\r\n\r\n<p>หรือลงทะเบียนออนไลน์ได้ที่นี้</p>\r\n\r\n<p><a href=\"https://goo.gl/forms/Vz0yz3U6NdFfjJGX2\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; text-shadow: none;\" target=\"_blank\">https://goo.gl/forms/Vz0yz3U6NdFfjJGX2</a></p>\r\n\r\n<p>#HRM02 #ssru &nbsp;#fighttomydream #ความเป็นจริงกับสิ่งที่ฝัน&nbsp;</p>\r\n\r\n<p>#เบอร์มาดิ #คริคริ #ป๊อกกี้ontherun</p>\r\n', NULL),
