(4965, 1, 798, 'ขอเชิญน้องๆพี่ๆที่สนใจ เข้าร่วมประกวดกระทง ', 1, '<p>ขอเชิญน้องๆพี่ๆที่สนใจ เข้าร่วมประกวดกระทง ในปีการศึกษา 2561</p>\r\n\r\n<p>ในวันลอยกระทง วันที่ 22 พฤศจิกายน 2561</p>\r\n', '<p style=\"text-align:center\"><span style=\"font-size:26px\"><strong><span style=\"font-family:verdana,geneva,sans-serif\">ขอเชิญน้องๆพี่ๆที่สนใจ เข้าร่วมประกวดกระทง ในปีการศึกษา 2561</span></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:26px\"><strong>ในวันลอยกระทง วันที่ 22 พฤศจิกายน 2561</strong></span><br />\r\n<span style=\"font-size:18px\">--------------------------------------------------------------------------</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">น้องๆ พี่ๆ คนไหนที่สนใจ สามารถขอรับใบสมัครได้แล้ววันนี้ หรือสามารถดาวโหลด ใบสมัครได้ทางเพจ&nbsp;</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">สภานักศึกษา หรือ องค์การนักศึกษได้เลย สามารถสอบถามรายระเอียดเพิ่มเติม&nbsp;</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">หรือข้อสงสัยใดๆ เกี่ยวกับการสมัคร สามารถ inbox มาสอบถามได้ที่&nbsp;</span></span><a href=\"https://www.facebook.com/SC.SSU.SSRU/\" rel=\"noopener noreferrer\" style=\"color: rgb(0, 0, 0); box-sizing: border-box; background-color: transparent; text-decoration-line: none; text-shadow: none;\" target=\"_blank\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\"><em><u><strong>Facebook</strong></u></em></span></span></a><br />\r\n<span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">-----------------------------------------------------------------------------</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"