(4967, 1, 799, 'กองพัฒนานักศึกษา ร่วม สสสร. จัดอบรมพัฒนาบุคลิกภาพนักศึกษา', 1, '<p>วันที่ 26 ตุลาคม 2561 ฝ่ายวินัยนักศึกษา กองพัฒนานักศึกษา ร่วมกับ ฝ่ายกิจการพิเศษ สถาบันสร้างสรรค์และส่งเสริมการเรียนรู้ตลอดชีวิต (สสสร.)&nbsp;</p>\r\n', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; วันที่ 26 ตุลาคม 2561 ฝ่ายวินัยนักศึกษา กองพัฒนานักศึกษา ร่วมกับ ฝ่ายกิจการพิเศษ สถาบันสร้างสรรค์และส่งเสริมการเรียนรู้ตลอดชีวิต (สสสร.) จัด โครงการอบรมบุคลิกภาพสำหรับนักศึกษา&nbsp; ขึ้น ณ ห้องประชุมช่อแก้ว อาคาร 31 ชั้น 5 โดยได้รับเกียรติจากอาจารย์นฤมล ชมโฉม รองผู้อำนวยการฝ่ายกิจการพิเศษ เป็นวิทยากรในการอบรมพัฒนาบุคลิกภาพ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; กิจกรรมดังกล่าว จัดขึ้นเพื่อพัฒนาบุคลิกภาพให้กับนักศึกษา ในการนำไปปรับใช้ในชีวิตประจำวัน เช่น การสมัครงาน การพูดหน้าห้องเรียน การอยู่ต่อหน้าแขกผู้มีเกียรติ หรือการแต่งกายให้เหมาะสมกับกาลเทศะ และงานที่เข้าร่วม เป็นต้น ซึ่งได้รับความสนใจจากนักศึกษา กว่า 200 คน</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ข่าว: นางสาวภุมรินทร์ ส่งสัมพันธ์สกุล/นางสาวเสาวภา ชัยพฤกษทล</p>\r\n\r\n<p>แปล: นางสาวอัจฉราพรรณ ได้พร&nbsp;</p>\r\n\r\n<p>ตรวจ: ผู้ช่วยศาสตราจารย์ สิริอร จำปาทอง</p>\r\n\r\n<p>ภาพ: นายสิทธิศักดิ์ กิ่งจันมน</p>\r\n\r\n<p>งานประชาสัมพันธ์ฯ กองพัฒนานักศึกษา</p>\r\n\r\n<div class=\"col-xs-8 text-left\">\r\n<h5>Download</h5>\r\n\r\n<div class=\"well well-sm\" style=\"background:#FFFFFF;\">\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/162/2018102902b785f5afbc1b848145601b66252d4819281748231\" target=\"_blank\">26102561.1-01.jpg</a></div>\r\n\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/162/20181029e10405a9ef82c1b0be6075ae022c9b51443e4fdd829\" target=\"_blank\">49 SDD and ILPC conducted the Personality Development for Students โ.pdf</a></div>\r\n\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/162/201810318feea81e3f216ad4fa760370faef8e52ae6bbd94921\" target=\"_blank\">49 SDD and ILPC conducted the Personality Development for Students โ.docx</a></div>\r\n</div>\r\n</div>\r\n', ''),
