(4969, 1, 800, 'ยุทธศาสตร์ที่ 3 ด้านเทคโนโลยีสารสนเทศและวิทยบริการ : กองพัฒนานักศึกษา เผยแพร่ 70 ข่าว ภาษาไทยและภาษาอังกฤษและ 435 index ในเดือนตุลาคม', 1, '<p>วันที่ 14 พฤศจิกายน 2561 เวลา 10.30 &ndash; 12.00 น. กองพัฒนานักศึกษา โดยผู้อำนวยการกองพัฒนานักศึกษา ได้มอบหมายให้ นางสาวเสาวภา ชัยพฤกษทล และนายสิทธิศักดิ์ กิ่งจันมน</p>\r\n', '<p>&nbsp;วันที่ 14 พฤศจิกายน 2561 เวลา 10.30 &ndash; 12.00 น. กองพัฒนานักศึกษา โดยผู้อำนวยการกองพัฒนานักศึกษา ได้มอบหมายให้ นางสาวเสาวภา ชัยพฤกษทล และนายสิทธิศักดิ์ กิ่งจันมน เจ้าหน้าที่งานประชาสัมพันธ์และสารสนเทศ เข้าประชุมคณะกรรมการดำเนินงานยุทธศาสตร์มหาวิทยาลัย ยุทธศาสตร์ที่ 3 ด้านเทคโนโลยีสารสนเทศและวิทยบริการ เพื่อรับทราบแนวทางการดำเนินงาน การรายงานผลการขับเคลื่อนทิศทางยุทธศาสตร์มหาวิทยาลัย ด้านเทคโนโลยีสารสนเทศและวิทยบริการ ประจำปีงบประมาณ พ.ศ.2562 โดยสำนักวิทยบริการและเทคโนโลยีสารสนเทศ เป็นเจ้าภาพจัดการประชุม ในครั้งนี้&nbsp; ซึ่งเบื้องต้น สำนักวิทยบริการฯ ได้กำหนดให้หน่วยงานที่เกี่ยวข้องดำเนินการรายงานผลการลงข้อมูลข่าวสารผ่านช่องทางการสื่อสาร ได้แก่ เว็บไซต์หน่วยงาน (ภาษาไทย) เว็บไซต์หน่วยงาน (ภาษาอังกฤษ) และ Facebook fan page&nbsp; เป้าหมาย อย่างน้อย 10 ข่าวต่อเดือน และรายงานผลทุกวันที่ 15 ของทุกเดือน จากแนวทางการดำเนินงานด้านเทคโนโลยีสารเทศ (การประชาสัมพันธ์ข้อมูลข่าวสาร) ผ่านช่องทางดังกล่าว กองพัฒนานักศึกษา ได้ดำเนินการปรับปรุงช่องทางและมีการรวบรวมรายงานผล ปัจจุบันมีข้อมูลข่าวสารกว่า 70 ข่าว / 435 index ในรอบเดือนตุลาคม ซึ่งเป้าหมายของกองพัฒนานักศึกษา จะต้องดำเนินการให้ได้ อย่างน้อย 20 ข่าวทุกเดือน และมีหน้าเพจในเว็บไซต์ ไม่น้อยกว่า 300&nbsp; Index /เดือน</p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>ข่าว: นางสาวเสาวภา ชัยพฤกษทล</em></span></p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>แปล</em><em>: นางสาวอัจฉราพรรณ ได้พร&nbsp;</em></span></p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>ตรวจ</em><em>: ผู้ช่วยศาสตราจารย์ สิริอร จำปาทอง</em></span></p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>ภาพ: กองนโยบายและแผน</em></span></p>\r\n\r\n<div class=\"col-xs-8 text-left\">\r\n<h5>Download</h5>\r\n\r\n<div class=\"well well-sm\" style=\"background:#FFFFFF;\">\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/196/201811172b26d8946e24a8df21fb4ad5e46878b408a2cc34216\" target=\"_blank\">The 3rd Strategy - SDDSSRU Information Technology-01.jpg</a></div>\r\n\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/196/2018111754c7404dd880bd2e07a9979ef9be359a42258a34142\" target=\"_blank\">71 3rd Startegy (Fast Track) SDDSSRU.pdf</a></div>\r\n\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/196/20181117998c9d61f621909023097ec9a470f70f4ca59379840\" target=\"_blank\">71 3rd Startegy (Fast Track).docx</a></div>\r\n</div>\r\n</div>\r\n\r\n<p><em><span style=\"font-family:verdana,geneva,sans-serif\">งานประชาสัมพันธ์ฯ กองพัฒนานักศึกษา</span></em></p>\r\n\r\n<p>&nbsp;</p>\r\n', ''),
(4970, 2, 800, 'ยุทธศาสตร์ที่ 3 ด้านเทคโนโลยีสารสนเทศและวิทยบริการ : กองพัฒนานักศึกษา เผยแพร่ 70 ข่าว ภาษาไทยและภาษาอังกฤษและ 435 index ในเดือนตุลาคม', 1, '<p>วันที่ 14 พฤศจิกายน 2561 เวลา 10.30 &ndash; 12.00 น. กองพัฒนานักศึกษา โดยผู้อำนวยการกองพัฒนานักศึกษา ได้มอบหมายให้ นางสาวเสาวภา ชัยพฤกษทล และนายสิทธิศักดิ์ กิ่งจันมน</p>\r\n', '<p>&nbsp;วันที่ 14 พฤศจิกายน 2561 เวลา 10.30 &ndash; 12.00 น. กองพัฒนานักศึกษา โดยผู้อำนวยการกองพัฒนานักศึกษา ได้มอบหมายให้ นางสาวเสาวภา ชัยพฤกษทล และนายสิทธิศักดิ์ กิ่งจันมน เจ้าหน้าที่งานประชาสัมพันธ์และสารสนเทศ เข้าประชุมคณะกรรมการดำเนินงานยุทธศาสตร์มหาวิทยาลัย ยุทธศาสตร์ที่ 3 ด้านเทคโนโลยีสารสนเทศและวิทยบริการ เพื่อรับทราบแนวทางการดำเนินงาน การรายงานผลการขับเคลื่อนทิศทางยุทธศาสตร์มหาวิทยาลัย ด้านเทคโนโลยีสารสนเทศและวิทยบริการ ประจำปีงบประมาณ พ.ศ.2562 โดยสำนักวิทยบริการและเทคโนโลยีสารสนเทศ เป็นเจ้าภาพจัดการประชุม ในครั้งนี้&nbsp; ซึ่งเบื้องต้น สำนักวิทยบริการฯ ได้กำหนดให้หน่วยงานที่เกี่ยวข้องดำเนินการรายงานผลการลงข้อมูลข่าวสารผ่านช่องทางการสื่อสาร ได้แก่ เว็บไซต์หน่วยงาน (ภาษาไทย) เว็บไซต์หน่วยงาน (ภาษาอังกฤษ) และ Facebook fan page&nbsp; เป้าหมาย อย่างน้อย 10 ข่าวต่อเดือน และรายงานผลทุกวันที่ 15 ของทุกเดือน จากแนวทางการดำเนินงานด้านเทคโนโลยีสารเทศ (การประชาสัมพันธ์ข้อมูลข่าวสาร) ผ่านช่องทางดังกล่าว กองพัฒนานักศึกษา ได้ดำเนินการปรับปรุงช่องทางและมีการรวบรวมรายงานผล ปัจจุบันมีข้อมูลข่าวสารกว่า 70 ข่าว / 435 index ในรอบเดือนตุลาคม ซึ่งเป้าหมายของกองพัฒนานักศึกษา จะต้องดำเนินการให้ได้ อย่างน้อย 20 ข่าวทุกเดือน และมีหน้าเพจในเว็บไซต์ ไม่น้อยกว่า 300&nbsp; Index /เดือน</p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>ข่าว: นางสาวเสาวภา ชัยพฤกษทล</em></span></p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>แปล</em><em>: นางสาวอัจฉราพรรณ ได้พร&nbsp;</em></span></p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>ตรวจ</em><em>: ผู้ช่วยศาสตราจารย์ สิริอร จำปาทอง</em></span></p>\r\n\r\n<p><span style=\"font-family:verdana,geneva,sans-serif\"><em>ภาพ: กองนโยบายและแผน</em></span></p>\r\n\r\n<div class=\"col-xs-8 text-left\">\r\n<h5>Download</h5>\r\n\r\n<div class=\"well well-sm\" style=\"background:#FFFFFF;\">\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/196/201811172b26d8946e24a8df21fb4ad5e46878b408a2cc34216\" target=\"_blank\">The 3rd Strategy - SDDSSRU Information Technology-01.jpg</a></div>\r\n\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/196/2018111754c7404dd880bd2e07a9979ef9be359a42258a34142\" target=\"_blank\">71 3rd Startegy (Fast Track) SDDSSRU.pdf</a></div>\r\n\r\n<div style=\"padding:8px 0;\"><a href=\"attachment/196/20181117998c9d61f621909023097ec9a470f70f4ca59379840\" target=\"_blank\">71 3rd Startegy (Fast Track).docx</a></div>\r\n</div>\r\n</div>\r\n\r\n<p><em><span style=\"font-family:verdana,geneva,sans-serif\">งานประชาสัมพันธ์ฯ กองพัฒนานักศึกษา</span></em></p>\r\n\r\n<p>&nbsp;</p>\r\n', ''),
