r: rgb(71, 66, 93); font-family: Kanit, sans-serif; font-size: 17px; margin-left: auto !important; margin-right: auto !important;\">\r\n<div class=\"panel-row-style panel-row-style-for-661-3\" style=\"box-sizing: border-box; display: flex; flex-wrap: nowrap; justify-content: space-between; padding: 30px 0px; align-items: flex-start; background-position: 50% -135px;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-661-3-0\" style=\"box-sizing: border-box; width: calc(50% - 15px);\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" id=\"panel-661-3-0-0\" style=\"box-sizing: border-box; zoom: 1; margin-bottom: 0px;\">\r\n<div class=\"panel-widget-style panel-widget-style-for-661-3-0-0\" style=\"box-sizing: border-box;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: border-box;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: border-box;\">\r\n<div>รหัสและชื่อหลักสูตร</div>\r\n\r\n<div>ภาษาไทย : หลักสูตรบัญชีบัณฑิต</div>\r\n\r\n<div>ภาษาอังกฤษ : Bachelor of Accountancy Program</div>\r\n\r\n<div>ชื่อปริญญาและสาขาวิชา</div>\r\n\r\n<div>ชื่อเต็ม (ภาษาไทย) : บัญชีบัณฑิต ชื่อย่อ (ภาษาไทย) : บช.บ.</div>\r\n\r\n<div>ชื่อเต็ม (ภาษาอังกฤษ) : Bachelor of Accountancy</div>\r\n\r\n<div>ชื่อย่อ (ภาษาอังกฤษ) : B.Acc.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>จำนวนหน่วยกิตที่เรียนตลอดหลักสูตร</div>\r\n\r\n<div>ไม่น้อยกว่า 129 หน่วยกิต</div>\r\n\r\n<p>ไฟล์รายละเอียดหลักสูตร<br />\r\n<a href=\"http://www.rmutp.ac.th/web2561/wp-content/uploads/2019/07/CHECO-%E0%B8%84.%E0%B8%AD.%E0%B8%9A.%E0%B8%A7%E0%B8%B4%E0%B8%A8%E0%B8%A7%E0%B8%81%E0%B8%A3%E0%B8%A3%E0%B8%A1%E0%B9%80%E0%B8%84%E0%B8%A3%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B8%87%E0%B8%81%E0%B8%A5-5-%E0%B8%9B%E0%B8%B5-2561-11-%E0%B8%81.%E0%B8%84.-62.pdf\" style=\"color: rgb(150, 69, 214); box-sizing: border-box; background-color: transparent; text-decoration-line: none; transition: all 0.3s ease-in-out 0s;\">&nbsp;</a><a href=\"http://203.155.54.138/upload/userfile/files/ac(1).pdf\"><span style=\"color:rgb(71, 66, 93); font-family:kanit,sans-serif\">หลักสูตรบัญชีบัณฑิต</span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-661-3-1\" style=\"box-sizing: border-box; width: calc(50% - 15px);\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" id=\"panel-661-3-1-0\" style=\"box-sizing: border-box; zoom: 1; margin-bottom: 0px;\">\r\n<div class=\"panel-widget-style panel-widget-style-for-661-3-1-0\" style=\"box-sizing: border-box;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: border-box;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: border-box;\">\r\n<p>รูปแบบของหลักสูตร<br />\r\n1. รูปแบบ<br />\r\nหลักสูตรระดับปริญญาตรี 4 ปี<br />\r\n2. ภาษาที่ใช้<br />\r\nภาษาไทย<br />\r\n3. การรับเข้าศึกษา<br />\r\nให้เป็นไปตามข้อบังคับมหาวิทยาลัยราชภัฏสวนสุนันทา ว่าด้วยการศึกษาระดับปริญญาตรี<br />\r\nพ.ศ. 2551<br />\r\n4. ความร่วมมือกับสถาบันอื่น<br />\r\nเป็นหลักสูตรเฉพาะของสถาบันที่จัดการเรียนการสอนโดยตรง<br />\r\n5. การให้ปริญญาแก่ผู้สาเร็จการศึกษา<br />\r\nให้ปริญญาเพียงสาขาวิชาเดียว</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://203.155.54.138/upload/userfile/files/ac(2).pdf\">อ่านเพิ่มเติม</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '<div class=\"panel-grid panel-has-style\" id=\"pg-661-2\" style=\"box-sizing: border-box; max-width: 1170px; margin-bottom: 0px; color: rgb(71, 66, 93); font-family: Kanit, sans-serif; font-size: 17px; margin-left: auto !important; margin-right: auto !important;\">\r\n<div class=\"panel-row-style panel-row-style-for-661-2\" style=\"box-sizing: border-box; display: flex; flex-wrap: nowrap; justify-content: space-between; padding: 0px; align-items: flex-start; background-position: 50% -29px;\">