(10049, 1, 1721, 'คณะวิทยาการจัดการ จัดโครงการพัฒนาศักยภาพทางด้านการจัดธุรกิจจำลอง สำหรับผู้ประกอบการมือใหม่ ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190422/52c4ce32540d782980572062e1f1524a74dff239.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เมื่อวันที่ 19 เมษายน 2562 ที่ผ่านมา คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดโครงการพัฒนาศักยภาพทางด้านการจัดธุรกิจจำลองสำหรับผู้ประกอบการมือใหม่ ประจำปี 2562 ซึ่งได้รับเกียรติจาก ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ เป็นประธานกล่าวเปิดโครงการพร้อมเยี่ยมชมธุรกิจจำลองของนักศึกษาแต่ละสาขาที่เข้าร่วมการประกวด &nbsp; ณ ลานกิจกรรมใต้อาคาร 57 คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; โครงการดังกล่าวมีวัตถุประสงค์จัดขึ้น เพื่อส่งเสริมให้นักศึกษามีความรู้ความเข้าใจ เกี่ยวกับกระบวนการจัดทำธุรกิจและสามารถนำความรู้ไปประยุกต์ใช้กับธุรกิจจำลองได้ &nbsp;กิจกรรมประกอบด้วย การประกวดธุรกิจจำลอง และการจัดบอร์ดนิทรรศการนำเสนอผลงาน &nbsp;สำหรับการตัดสินการประกวดธุรกิจจำลอง ได้รับเกียรติจากคณะกรรมการผู้ทรงคุณวุฒิ ผู้เชี่ยวชาญจากมหาวิทยาลัยต่างๆ เป็นคณะกรรมการตัดสินการประกวดธุรกิจจำลอง ได้แก่ ผู้ช่วยศาสตราจารย์.ดร.ณคุณ ธรณีนิติญาณ รองหัวหน้าภาควิชาฝ่ายบริหาร ภาควิชาสหกรณ์ คณะเศรษฐศาสตร์ มหาวิทยาลัยเกษตรศาสตร์ , อาจารย์ ดร.อติเทพ แจ้ดนาลาวอาจารย์ประจำ สังกัดคณะมัณฑนศิลป์ คณะมัณฑนศิลป์ มหาวิทยาลัยศิลปากร และอาจารย์อัจฉรา คำภูแสน อาจารย์ประจำสาขาวิชาการตลาด &nbsp;คณะบริหารธุรกิจ มหาวิทยาลัยศรีปทุม &nbsp;ซึ่งผลการตัดสิน มีดังนี้</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;รางวัลชนะเลิศ &nbsp;ได้แก่ แขนงวิชาธุรกิจระหว่างประเทศ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;รางวัลรองชนะเลิศอันดับ 1 ได้แก่ สาขาวิชาคอมพิวเตอร์ธุรกิจ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;รางวัลรองชนะเลิศอันดับ 2 &nbsp;ได้แก่ แขนงวิชาการจัดการธุรกิจบริการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;รางวัลชมเชย &nbsp;ได้แก่ &nbsp;แขนงวิชาการเงินการธนาคาร</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;รางวัล Popular Vote &nbsp;ได้แก่ สาขาวิชาการบัญชี</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;&ldquo;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา มีภารกิจในการจัดการเรียนการสอนให้สอดคล้องกับสถานการณ์และมาตรฐานคุณวุฒิระดับอุดมศึกษา 5 ด้าน คือ ด้านคุณธรรมจริยธรรม ด้านความรู้ ด้านทักษะทางปัญญา ด้านทักษะความสัมพันธ์ระหว่างบุคคลและความรับผิดชอบ และด้านทักษะการวิเคราะห์เชิงตัวเลข การสื่อสารและการใช้เทคโนโลยีสารสนเทศ สำหรับด้านทักษะทางปัญญานั้น ถือเป็นคุณลักษณะที่สำคัญประการหนึ่งในการพัฒนานักศึกษา ให้เป็นบัณฑิตที่มีลักษณะอันพึงประสงค์ โดยคณะวิทยาการจัดการ มีการจัดการเรียนการสอนด้านบริหารธุรกิจ จึงต้องการพัฒนานักศึกษาให้นำความรู้จากในห้องเรียน นำมาประยุกต์ใช้ในการทำงานจริงอย่างสร้างสรรค์ และเป็นผู้ประกอบการอย่างมืออาชีพในอนาคต &nbsp;ดังนั้นฝ่ายกิจการนักศึกษาและศิลปวัฒนธรรม คณะวิทยาการจัดการ จึงจัดโครงการ &ldquo;พัฒนาศักยภาพทางด้านการจัดธุรกิจจำลอง สำหรับผู้ประกอบการมือใหม่ ประจำปี 2562&rdquo; ขึ้น เพื่อพัฒนาและสนับสนุนนักศึกษาให้เป็นผู้ประกอบการที่ดีในอนาคต และตระหนักถึงความสำคัญในการวางแผนอย่างละเอียดรอบคอบ วิเคราะห์ผลกระทบต่าง ๆ ได้เป็นอย่างดี ด้วยวิธีการดำเนินงานธุรกิจจำลอง และสามารถนำความรู้ที่ได้รับไปต่อยอดในการประกอบธุรกิจได้ในอนาคต&rdquo; อาจารย์สุพัตรา กาญจโนภาส รองคณบดีฝ่ายกิจการนักศึกษา กล่าว</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10050, 2, 1721, 'Faculty of Management Science Organize a project to develop potential in the simulation business. For new entrepreneurs,2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/c8fe6cfbb1c00a793009dd5ba32d8793fe8eeca9.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;On April 19, 2019, the Faculty of Management Science Suan Sunandha Rajabhat University Organized a project to develop potential in the simulation business for new entrepreneurs in the year 2019, which was honored by Assistant Professor Dr. Prateep Vajithongratana, Dean of the Faculty of Management Science As the chairman said the project was opened and visited the simulation business of each branch of students participating in the contest at the activity area under Building 57, Faculty of Management Science.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;The project is intended to be held. To encourage students to have knowledge and understanding About the business process and can apply knowledge to the simulation business Activities include Simulation business contest And organizing exhibition boards for presentations.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10051, 1, 1722, 'นิเทศศาสตร์ภาพยนตร์ วจก.จัดเสวนาวิชาการ “จับฉาย” จับมือ 5สถาบัน ฉายภาพยนตร์นิพนธ์ร่วมกัน', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190422/d089cd069aa8a9e07e4430bc59dbc5ea795de88d.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;แขนงวิชาภาพยนตร์และสื่อดิจิทัล กลุ่มสาขาวิชานิเทศศาสตร์ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดเสวนาวิชาการ &quot;จับฉาย&rdquo; ปีที่ 2 เป็นโครงการฉายภาพยนตร์นิพนธ์ของนักศึกษาร่วมกัน 5 สถาบัน พร้อมพูดคุยเกี่ยวกับงานเบื้องหลังการผลิตภาพยนตร์สั้น &nbsp;ประกอบด้วยมหาวิทยาลัยธรรมศาสตร์ &nbsp; มหาวิทยาลัยกรุงเทพ &nbsp; มหาวิทยาลัยศิลปากร &nbsp; มหาวิทยาลัยรังสิต &nbsp;และมหาวิทยาลัยราชภัฏสวนสุนันทา ณ โรงภาพยนตร์เมเจอร์ซีนีเพล็กซ์ สามเสน กรุงเทพมหานคร</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; อาจารย์ &nbsp;ดร.พงศวีร์ สุภานนท์ อาจารย์ประจำแขนงวิชาภาพยนตร์และสื่อดิจิทัลและอาจารย์ที่ปรึกษาโครงการ เปิดเผยว่า &ldquo;สำหรับกิจกรรมโครงการจับฉายครั้งนี้ &nbsp;เป็นกิจกรรมที่จัดขึ้นอย่างต่อเนื่องเป็นปีที่ 2 ถือเป็นอีกกิจกรรมหนึ่งของแขนงวิชาภาพยนตร์และสื่อดิจิทัลที่เป็นประโยชน์ต่อนักศึกษาในการแลกเปลี่ยนความรู้ เชิงวิชาการ ความคิด และมุมมองของเพื่อนๆต่างสถาบันในสาขาเดียวกัน ผ่านสื่อภาพยนตร์สั้นร่วมกัน นอกจากนี้ยังเป็นการสร้างเครือข่ายนักศึกษาต่างสถาบันก่อให้เกิดมิตรภาพระหว่างเพื่อนวิชาชีพด้วยกัน ซึ่งได้รับการตอบรับด้วยดีจากนักศึกษาในสังกัด รวมถึงบุคคลภายนอกให้ความสนใจเข้าร่วมงานเป็นจำนวนมาก โดยกิจกรรมดังกล่าวจัดเป็นกิจกรรมหลักของแขนงวิชาภาพยนตร์และสื่อดิจิทัลที่มุ่งเน้นให้นักศึกษาเกิดความรู้ ทักษะ และมีศักยภาพในวิชาชีพ ภายใต้โครงการเอตทัคคะของคณะวิทยาการจัดการ&rdquo;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; ท้ายนี้แขนงวิชาภาพยนตร์และสื่อดิจิทัล ขอขอบคุณ ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนาคณบดีคณะวิทยาการจัดการที่ได้ให้การสนับสนุนโครงการดังกล่าวอันเป็นประโยชน์ต่อนักศึกษาในการพัฒนาศักยภาพความเป็นมืออาชีพทางด้านภาพยนตร์อย่างต่อเนื่อง &nbsp;และขอขอบคุณโรงภาพยนตร์เมเจอร์ซีนีเพล็กซ์ สามเสน &nbsp;ที่เอื้อเฟื้อสถานที่ในการจัดงานทุกครั้งที่ผ่านมา &nbsp; &nbsp;&nbsp;</span></p>\r\n', '', '');
INSERT INTO `sl_language_detail` (`id`, `language_id`, `ref_id`, `name`, `type`, `detail`, `detail_2`, `detail_3`) VALUES
(10052, 2, 1722, 'Film and digital media organized academic seminar, \"Jab Chai\", join with 5 institutions to screen movies together.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/09fef2d99e0c2b34532e6ab21130e2b90346e2bb.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.322px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; Film and digital media, Communication Arts program, Faculty of Management Science, Suan Sunandha Rajabhat University organized academic seminar, &quot;Jab Chai&quot; 2nd &nbsp;is a project to screen the thesis of 5 students together and talk about the work behind the production of short films. Consisting of Thammasat University Bangkok University Silpakorn University Rangsit University And Suan Sunandha Rajabhat University at Major Cineplex Samsen, Bangkok.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;Creating a network of students from different institutions creates friendships between professional friends. Which has been well received by students under the Including many third parties interested in joining the event This activity is considered as the main activity of film and digital media fields that focus on students to gain knowledge, skills and potential in the profession. Under the program of the Faculty of Management Science.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10053, 1, 1723, 'สกว. และ มรภ.สวนสุนันทา ประชุมพบปะแลกเปลี่ยน เพื่อร่วมพัฒนางานวิจัยตามยุทธศาสตร์การพัฒนาประเทศ', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190423/1bb0d2a5b97dfb391d68da2427b34b498f8951b7.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; เมื่อวันที่ 22 เมษายน 2562 &nbsp; รองศาสตราจารย์.ดร.วิทยา เมฆขำ รองอธิการบดีฝ่ายแผนและประกันคุณภาพ มหาวิทยาลัยสวนสุนันทา ให้การต้อนรับ ผู้ช่วยศาสตราจารย์สุภาวดี โพธิยะราช ผู้อำนวยการฝ่าย ฝ่ายการวิจัยมุ่งเป้า สำนักงานกองทุนสนับสนุนการวิจัย (สกว.) ที่ร่วมประชุมหารือแลกเปลี่ยนกับ ผู้บริหารและคณาจารย์มหาวิทยาลัยราชภัฏสวนสุนันทา &nbsp;เพื่อการพัฒนางานวิจัยตามยุทธศาสตร์การพัฒนาประเทศ ซึ่งจะเป็นการร่วมกันทำงานโดยเน้นเครือข่ายการวิจัยจากหลายมหาวิทยาลัย &nbsp;ซึ่งผู้เข้าร่วมการประชุมในครั้งนี้ ประกอบด้วย ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ และผู้ช่วยศาสตราจารย์ ดร.สมบูรณ์ เวสน์ คณบดีวิทยาลัยสถาปัตยกรรมศาสตร์ &nbsp;รองคณบดีทั้งสองคณะ &nbsp;พร้อมด้วย ผู้ช่วยศาสตราจารย์อนพัทย์ หนองคู และอาจารย์ฉัตรฉวี คงดี ซึ่งในการประชุมหารือ มีประเด็นแลกเปลี่ยน 3 ประเด็นหลักๆ ได้แก่ ประเด็นแรก การเตรียมการจัดตั้งสำนักงานคณะกรรมการส่งเสริมวิทยาศาสตร์ วิจัยและนวัตกรรม(สกสว.) ประเด็นที่ 2 การบริหารจัดการสำนักประสานงาน ฝ่ายการวิจัยมุ่งเป้า (สกว.) และประเด็นสุดท้าย คือ ความร่วมมือทางวิชาการ/การวิจัย ที่กำลังจะเกิดขึ้นในระยะเวลาอันใกล้นี้</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;ในช่วงท้ายของการประชุม ทางสำนักงานกองทุนสนับสนุนการวิจัย (สกว.) ได้กล่าวขอบคุณมหาวิทยาลัยราชภัฏสวนสุนันทา ที่กรุณาให้ความอนุเคราะห์อนุญาตให้ อาจารย์ของมหาวิทยาลัย จากคณะวิทยาการจัดการและวิทยาลัยสถาปัตยกรรมศาสตร์ มาร่วมงานกับ สำนักงานกองทุนสนับสนุนการวิจัย (สกว.) และสร้างผลงานที่มีคุณภาพตลอดระยะเวลาที่ผ่านมา</span></p>\r\n', '', ''),
(10054, 2, 1723, 'TRF and SSRU Exchange Meeting to Develop Research in Accordance with the National Development Strategy', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/7cd47361edc80bd1a0dff77ccdbe8a1f209ef53e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;On April 22, 2019, Associate Professor Dr. Wittaya Khokkam, Vice President for Planning and Quality Assurance Suan Sunandha Rajabhat University welcomed Assistant Professor Supawadee Photiyarat, director of aimed research department at Thailand Research Fund (TRF), which participated in the exchange meeting with executives and faculty of Suan Sunandha Rajabhat University for research development according to the national development strategy which will work together by focusing on research networks from many universities. The participants of this meeting consisted of Assistant Professor Dr. Prathip Wageongratana, Dean of the Faculty of Management Science, Assistant Professor Dr. Somboon Wess, Dean of the College of Architecture including the Associate Dean of both faculties, together with Assistant Professor Anupat Nong Khu and Ajarn Chat Chawee Kongdee. There are 3 main exchange issues in the meeting. The first issue is the preparation for the establishment of the office of the Thailand Science Research and innovation (TSRI). The second issue is Management coordination office of the Thailand Research Fund (TRF) and the last issue is academic cooperation / research that is going to happen in the near future.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; At the end of the meeting, The Thailand Research Fund (TRF) has thanked Suan Sunandha Rajabhat University for allowing the university&#39;s teachers from the Faculty of Management Science and the College of Architecture to work with the Thailand Research Fund (TRF) and create quality work throughout the past period.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10055, 1, 1724, 'โครงการพัฒนาศักยภาพทางด้านการจัดธุรกิจจำลองสำหรับผู้ประกอบการมือใหม่ ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/f0f0fe9a25787f9bab90c6d5c0a1ca67aa9be239.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &quot;การพัฒนานักศึกษาให้นำความรู้จากในห้องเรียน นำมาประยุกต์ใช้ในการทำงานจริงอย่างสร้างสรรค์ และเป็นผู้ประกอบการอย่างมืออาชีพในอนาคต ส่งเสริมให้นักศึกษามีความรู้ความเข้าใจ เกี่ยวกับกระบวนการจัดทำธุรกิจและสามารถนำความรู้ไปประยุกต์ใช้กับธุรกิจจำลองได้&quot;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; **โครงการพัฒนาศักยภาพทางด้านการจัดธุรกิจจำลองสำหรับผู้ประกอบการมือใหม่ ประจำปี 2562</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; เปิดรับสมัครนักศึกษาใหม่แล้ววันนี้ สอบถามเพิ่มเติม โทร. 0-2160-1495</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;งานประชาสัมพันธ์ คณะวิทยาการจัดการ</span></p>\r\n', '', ''),
(10056, 2, 1724, 'Project for the development of potential in the simulation business for new entrepreneurs in the 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/8ad627d55986894cd8218419abdd5535bf0db445.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;Developing students to bring knowledge from the classroom Be applied in real creative work And being a professional entrepreneur in the future Encourage students to have knowledge and understanding About the business process and can apply knowledge to the simulation business.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; Project for the development of potential in the simulation business for new entrepreneurs in the 2019</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; Faculty of Management Science Suan Sunandha Rajabhat University</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; Open for new students today. For more information, call 0-2160-1495.</span></p>\r\n', '', ''),
(10057, 1, 1725, 'ขอเชิญเข้าร่วมโครงการ “Let’s Get Organized ตอน How to be PR 4.0”', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/3736c44693397cf4f0bbf8ec93efba816e274a50.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/b6bc1a62493ede5caf988cb66c4eb711627c044e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:1162.44px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; ประชาสัมพันธ์ จากแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร : ขอเชิญเข้าร่วมโครงการ&ldquo;Let&rsquo;s Get Organized ตอน How to be PR 4.0&rdquo; พบกับกิจกรรมการเสริมสร้างความรู้ความเข้าใจในการเลือกใช้สื่อประชาสัมพันธ์ในยุค 4.0, กิจกรรมการทดลองการเป็นพิธีกร และผู้ประกาศข่าว อีกทั้งยังมีการบรรยายจากวิทยากรมืออาชีพอย่าง คุณประภาวี เหมทัศน์ (บะหมี่) Creative / Project Manager บริษัท เอ็กซ์เทนเดอร์ จำกัด ซึ่งมีเพจในการดูแลคือ อีจัน (8M Followers) FoodTravel.TV (993K Followers) ในวันเสาร์ ที่ 27 เมษายน 2562 เวลา 08.00 &ndash; 16.00 น. ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) อาคาร 57 คณะวิทยาการจัดการ เข้าร่วมรับฟังฟรี! ไม่เสียค่าใช้จ่าย</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10058, 2, 1725, 'Invited to join the \"Let’s Get Organized\" episode, How to be PR 4.0 \"', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/e59440a0b30e117d571f84222736f39dbb1238d2.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190424/02d74e6f24bddf9cd21b9506565384f382f3b624.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:1162.44px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n', '', ''),
(10059, 1, 1726, 'ประชาสัมพันธ์ขอเชิญผู้ที่สนใจเข้าร่วมประชุมวิชาการระดับชาติและนานาชาติ ครั้งที่ 6 ICMSIT 2019', 1, '<p><img src=\"http://fms.ssru.ac.th/useruploads/images/20190426/8660c0ae3485ddae03fab9f10a263178e2f0d8db.jpg\" /></p>\r\n', '', ''),
