(10061, 1, 1727, 'คณะวิทยาการจัดการ จัด Mini Conference นำเสนอผลงานวิจัยของนักศึกษาสาขาวิชาการบัญชี', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190426/12d08234fa637fe6e9e2e15bd3c42cd616a93b79.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:543.609px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:16px\">&nbsp; วันที่ 26 เมษายน 2562 คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดประชุมวิชาการเพื่อนำเสนอผลงานวิจัยของนักศึกษาสาขาวิชาการบัญชี &nbsp;โดยได้รับเกียรติจากผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ เป็นประธานกล่าวเปิดโครงการ ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;สำหรับโครงการดังกล่าวมีวัตถุประสงค์จัดขิ้นเพื่อเป็นเวทีสาธารณะในการเผยแพร่ผลงานวิจัยและผลงานวิชาการของนักศึกษาสาขาวิชาการบัญชี อันจะนำไปสู่การประยุกต์ใช้ผลงานวิจัยของนักศึกษาให้เกิดประโยชน์ต่อวิชาชีพและสังคมต่อไป</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong>การจัดประชุมวิชาการในครั้งนี้ ได้รับความร่วมมือจากอาจารย์ประจำสาขาในการวิพากษ์ อาจารย์ที่ปรึกษาผู้ให้คำแนะนำนักศึกษาในการเขียนบทความ &nbsp; และนักศึกษาในการนำเสนอผลงานวิจัยทุกคน &nbsp;มีบทความวิจัยและบทความวิชาการของนักศึกษาชั้นปีที่ 3 สาขาวิชาการบัญชี ซึ่งผ่านการคัดเลือกให้เข้าร่วมนำเสนอผลงาน จำนวน 26 บทความ ในหัวข้อวิจัยทางการบัญชีในด้านต่างๆโดยมีคณาจารย์ประจำสาขาวิชาการบัญชีร่วมให้ข้อเสนอแก่นักศึกษาในระหว่างการพัฒนาบทความวิจัย</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong>&ldquo;ผลงานวิจัยของนักศึกษา ถือเป็นแหล่งข้อมูลและองค์ความรู้ที่เป็นประโยชน์ สามารถนำมาพัฒนาและประยุกต์ใช้เพื่อเป็นประโยชน์ต่อวิชาชีพได้ การจัดงานในครั้งนี้เห็นได้ว่าเป็นงานที่มีประโยชน์อย่างยิ่งต่อนักศึกษา ในการสร้างประสบการณ์การนำเสนอผลงานวิจัยในเวทีสาธารณะ รวมถึงทำให้เกิดการแลกเปลี่ยนความรู้ ความคิดเห็นร่วมกันระหว่างนักศึกษา และคณาจารย์ในสาขาวิชาเดียวกัน อันจะนำไปสู่การพัฒนาผลงานวิจัยให้มีคุณภาพมากยิ่งขึ้น และนำไปสู่การสร้างเครือข่ายความร่วมมือทางวิชาการ และการพัฒนาต่อยอดงานวิจัยไปสู่เวทีระดับชาติต่อไป&rdquo; &nbsp;ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ กล่าว</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', '', ''),
(10062, 2, 1727, 'Faculty of Management Science arranged presents Mini Conference, presenting research of accounting students', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190507/a734e5e1026c5acc99b6ddf5a16a4af674c50858.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:543.609px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; On April 26, 2019, Faculty of Management Science, Suan Sunandha Rajabhat University arranged an academic conference to present research of accounting students honored by Assistant Professor Dr. Prateep Wajeetongratana, Dean of the Faculty of Management Science as the president &nbsp;said the opening ceremony at the Suwaphakniwet &nbsp;Conference Room (5724), Faculty of Management Science.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;The objective of the project is to be a public forum for the dissemination of research and academic works of accounting students. This will lead to an application research of students for further professional and social benefits.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10063, 1, 1728, 'คณะวิทยาการจัดการ จัด Mini Conference นำเสนอบทความวิชาการของนักศึกษากลุ่มสาขาวิชาบริหารธุรกิจ', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190429/fa0e0b21f97c71f04fdc6c4fd134dac140676517.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เมื่อวันที่ 26 เมษายน 2562 คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดโครงการนำเสนองานวิจัยและงานวิชาการ &nbsp;Mini Conference ของกลุ่มสาขาวิชาบริหารธุรกิจ &nbsp;ซึ่งคณะวิทยาการจัดการ &nbsp;ได้ให้ความสำคัญในการพัฒนาคุณภาพนักศึกษาด้านการวิจัย เพื่อให้สอดคล้องกับนโยบายส่งเสริมการพัฒนานักศึกษาสู่การวิจัยของมหาวิทยาลัย ในการนำเสนอผลงานวิจัยในครั้งนี้ เป็นการนำเสนอผลงานของ กลุ่มสาขาวิชาบริหารธุรกิจ &nbsp;ได้แก่ แขนงวิชาการเงินการธนาคาร แขนงวิชาการประกอบการธุรกิจ แขนงวิชาธุรกิจระหว่างประเทศ แขนงวิชาการบริหารทรัพยากรมนุษย์ แขนงวิชาการตลาด แขนงวิชาการจัดการธุรกิจบริการ โดยแบ่งการนำเสนอออกเป็นห้องย่อยของแต่ละสาขา&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;สำหรับการนำเสนองานวิจัยและงานวิชาการ &nbsp;Mini Conference ของกลุ่มสาขาวิชาบริหารธุรกิจในครั้งนี้ได้รับความร่วมมือจากอาจารย์ประจำคณะ อาจารย์ที่ปรึกษาผู้ให้คำแนะนำนักศึกษาในการเขียนบทความ &nbsp; และนักศึกษาทุกแขนงวิชา &nbsp;สอดคล้องกับวัตถุประสงค์เพื่อสร้างงานวิจัยทางการบริหารธุรกิจให้เกิดองค์ความรู้ใหม่ อันเป็นประโยชน์ต่อการพัฒนาการเรียนการสอน และการทำวิจัยของนักศึกษาต่อไป</span></p>\r\n', '', ''),
(10064, 2, 1728, 'Faculty of Management Science, arrange Mini Conference, presenting scholarly articles of Business Administration students.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/a820dadfaeb9b2c6830731aa1298a77ba61ef514.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;On April 26, 2019, Faculty of Management Science Suan Sunandha Rajabhat University arrange Mini Conference, presenting scholarly articles of Business Administration students for development of student quality in research. In order to comply with the policy of promoting student development to university research. Which dividing the presentation into sub-rooms of each branch.</span></p>\r\n', '', ''),
(10065, 1, 1729, 'นักศึกษาแขนงการประชาสัมพันธ์ฯ วจก. เข้าศึกษาดูงาน CSR ณ ศูนย์การเรียนรู้ กฟผ.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190429/98c2711cf853f3c6aa0561de901cda2ee7ca28a9.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; เมื่อเร็วๆนี้ &nbsp;ผู้ช่วยศาสตราจารย์ วิภาณี แม้นอินทร์ อาจารย์ประจำแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร นำทีมนักศึกษาฯ ชั้นปีที่ 3 &nbsp;เข้าศึกษาดูงานด้านการแสดงความรับผิดชอบต่อสังคมของ<br />\r\nการไฟฟ้าฝ่ายผลิตแห่งประเทศไทย ณ ศูนย์การเรียนรู้ กฟผ. สำนักงานกลาง โดยได้รับเกียรติ<br />\r\nจากคุณฤดีมาส ปางพุฒิพงศ์ ผู้ช่วยผู้อำนวยการฝ่ายกลยุทธ์ความยั่งยืน ให้การต้อนรับ<br />\r\nและเป็นวิทยากรบรรยายให้ความรู้ในเรื่อง &nbsp;EGAT and Sustainable Development &nbsp;พร้อมทั้งเยี่ยมชมศูนย์การเรียนรู้ กฟผ. โดยแบ่งออกเป็น 7 โซนการเรียนรู้ ได้แก่</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; โซนที่ 1 จุดประกายแสงแรกในตัวคุณ ลงทะเบียนรับ RFID แปลงร่างเป็น AVATAR ผจญภัยในโลกพลังงานไฟฟ้า</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;โซนที่ 2 จากแสงแรกสู่แสงนิรันดร์ ภาพยนตร์ 4 มิติ ที่จะพาทุกท่านไปพบวันแรกที่โลกได้สัมผัสพลังงานไฟฟ้าจนถึงวันที่ความต้องการไฟฟ้ามากขึ้นเรื่อย ๆ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; โซนที่ 3 คืนสู่สมดุล สัมผัสชีวิตอนาคตที่มีความสมดุลระหว่างมนุษย์ ธรรมชาติ และเทคโนโลยี</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; โซนที่ 4 สายน้ำแห่งความภูมิใจ สัมผัสภารกิจแห่งความภาคภูมิใจเพื่อความสุขของคนไทย จากป่าต้นน้ำสู่แม่น้ำเจ้าพระยา</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;โซนที่ 5 นวัตกรรมเพื่อชีวิต สำรวจเส้นทางประวัติศาสตร์แห่งอนาคตของ กฟผ. และภารกิจการไฟฟ้าไทยคู่ขนานกับความเป็นไปของโลกและสังคมไทย รวมถึงเรียนรู้นวัตกรรมและเทคโนโลยีการผลิตสายส่งไฟฟ้า</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;โซนที่ 6 โลกที่ยั่งยืน สำรวจโลกพลังงานไฟฟ้าของประเทศต่าง ๆ ทั่วโลก รวมทั้งประเทศไทย &nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp;และโซนที่ 7 แสงนิรันดร์ ประมวลผลการเรียนรู้และรวมพลังสร้างแสงแห่งสุขนิรันดร์ ซึ่งการเข้าศึกษาดูงานในครั้งนี้เป็นส่วนหนึ่งของการศึกษารายวิชาการสื่อสารเพื่อแสดงความรับผิดชอบต่อสังคม โดยนักศึกษาได้รับความสนุกสนานกับกิจกรรมแต่ละโซนการเรียนรู้ และได้รับองค์ความรู้ใหม่ในด้านการดำเนินงานแสดงความรับผิดชอบต่อสังคมอันเป็นประโยชน์และสามารถนำไปประยุกต์ใช้ในวิชาชีพนักประชาสัมพันธ์ได้ในภายภาคหน้า</span></p>\r\n', '', ''),
(10066, 2, 1729, 'Public relations students of FMS have studied CSR activity at the EGAT Learning Center.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/d382ca8b9568b62bbd53129d4d2c73299a53a180.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;Recently Assistant Professor Wipanee Manin, Lecturer in Public Relations and Corporate Communication bring the 3rd year students team to study the CSR activity at the Electricity Generating Authority of Thailand (EGAT) Learning Center.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; The students visiting the EGAT Learning Center, divided into 7 learning zones, including ;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;<strong>Zone 1</strong>&nbsp;Sparked the first light in your life . Register for RFID transform into AVATAR. Adventures in the electric power world.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;&nbsp;<strong>Zone 2,</strong>&nbsp;From the first light to the eternal light, &nbsp;4D movie that will take you &nbsp;meet the first day has touched electric power until the day that electricity needs increase.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; Zone 3&nbsp;</strong>Restores balance to life, a future that is balanced between human nature and technology.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; Zone 4,</strong>&nbsp;The river of pride Experience the mission of pride for the happiness of Thai people. From the watershed forest to the Chao Phraya River.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp;Zone 5</strong>&nbsp;Innovation for life explore the history of the future of EGAT and Thai electricity mission in parallel with the world and Thai society. Including learning innovation and technology for the production of power transmission lines.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\"><strong>&nbsp; &nbsp; Zone 6</strong>&nbsp;Sustainable world explore the electrical energy world of countries around the world, including Thailand.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><strong>&nbsp; &nbsp; &nbsp;Zone 7,</strong>&nbsp;Eternal light, processing, learning and combining the power to create the light of eternal happiness.</span></p>\r\n', '', ''),
(10067, 1, 1730, 'แขนงวิชาการประชาสัมพันธ์ วจก. จัดโครงการ Let’s Get Organized มุ่งสู่นักประชาสัมพันธ์ยุค 4.0', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190430/1e467055a0e1ed4082c3f30800d3939c493ccc16.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:549.25px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; เมื่อเร็วๆนี้ นักศึกษาแขนงวิชาการประชาสัมพันธ์และการสื่อสารองค์กร ชั้นปีที่ 3 ดำเนินการจัดโครงการ Let&rsquo;s Get Organized ตอน How to be PR 4.0 ณ ห้องประชุมสุวพักตร์นิเวศน์ คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา โดยอาจารย์ ดร.นันทิดา โอฐกรรม เป็นประธานกล่าวเปิดโครงการ &nbsp;ซึ่งได้รับเกียรติจาก คุณประภาวี เหมทัศน์ Creative / Project manager บริษัท เอ็กซ์เทนเดอร์ จำกัด &nbsp;เป็นวิทยากรบรรยายในหัวข้อ การสร้าง Content และการเลือกใช้สื่อประชาสัมพันธ์ในยุค 4.0 &nbsp;จากนั้นในช่วงบ่ายเป็นกิจกรรม Workshop ให้ผู้ที่เข้าร่วมกิจกรรมได้ทดลองเป็นนักประชาสัมพันธ์ในยุค 4.0 อาทิ การผลิตสื่อประชาสัมพันธ์ การเรียนรู้การเป็นพิธีกร และการทดลองเป็นผู้ประกาศข่าวและดำเนินรายการ ทั้งนี้เพื่อให้ผู้เข้าร่วมกิจกรรมนั้นสามารถนำประสบการณ์และความรู้จากการจัดกิจกรรม ไปบูรณาการและต่อยอดได้ในอนาคต</span></p>\r\n', '', ''),
(10068, 2, 1730, 'Public Relations Department, FMS, arranged the Let’s Get Organized Project, aimed at the public relations 4.0 era', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/32413ebaf4fde1e4de61ec12a33acc973c8a3bab.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:549.25px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">Recently 3rd public relations and communication organization students arranged the Let&rsquo;s Get Organized Project is &nbsp;&ldquo;How to be PR 4.0&rdquo; &nbsp;at Suwaphaknivej Meeting Room. Faculty of Management Science ,Suan Sunandha Rajabhat University by Dr. Nantida Otakum &nbsp;as the speech &nbsp;of the project. Which was honored by Mr. Praphawee &nbsp;Hemmathad, Creative / Project manager, Xderder Company Limited, as a lecturer on the topic of creating content and choosing to use public relations media in the 4.0 era.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;In the afternoon, have a workshop and activity for students who participated in the experiment was a publicist in the 4.0 era, such as the production of public relations media, Learning to be a MC and experimentation as a news announcer and conducting the program. So that participants can bring experience and knowledge from this project for integrating and expanding in the future.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10069, 1, 1731, 'วจก. ลงพื้นที่สมุทรสงคราม ถ่ายทอดองค์ความรู้ ทักษะการเป็นผู้ประกอบการสู่ธุรกิจชุมชน', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190430/f43e608100693fa69c646552a9180e2380d0117b.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:561.344px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;ฝ่ายพัฒนางานวิจัยและบริการวิชาการ ร่วมกับศูนย์ปฏิบัติการวิทยุโทรทัศน์และวิทยุกระจายเสียง คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา จัดโครงการถ่ายทอดองค์ความรู้ ทักษะการเป็นผู้ประกอบการสู่ธุรกิจชุมชน อำเภอบางคนที จังหวัดสมุทรสงครามขึ้น เพื่อถ่ายทอดองค์ความรู้ที่ได้จากการวิจัยเพื่อการพัฒนาชุมชน เพิ่มทักษะการเป็นผู้ประกอบการ ตลอดจนก้าวสู่การประกอบธุรกิจในอนาคต โดยภายในงานมีชาวบ้าน ผู้ประกอบการ นำโดยนายสุชล สุขเกษม ประธานศูนย์การเรียนรู้เศรษฐกิจพอเพียง เข้าร่วมรับฟังการอบรมฯ โดยภายในงานมีการสอดแทรกเทคนิคต่างๆที่สำคัญในการเป็นผู้ประกอบการ และตัวอย่างสินค้าจากท้องถิ่นมาร่วมรับฟังการบรรยาย&nbsp;</span></p>\r\n', '', ''),
(10070, 2, 1731, 'FMS. going on location Samut Songkhram area transfer of knowledge entrepreneurial skills to community business', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/52ce10b6c585596ea0b017b60f2949c709ec36c5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:561.344px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; Research and Academic Services Development Department &nbsp;collaboration with Radio and Television Broadcasting Center , Faculty of Management Science ,Suan Sunandha Rajabhat University organized knowledge transfer project entrepreneurial skills to community business in Bang Khonthi District, Samut Songkhram Province. &nbsp;To transfer of knowledge gained from research for community development increase entrepreneurial skills as well as stepping into business operations in the future In the event, there were villagers, entrepreneurs, led by Mr. Suchol Sukkasem, President of the Sufficiency Economy Learning Center. Participated in the training In the event, there are various techniques that are important in being an entrepreneur. And samples from local products to attend lectures.</span></p>\r\n', '', ''),
(10071, 1, 1732, 'วจก. จัดโครงการเพิ่มองค์ความรู้ด้านการตลาดยุคดิจิทัล 4.0 ในแหล่งเรียนรู้ ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190501/f86331e5dfab96d838f4e4257182010f449c8b41.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:551.344px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;ฝ่ายพัฒนางานวิจัยและบริการวิชาการ ร่วมกับศูนย์ปฏิบัติการวิทยุโทรทัศน์และวิทยุกระจายเสียง แหล่งเรียนรู้ด้านบริหารธุรกิจและนิเทศศาสตร์ สู่ชุมชน &nbsp; คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา จัดโครงการเพิ่มองค์ความรู้ด้านการตลาดยุคดิจิทัล 4.0 ในแหล่งเรียนรู้ ประจำปีงบประมาณ 2562 โดยได้รับเกียรติจากคุณจงจิต สกฤษศิลป์ &nbsp;เป็นวิทยากรบรรยายให้ความรู้เรื่อง &ldquo;กลยุทธ์มัดใจลูกค้าจาก Marketing 4.0&rdquo; และคุณศิริคนางค์ ปานศรี เป็นวิทยากรบรรยายให้ความรู้เรื่อง &ldquo;Matketing 4.0&rdquo; และ &ldquo;การประยุกต์ใช้ Marketing 4.0 กับธุรกิจ&rdquo; จัดขึ้น ณ แหล่งเรียนรู้ด้านบริหารธุรกิจและนิเทศศาสตร์ สู่ชุมชน &nbsp;อาคาร 34</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;สำหรับการจัดโครงการดังกล่าว มีวัตถุประสงค์เพื่อให้เกิดจำนวนฐานความรู้/องค์ความรู้เพิ่มขึ้นในแหล่งเรียนรู้บริการวิชาการ เพื่อให้มหาวิทยาลัยเป็นศูนย์กลางแห่งการเรียนรู้และบริการวิชาการแก่สังคม ซึ่งเป็นการปฏิบัติงานเพื่อขับเคลื่อนยุทธศาสตร์การสร้างผลงานวิชาการ สู่การยกระดับภูมิปัญญาท้องถิ่นอย่างยั่งยืนต่อไป</span></p>\r\n', '', ''),
(10072, 2, 1732, 'FMS. organized a project to increase knowledge in the digital era marketing 4.0 in the learning resource annual 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/7ce512ad8feed9168bab6ff582fa9e6ff88cc347.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:551.344px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; Research and Academic Services Development Department collaboration with Radio and Television Broadcasting Center and Learning resources in business administration and communication arts to the community , Faculty of Management Science ,Suan Sunandha Rajabhat University organized a project to increase knowledge in the digital era marketing 4.0 in the learning resource annual 2019 at Center and Learning resources in business administration and communication arts to the community, 34 building.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; This project has an objective is to increase the number of knowledge base / knowledge in academic services. To enable the university to be a center of learning and academic services for society which drive the strategy of creating academic results to improve local wisdom in further.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10073, 1, 1733, 'แขนงวิชาการโฆษณาฯ วจก. จัด CA Mini Conference 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190501/9f1ddef8788b64aeaa96d1d9e54387505b71b6c2.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:16px\">เมื่อวันที่ 30 เมษายน 2562 กลุ่มสาขาวิชานิเทศศาสตร์ สาขาการโฆษณาและการสื่อสารการตลาด &nbsp;คณะวิทยาการจัดการมหาวิทยาลัยราชภัฏสวนสุนันทา จัด ICMSITS 2019 CA mini Conference การนำเสนอผลงานวิจัยของนักศึกษาระดับปริญญาตรี &nbsp;โดยได้รับเกียรติจากผู้ทรงคุณวุฒิภายนอก ได้แก่ ดร.ธำรง รัตนภรานุเดช คณบดีคณะนิเทศศาสตร์ มหาวิทยาลัยเซนต์จอห์น ,ผู้ช่วยศาสตราจารย์ ดร.ปิ่นปินัทธ์ จ่าดา หัวหน้าสาขาวิชาการตลาด คณะบริหารธุรกิจ มหาวิทยาลัยศรีปทุม วิทยาเขตชลบุรี และผู้ทรงคุณวุฒิภายใน ได้แก่ ผู้ช่วยศาสตราจารย์ ดร.ประกายกาวิล ศรีจินดา อาจารย์ผู้รับผิดชอบหลักสูตรนิเทศศาสตรดุษฎีบัณฑิต มหาวิทยาลัยราชภัฏสวนสุนันทา เป็นกรรมการวิพากษ์บทความวิจัย &nbsp;จัดขึ้น ณ ห้อง Mini Theatre ชั้น 6 คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;สำหรับผลงานวิจัยของนักศึกษาได้รับคำชื่นชมในเรื่องประเด็นการศึกษาที่เหมาะสมกับยุคสมัย อาทิ งานวิจัยเรื่องปัจจัยที่ส่งผลต่อพฤติกรรมของผู้ใช้บริการแอพพลิเคชั่น K-Plus การสื่อสารการตลาดที่มีผลต่อการเลือกซื้อผลิตภัณฑ์ผ่านแอพพลิเคชั่น Shopee กลยุทธ์การสื่อสารการตลาดที่ส่งผลต่อผู้ชมรายการ Drag Race Thailand เป็นต้น อย่างไรก็ตาม ในส่วนของระเบียบวิธีวิจัยของบางกลุ่ม ยังต้องปรับปรุงเพิ่มเติม ทั้งนี้ ผลงานนำเสนอบางส่วนจะนำไปปรับปรุงเพื่อตีพิมพ์เผยแพร่ในวารสารวิชาการระดับชาติและนานาชาติตามนโยบายของมหาวิทยาลัยต่อไป</span></p>\r\n', '', ''),
(10074, 2, 1733, 'Advertising and Marketing Communication program,FMS, organized CA Mini Conference 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190508/6c5c728ce316820f9ed460554fa449610d37ff06.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; On April 30, 2019, Advertising and Marketing Communication program, Faculty of Management Science, Suan Sunandha Rajabhat University, organized ICMSITS 2019 CA Mini Conference. Presenting research of students. Honored by external professional from leading university as the Committee criticized of research articles at Mini Theater Room, 6th Floor, Faculty of Management Science building.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;For the research of students, get testimonials for educational issues that are suitable for the era, such as research on factors that affect the behavior of users of K-Plus applications, marketing communications affecting Buying products through the Shopee application Marketing, communication strategies that affect viewers of the Drag Race Thailand, etc. However, in the research methodology of some groups still need to improve further. Some of the presentation results will be updated for publication in national and international academic journals according to the university&#39;s policy.</span></p>\r\n', '', ''),
(10075, 1, 1734, 'ประชาสัมพันธ์เชิญร่วมพิธี “มนัสคารวะสมเด็จพระนางเจ้าสุนันทากุมารีรัตน์ พระบรมราชเทวี “ เนื่องในวันคล้ายวันเสด็จทิวงคต', 1, '<p style=\"text-align: center;\"><img src=\"http://fms.ssru.ac.th/useruploads/images/20190502/1d518de01cf1c1e8b191522c72b3f3d445a5ba55.jpg\" /></p>\r\n', '', ''),
(10076, 2, 1734, 'Public News : Invitation to the ceremony \" Reverence for Queen Sunandha Kumariratana \" On the occasion of pass away.', 1, '<p style=\"text-align: center;\"><img src=\"http://fms.ssru.ac.th/useruploads/images/20190502/1d518de01cf1c1e8b191522c72b3f3d445a5ba55.jpg\" /></p>\r\n', '', ''),
(10077, 1, 1735, 'วจก. จัดปัจฉิมนิเทศนักศึกษาฝึกประสบการณ์วิชาชีพ โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ ภาคเรียนที่ 2 /2561', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190502/717d0d57263d8e4bb1c8f29f33b53d74b07e177e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;</span></strong><span style=\"font-size:16px\">วันที่ 2 พฤษภาคม 2562 &nbsp; คณะวิทยาการจัดการ &nbsp;จัดปัจฉิมนิเทศนักศึกษาฝึกประสบการณ์วิชาชีพโครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ &nbsp;ประจำภาคเรียนที่ 2 ปีการศึกษา 2561 &nbsp; โดย ดร.สมศักดิ์ &nbsp;คล้ายสังข์ &nbsp;รองคณบดีฝ่ายบริหาร เป็นประธานกล่าวเปิดโครงการพร้อมให้โอวาทแก่นักศึกษา &nbsp; &nbsp;กิจกรรมประกอบด้วยการแสดงของนักศึกษาสาขาวิชานิเทศศาสตร์ พิธีบายศรีผูกข้อมือแก่นักศึกษา &nbsp;โดยมีอาจารย์หัวหน้ากลุ่มสาขาวิชานิเทศศาสตร์ &nbsp;อาจารย์ประจำแขนงวิชา &nbsp;เข้าร่วมพิธี พร้อมถ่ายภาพหมู่ร่วมกันเป็นที่ระลึก ซึ่งบรรยากาศเต็มไปด้วยความอบอุ่น &nbsp;และความประทับใจ &nbsp;ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) &nbsp;คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; การเล็งเห็นถึงความสำคัญของอนาคตบัณฑิตใหม่ที่จะเข้าสู่เส้นทางอาชีพ ตลอดจนโอกาสใหม่ๆในการประกอบอาชีพ บัณฑิตจะต้องมีความรู้ ความเข้าใจสถานการณ์การประกอบอาชีพในภาวะปัจจุบัน คณะวิทยาการจัดการ จึงจัดโครงการปัจฉิมนิเทศฯ ดังกล่าวขึ้น &nbsp;เพื่อเป็นการเตรียมความพร้อมให้กับบัณฑิตในการก้าวสู่โลกแห่งอาชีพได้อย่างมั่นใจและประสบความสำเร็จในการประกอบอาชีพต่อไปในอนาคต</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10078, 2, 1735, 'FMS organized the students experience training Special Education Program in Communication Arts Semester 2/2018', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190510/c8308831d65541002f87e56118a0cf6f3b9c59cb.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;On May 2, 2019, Faculty of Management Science organized the students experience training Special Education Program in Communication Arts Semester 2/2018. There is a professor in the group of Communication Arts Lecturers in the field attend the ceremony and take a group photo as a memorial at Suwaphakniwej room (5724), Faculty of Management Science, Suan Sunandha Rajabhat University.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; An importance of the future of new graduates that will enter the career path and new career opportunities graduates must have knowledge /understanding the current situation of occupation and prepare graduates for a career in the future.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10079, 1, 1736, 'แขนงวิชาการประชาสัมพันธ์ฯ วจก. จัด CA Mini Conference 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190503/5d2707c002419c48a7c7777303f90359226831bd.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;เมื่อวันที่ 30 เมษายน 2562 กลุ่มสาขาวิชานิเทศศาสตร์ แขนงวิชาการประชาสัมพันธ์และสื่อสารองค์กร &nbsp;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัด ICMSITS 2019 CA mini Conference การนำเสนอผลงานวิจัยของนักศึกษาระดับปริญญาตรี &nbsp;โดยได้รับเกียรติจากอาจารย์ประจำแขนงวิชา &nbsp;เป็นกรรมการวิพากษ์บทความวิจัย &nbsp;จัดขึ้น ณ ห้อง Mini Theatre ชั้น 6 คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;สำหรับการนำเสนองานวิจัยและงานวิชาการ &nbsp;CA Mini Conference ในครั้งนี้ได้รับความร่วมมือจากอาจารย์ประจำแขนง อาจารย์ที่ปรึกษาผู้ให้คำแนะนำนักศึกษาในการเขียนบทความ &nbsp;ทั้งนี้ ผลงานนำเสนอบางส่วนจะนำไปปรับปรุงเพื่อตีพิมพ์เผยแพร่ในวารสารวิชาการระดับชาติและนานาชาติตามนโยบายของมหาวิทยาลัยต่อไป</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10080, 2, 1736, 'Public Relations and Communication Organization program,FMS, organized CA Mini Conference 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190510/4bd3f81fd0838b48dff246802c397da6f772167d.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; On April 30, 2019, Public Relations and Communication Organization program, Faculty of Management Science, Suan Sunandha Rajabhat University, organized ICMSITS 2019 CA Mini Conference. Presenting research of students. Honored by external professional from leading university as the Committee criticized of research articles at Mini Theater Room, 6th Floor, Faculty of Management Science building.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; For the presentation of research in CA Mini Conference, has received cooperation from faculty members,advisors who advise students to write articles. Some of the presentations will be updated for publication in national and international academic journals according to the university&#39;s policy.</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10081, 1, 1737, 'นักศึกษานิเทศศาสตร์ วจก. ศึกษาดูงานสถานีโทรทัศน์สีกองทัพบกช่อง 7', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190503/63bedb2891a57a7abeef6f9276f902b057850955.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; เมื่อวันที่ 2 พฤษภาคม 2562 &nbsp;ที่ผ่านมา อาจารย์สมทบ แก้วเชื้อ &nbsp;อาจารย์ประจำแขนงวิชาวิทยุกระจายเสียงและวิทยุโทรทัศน์ คณะวิทยาการจัดการ นำทีมนักศึกษาจำนวน 47 คน เดินทางไปศึกษาดูงานการผลิตรายการโทรทัศน์ที่สถานีโทรทัศน์สีกองทัพบกช่อง 7 &nbsp;โดยมีทีมดำเนินงานฝ่ายประชาสัมพันธ์และฝ่ายการผลิต &nbsp;ให้การต้อนรับและให้ความรู้แก่นักศึกษา</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp;ซึ่งการศึกษาดูงานครั้งนี้เป็นส่วนหนึ่งในกระบวนการการเรียนการสอนในรายวิชาการออกแบบฉากและการจัดแสงเพื่องานวิทยุโทรทัศน์ อันเป็นวิชาที่ศึกษาเกี่ยวกับเพื่อให้นักศึกษามีความรู้ ความเข้าใจเกี่ยวกับพื้นฐานของงานการจัดรายการ ลักษณะและรูปแบบของงานการออกแบบฉากและการจัดแสงทางโทรทัศน์ หลักการและวิธีการจัดการรูปแบบต่างๆ ฝึกปฏิบัติผลิตผลงาน และสามารถใช้งานในรูปแบบต่างๆ ได้อย่างเหมาะสม มีวัตถุประสงค์เพื่อเป็นการสนับสนุนให้นักศึกษาแสดงความรู้ ความสามารถ และเปิดโอกาสให้ได้นำเสนอความคิดสร้างสรรค์ อันจะเป็นช่องทางในการเตรียมความพร้อมเพื่อเข้าสู่วิชาชีพหลังจบการศึกษาต่อไป</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10082, 2, 1737, 'Communication Arts student of FMS study visited BBTV Channel 7', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190513/09d35d9f8b024a07c33adad7ae09a4a975d8db9f.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:16px\">&nbsp;On May 2, 2019, Mr.Somtop Kaewchuer, a lecturer of radio and television broadcasting program, Faculty of Management Science led students team about 47 visited to study about television production at BBTV Channel 7 , with a public relations team and production department that welcome and educate students.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;This project is part of the teaching and learning process in scene design and lighting for radio, television. Which is a course that studies about to provide students with knowledge understanding the basics of the event. Characteristics and styles of scene design and lighting arrangement on television principles and methods of managing various forms practice in producing work and can be used in various forms appropriately. The objective is encourage students to show their knowledge, ability and opportunity to present creative ideas. Which will be a way to prepare to enter the profession after graduation.</span></p>\r\n', '', ''),
(10083, 1, 1738, 'คณะวิทยาการจัดการ ร่วมพิธีถวายพระพรพระบาทสมเด็จพระเจ้าอยู่หัว เนื่องในพระราชพิธีบรมราชาภิเษก', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190507/7cca57b66dca330700a60dc64dcace5df3a954a5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:513.125px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;วันที่ 7 พฤษภาคม 2562 &nbsp;ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ นำทีมคณาจารย์ บุคลากร เข้าร่วมพิธีถวายพระพรพระบาทสมเด็จพระเจ้าอยู่หัว เนื่องในพระราชพิธีบรมราชาภิเษก &nbsp;พุทธศักราช 2562 พระบาทสมเด็จพระปรเมนทรรามาธิบดีศรีสินทรมหาวชิราลงกรณ มหิศรภูมิพลราชวรางกูร กิติสิริสมบูรณอดุลยเดช สยามินทราธิเบศรราชวโรดม บรมนาถบพิตร พระวชิรเกล้าเจ้าอยู่หัว &nbsp;โดยมีรองศาสตราจารย์ ดร.ฤๅเดช เกิดวิชัย อธิการบดีมหาวิทยาลัยราชภัฏสวนสุนันทา เป็นประธานในพิธี จัดขึ้น ณ บริเวณพิธีหน้าอาคารสำนักงานอธิการบดี มหาวิทยาลัยราชภัฏสวนสุนันทา</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10084, 2, 1738, 'Faculty of Management Science Attended Wishing Ceremony for King Rama X on the Occasion of His Majesty’s Coronation', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190513/e4e57cf1b2073a33e7dbd19554fe9a28b8239fb8.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:513.125px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; On May 7, 2019 Asst. Prof Dr. Prateep Wajeetongratana, Dean of Faculty of Management Science and members of the faculty attended wishing ceremony for King Rama X on the occasion of his majesty&rsquo;s coronation. The ceremony honored by Assoc. Prof Dr. Luedech Girdwichai, President of Suan Sunandha Rajabhat University as a president, which was held in front of the Dean Office Building.</span></p>\r\n', '', ''),
(10085, 1, 1739, 'นิเทศศาสตร์ ภาพยนตร์ วจก. นำนักศึกษาลงพื้นที่ออกบูธบริการถ่ายภาพชุดไทย', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190510/8c5e9c159c71d74af3ade8425e2ffd963127189a.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.406px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:16px\">เมื่อเร็วๆนี้ แขนงวิชาภาพยนตร์และสื่อดิจิทัล กลุ่มสาขาวิชานิเทศศาสตร์ &nbsp;คณะวิทยาการจัดการ &nbsp;นำนักศึกษาชั้นปีที่ 3 &nbsp;ลงพื้นที่จัดกิจกรรมออกบูธบริการถ่ายภาพชุดไทยงานวัด ณ วัดทุ่งครุ กรุงเทพมหานคร</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; กิจกรรมดังกล่าวเป็นส่วนหนึ่งภายใต้โครงการ คนเบื้องหลัง สร้างสรรค์ความรู้ สู่ผู้ประกอบการ และเป็นส่วนหนึ่งของกิจกรรมการเรียนการสอนรายวิชาสัมมนาภาพยนตร์ที่เปิดโอกาสให้นักศึกษาได้เลือกจัดจัดกิจกรรมที่ตนเองสนใจในรูปแบบใหม่ที่ไม่จำเป็นต้องเชิญวิทยากรมาบรรยายในห้องประชุม แต่ให้นักศึกษาได้ใช้ความรู้ทางทฤษฎีถ่ายภาพ การตกแต่งภาพทางคอมพิวเตอร์ทึ่ได้ศึกษา และทักษะความสามารถที่มีอยู่ มาต่อยอดให้เกิดมูลค่าเพิ่ม และสร้างรายได้ให้กับตัวเอง อีกทั้งสามารถฝึกให้นักศึกษาได้ร่วมวางแผนการทำธุรกิจอย่างเป็นระบบ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;แขนงวิชาภาพยนตร์และสื่อดิจิทัล ขอขอบคุณ ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนาคณบดีคณะวิทยาการจัดการที่ได้ให้การสนับสนุนโครงการดังกล่าวจนประสบผลสำเร็จด้วยดี</span></p>\r\n', '', '');
INSERT INTO `sl_language_detail` (`id`, `language_id`, `ref_id`, `name`, `type`, `detail`, `detail_2`, `detail_3`) VALUES
(10086, 2, 1739, 'Film and Digital Media of FMS taked students going on location organized a booth to take pictures of Thai costume photography services.', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190513/86ff92c8c429385ae0446c02f278900c69b073a8.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.406px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-size:16px\">Film and digital media , Faculty of Management Science bring the 3rd year students going on location organized Thai costume photography booth service event at Wat Thung Khru Temple, Bangkok.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; This activities are part of behind people creating knowledge to entrepreneurs project and &nbsp;part of the teaching and learning activities of the movies seminar, that allow students to choose to organize activities which students can use theoretical knowledge to take pictures, computer image decoration that has been studied and make money for yourself include &nbsp;train students &nbsp;participate in systematic business planning.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;Films and digital media. Thank you as well for Assistant Professor Dr. Prateep Wajeethongrattana, Dean of the Faculty of Management Sciences who has supported the project until it has been successful</span></p>\r\n', '', ''),
(10087, 1, 1740, 'บรรยากาศการสอบสัมภาษณ์นักศึกษา ภาคปกติ ระบบ TCAS รอบที่ 3 การรับตรงร่วมกัน คณะวิทยาการจัดการ ประจำปีการศึกษา 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/9c7515184217d3170a7c810186c05c9bbb5f3e48.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/a8ed171374b57bf58727b7ae64ce8b37b80c05a0.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/49fc4ee5d398171c4e6a574d19d9e64fd6cfa6a7.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/270a3e0f90fd65e4dee80a154521bd506aad8caf.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/4a583f6964a3a6cfa14b662a2af5ef47025830d3.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;วันที่ 14 พฤษภาคม 2562 &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา ดำเนินการจัดสอบสัมภาษณ์คัดเลือกบุคคลเข้าศึกษา ในระดับปริญญาตรี ภาคปกติ ระบบ TCAS รอบที่ 3 การรับตรงร่วมกัน ประจำปีการศึกษา 2562 &nbsp;โดยคณะวิทยาการจัดการ &nbsp;มีนักเรียนเข้าสอบสัมภาษณ์ในแต่ละสาขาวิชา &nbsp;ได้แก่ กลุ่มสาขาวิชาบริหารธุรกิจ กลุ่มสาขาวิชานิเทศศาสตร์ &nbsp; ซึ่งการสอบสัมภาษณ์ผ่านไปด้วยดี &nbsp;ประกาศรายชื่อผู้มีสิทธิ์เข้าศึกษา &nbsp;ในวันที่ 17 พฤษภาคม 2562 &nbsp;ทาง &nbsp;<a href=\"http://admission.ssru.ac.xn--th%20-7dr3dug/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; text-shadow: none;\">http://admission.ssru.ac.th และ</a>&nbsp;</span><span style=\"background-color:transparent; color:rgb(0, 0, 0); font-size:16px\"><a href=\"http://student.mytcas.com/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; text-shadow: none;\" target=\"_blank\">http://student.mytcas.com</a></span></p>\r\n', '', ''),
(10088, 2, 1740, 'The Interview students for regular semester of TCAS System, Round 3 Direct admission Faculty of Management Science Academic Year 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/ed14f6368c54b8e7e1709393a8cf7647f685d4a1.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/7f92d4e72c0d6c4b26b8d9645c173688b374b08f.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/889d77f24d8da1606b23ec326ee36b209832aa00.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp;&nbsp;<img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/705ac57b25a2fdad4a81fac3e627e4adf368a638.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190514/f60d3c3577ed18f3796a55db057db8f10acf14be.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;On May 14, 2019, Suan Sunandha Rajabhat University has an interview for the selection of students to study in Bachelor&#39;s degree, the regular semester, TCAS system, 3rd round, direct admission academic Year 2019. The Faculty of Management Science have students attend interviews in each of the disciplines including Business Administration and Communication Arts and announcement of the list of eligible to study on May 17, 2019 by http://admission.ssru.ac.th and&nbsp;<a href=\"http://student.mytcas.com./\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; text-shadow: none;\">http://student.mytcas.com.</a>&nbsp; &nbsp; &nbsp;</span></p>\r\n', '', ''),
(10089, 1, 1741, 'คณะวิทยาการจัดการ จัดสัมมนาเชิงปฏิบัติการ “การเสริมสร้างคุณภาพชีวิตที่ดีของบุคลากรฯ” ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/4d368400a3b8bd1ae20596c9e7bebb82208a48eb.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/7d43d84ac787fa786d6b40404c2ef473071fcef9.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/6162664d16b11cc819e70bbc751b021cf3155dde.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/9863617d4442b9a62deaf65ebf5aeb22c0b58c67.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/5c35e6d2aba9009b69fd4b76b8c47503304ac641.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/303e94b0f86645a6a440384c0db757c4e7276259.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/4a28d9bdf0ca19ce2d1851099f2aed929cdee177.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><br />\r\n<img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190524/d3d80ef65147f131a960e628bd443b53b3e1a359.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:16px\">&nbsp; เมื่อวันที่ 21-23 &nbsp;พฤษภาคม 2562 &nbsp;คณะวิทยาการจัดการ จัดโครงการสัมมนาเชิงปฏิบัติการ &ldquo;การเสริมสร้างคุณภาพชีวิตที่ดีของบุคลากรคณะวิทยาการจัดการ&rdquo; ณ &nbsp; โรงแรมรอยัล พาวิลเลี่ยน อำเภอหัวหิน จังหวัดประจวบคีรีขันธ์ โดยมีวัตถุประสงค์เพื่อให้บุคลากรประจำคณะฯ มีคุณภาพชีวิตการทำงานที่ดีและอยู่ในสภาพแวดล้อมที่เอื้อต่อการทำงาน &nbsp;และสามารถนำความรู้ที่ได้รับไปประยุกต์กับการปฏิบัติงานและชีวิตประจำวันได้</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;การสัมมนาเชิงปฏิบัติการประกอบด้วย การศึกษาดูงานศูนย์เรียนรู้โครงการจัดพัฒนาที่ดินฯตามพระราชประสงค์หุบกะพง &nbsp;พิธีเปิดการสัมมนาเชิงปฏิบัติการฯ &nbsp;โดยผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ &nbsp; และให้เกียรติมอบนโยบายในการปฏิบัติงานให้กับบุคลากรคณะวิทยาการจัดการ &nbsp;โดยมีสาระสำคัญเพื่อเสริมสร้างให้บุคลากรมีวัฒนธรรมการทำงานร่วมกัน ส่งเสริมและพัฒนาวิธีการทำงาน ให้บุคลากรปฏิบัติงานอย่างมีประสิทธิภาพและประสิทธิผล ปฏิบัติงานตามหน้าที่และขับเคลื่อนคณะวิทยาการจัดการไปสู่เป้าหมายตามเป้าประสงค์และตัวชี้วัดของมหาวิทยาลัย</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp;อีกทั้งยังได้รับเกียรติจากผู้ช่วยศาสตราจารย์ ดร.สมเดช รุ่งศรีสวัสด์ &nbsp;รองอธิการบดีฝ่ายวิชาการ มหาวิทยาลัยราชภัฏสวนสุนันทา เป็นวิทยากรบรรยาย เรื่อง &ldquo;ทำงานอย่างไรให้มีความสุข&rdquo; โดยมีสาระสำคัญของการทำงานอย่างไรให้มีความสุข ได้แก่ 1.มีใจรักในงานที่ทำ 2.มีเป้าหมายของชีวิตที่ชัดเจน และประเมินความสำเร็จทุกๆ 5 ปี 3.มองโลกในแง่บวก 4.พัฒนาตนเองให้เป็นคนเก่งในงานที่ทำ 5.ทำให้ผู้บังคับบัญชาและเพื่อนร่วมงานรัก มีเครือข่าย มีพรรคพวก ไม่อยู่อย่างโดดเดี่ยว 6.อย่าฝืนความรู้สึกตนเอง ทำในสิ่งตนเองอยากทำ แต่ต้องไม่ทำให้ใครเดือดร้อนและต้องไม่ผิดกฎหมาย 7.มองปัญหาและอุปสรรคคือโอกาสและความท้าทาย 8.จงยิ้มและหัวเราะให้มาก จำไว้เสมอว่า &ldquo;when you smile the world smile with you.&rdquo; 9.หากผิดพลาดหรือล้มเหลว ท่องคำนี้ไว้ &ldquo;It&rsquo;s not the end of the world.&rdquo; และสุดท้าย 10. จงใช้ชีวิตเหมือนจะไม่มีพรุ่งนี้อีก ผู้ช่วยศาสตราจารย์ ดร.สมเดช รุ่งศรีสวัสดิ์ บรรยายโดยสรุป</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; นอกจากนี้มีกิจกรรมสันทนาการ เสริมสร้างความสุข สร้างความสัมพันธ์ที่ดีของบุคลากร &nbsp;โดยมีคณะผู้บริหาร คณาจารย์กลุ่มสาขาวิชาบริหารธุรกิจ &nbsp;กลุ่มสาขาวิชานิเทศศาสตร์ &nbsp;และบุคลากรสายสนุบสนุนวิชาการ &nbsp; เข้าร่วมกิจกรรมและสัมมนาโดยพร้อมเพรียงกัน&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', ''),
(10090, 2, 1741, '', 1, '', '', ''),
(10091, 1, 1742, 'วจก.ประชุมเตรียมความพร้อมจัดการประชุมวิชาการระดับชาติและนานาชาติ ICMSIT ครั้งที่ 6 ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190528/a665fe297d5da22d466d3b6ae261763fc44c50da.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:551.695px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; วันที่ 28 พฤษภาคม 2562<strong>&nbsp;</strong>คณะวิทยาการจัดการ จัดประชุมเตรียมความพร้อมจัดการประชุมวิชาการระดับชาติและนานาชาติ ครั้งที่ 6 ( ICMSIT 2019) โดยผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ เป็นประธานการประชุม เพื่อหารือและเตรียมความพร้อมวันงานจัดประชุมวิชาการระดับชาติและนานาชาติดังกล่าว อาทิ การจัดเตรียมสถานที่การนำเสนอผลงาน การมอบหมายภาระหน้าที่ผู้รับผิดชอบการดำเนินงานของแต่ละฝ่าย และวาระอื่นๆที่เกี่ยวข้อง โดยมีคณะกรรมการดำเนินงานประจำคณะเข้าร่วมประชุม ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;สำหรับการประชุมวิชาการระดับชาติและนานาชาติ ครั้งที่ 6 ( ICMSIT 2019) กำหนดจัดขึ้นในวันศุกร์ที่ 14 มิถุนายน 2562 ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) คณะวิทยาการจัดการ ขอเชิญผู้ที่สนใจเข้าร่วมการประชุมได้ตามกำหนด วัน และสถานที่ดังกล่าว</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10092, 2, 1742, '', 1, '', '', ''),
(10093, 1, 1743, 'คณะวิทยาการจัดการ สวนสุนันทา จัดอบรมเตรียมความพร้อมแก่นักศึกษา เดินทางร่วมอบรมเสริมทักษะอาชีพ ประเทศเกาหลีใต้ ปีที่2', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190529/12109856a44f17933b1d6c10073b8271fbeef23d.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190529/18477b9833128d42246931dea0555e11ca1d7568.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190529/765cf00fb9d909491fa5f08aa203c8b684d34a38.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190529/aaa63f980728f847bdaa4126656e54f703095281.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190529/8206e0de7fe987287da5f350300abe620bc7d0e0.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;วันที่ 28-29 พฤษภาคม 2562 คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดโครงการอบรมทักษะเบื้องต้นด้านการใช้อุปกรณ์ผลิตวีดีทัศน์ เพื่อเตรียมความพร้อมแก่นักศึกษาผู้ผ่านการคัดเลือกจำนวน 15 คน ให้ร่วมเดินทางไปอบรมระยะสั้นที่ Dong Ah Institute of Media and Arts ประเทศสาธารณรัฐเกาหลี &nbsp;ณ ห้องเรียน Smart Classroom และห้องปฏิบัติการคอมพิวเตอร์กราฟฟิก อาคาร 57 คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; ในการนี้ได้รับเกียรติจาก ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ เป็นประธานเปิดการอบรม ร่วมด้วยอาจารย์ ดร. สมศักดิ์ คล้ายสังข์ รองคณบดีฝ่ายบริหาร ผู้ช่วยศาสตราจารย์ ดร.พิสิษฐ์ พจนจารุวิทย์ รองคณบดีฝ่ายวิจัยรวมทั้งอาจารย์ ดร.พงศวีร์ สุภานนท์ และอาจารย์ชินกฤต อุดมลาภไพศาล ในฐานะอาจารย์พี่เลี้ยงที่จะร่วมเดินทางไปกับนักศึกษา เพื่อเรียนรู้วัฒนธรรมในช่วงปิดภาคเรียนฤดูร้อนตั้งแต่วันที่ 30 มิถุนายน &ndash; 14 กรกฎาคม 2562 นี้</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10094, 2, 1743, '', 1, '', '', ''),
(10095, 1, 1744, 'คณะวิทยาการจัดการ ร่วมพิธีถวายพระพรชัยมงคล สมเด็จพระนางเจ้าฯ พระบรมราชินี เนื่องในวันเฉลิมพระชนมพรรษา', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/cb96cc31e81f189aacb2481251ef201f7585cc19.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;วันที่ 30 พฤษภาคม 2562 &nbsp;ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ นำทีมผู้บริหาร คณาจารย์ บุคลากร เข้าร่วมพิธีถวายพระพรชัยมงคล สมเด็จพระนางเจ้าสุทิดา พัชรสุธาพิมลลักษณ พระบรมราชินี เนื่องในวันเฉลิมพระชนมพรรษา วันที่ 3 มิถุนายน 2562 &nbsp; โดยมีรองศาสตราจารย์ ดร.ฤๅเดช เกิดวิชัย อธิการบดีมหาวิทยาลัยราชภัฏสวนสุนันทา เป็นประธานในพิธี จัดขึ้น ณ หอประชุมสุนันทานุสรณ์ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\r\n', '', ''),
(10096, 2, 1744, '', 1, '', '', ''),
(10097, 1, 1745, 'คณะวิทยาการจัดการ จัดพิธีมอบทุนการศึกษา ประจำปีการศึกษา 2561', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/e9b25af70c7812f46ebcf46b9e8458a761bbf445.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/a67b3e9aefae5ed88610af92bc57a1c22a72204b.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/d41c66aa9093ec293f934b63fd06e580cc6414f8.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/95225b82856384ac0624d97efac2b990f54b39af.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><br />\r\n<img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/7bea4a4e793e33e59a4460ecafaa059c8662b473.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/8a0f6507a86a3052f182f3e615640d6c2d97bede.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/d4ba62f0b599eba5b8c51f8965c36c2d3124aab4.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/6e960a7a4a3efc52d71a44b745851637ccfb62c5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/f81904941d51e0c3a69e7eacd11b5c8296515f61.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/a17b8259484b9cae9634c80c7e16a7fd95f92aba.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/3adf980eb524192fea1b9879673a258f8d213fa7.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/1226086b81fb6fedca47da77c1a93d4da237fa78.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/063a552849b00ac673daa84ee5e219e81197763b.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/5429048c729d6bdec2aa74487ef833b20f84531f.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; วันที่ 30 พฤษภาคม 2562 &nbsp;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดพิธีมอบทุนการศึกษา ประจำปีการศึกษา 2561 &nbsp;โดยมีผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ เป็นประธานในพิธีมอบทุนพร้อมกล่าวให้โอวาทแก่นักศึกษา &nbsp;และได้รับเกียรติจากผู้บริหาร คณาจารย์เข้าร่วมในพิธี &nbsp;ณ ห้องประชุมสุวพักตร์นิเวศน์ (5724) คณะวิทยาการจัดการ &nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; คณะวิทยาการจัดการ มีนโยบายในการจัดหาทุนการศึกษา เพื่อมอบให้แก่นักศึกษาที่มีความรู้ความสามารถและมีผลงานด้านกิจกรรมดีเด่นและทำคุณประโยชน์ช่วยเหลือกิจกรรมให้กับคณะวิทยาการจัดการทุกปี สำหรับปีการศึกษา 2561 นี้ คณะฯได้มอบหมายให้ฝ่ายกิจการนักศึกษาและศิลปวัฒนธรรม รับผิดชอบดำเนินการ &nbsp;และจัดตั้งคณะกรรมการพิจารณาทุนการศึกษา เป็นผู้พิจารณากฎเกณฑ์และคัดเลือกนักศึกษา</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; คณะวิทยาการจัดการ ได้พิจารณาคัดเลือกผู้สมควรได้รับทุนการศึกษา ได้แก่ นักศึกษาที่มีความรู้ความสามารถและผลงานด้านกิจกรรมดีเด่นและทำคุณประโยชน์ช่วยเหลือกิจกรรมให้กับคณะวิทยาการจัดการ &nbsp;ทุนละ 10,000 บาท รวมเป็นเงิน 120,000 บาท &nbsp;โดยมีนักศึกษาเข้ารับทุนการศึกษา ประกอบด้วยนักศึกษากลุ่มสาขาวิชาบริหารธุรกิจและกลุ่มสาขาวิชานิเทศศาสตร์</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ &nbsp;&nbsp;กล่าวว่า &ldquo;ในนามของคณะวิทยาการจัดการ &nbsp;ขอแสดงความยินดีกับนักศึกษาที่ได้รับทุนการศึกษาทุกคน &nbsp;สำหรับนักศึกษาที่ได้รับคัดเลือกให้รับทุนการศึกษาก็ขอให้ใช้จ่ายเงินทุกบาททุกสตางค์อย่างคุ้มค่า เพื่อเป็นประโยชน์ต่อการศึกษาของตนเองอย่างแท้จริง และขอให้ประพฤติปฏิบัติตนเป็นคนดี ตั้งใจศึกษาเล่าเรียนให้ประสบผลสำเร็จต่อไป&rdquo;</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
