(10099, 1, 1746, 'นิเทศศาสตร์ วจก. จัดพิธีมนัสคารวะ สมเด็จพระนางเจ้าสุนันทากุมารีรัตน์ พระบรมราชเทวี ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/6b03c30c790c28dea9a30c07f618c8ed1603b96a.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/b897c2b279828fe6ed6efca958c7fb09dd216327.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><br />\r\n<img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/b72d463671cd3d94c84a84795aea99120742464e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/485ade423f70515865b99c670230504af2ba4b10.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/d33c58b3422a662c706d4ea104d5277b6e404318.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/19581dcb2f0e4258778848f720a1a70b76e7664e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/401184273c56a4683fa81247c95654c235e88923.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/d061aae95bee2bec903e11b91259d854fc1b4015.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/09531bdd313cf8e294131dd47891d2bfa4594b66.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/db3a09040dc8ddcbc999a1bb7f3a034ad9fdef62.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p><br />\r\n<img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/beaab1160deb2eb958d2df471ceae370184bd048.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:16px\">วันที่ 31 พฤษภาคม 2562 &nbsp;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา &nbsp;โดยกลุ่มสาขาวิชานิเทศศาสตร์ ร่วมกับชมรมสื่อสร้างสรรค์ &nbsp;จัดพิธีมนัสคารวะ สมเด็จพระนางเจ้าสุนันทากุมารีรัตน์ พระบรมราชเทวี ประจำปี 2562 &nbsp;เนื่องในวันคล้ายวันเสด็จทิวงคต ณ บริเวณลานหน้าพระราชานุสาวรีย์ สมเด็จพระนางเจ้าสุนันทากุมารีรัตน์ พระบรมราชเทวี &nbsp;โดยผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ &nbsp;ให้เกียรติเป็นประธาน ร่วมด้วยคณะผู้บริหาร &nbsp;คณาจารย์ บุคลากร นักศึกษากลุ่มสาขาวิชานิเทศศาสตร์ทุกชั้นปี และศิษย์เก่านิเทศศาสตร์เข้าร่วมในพิธี</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;กิจกรรมภายในพิธี ประกอบด้วย การวางพานพุ่มสักการะ &nbsp;การวางพวงมาลาของนักศึกษาและศิษย์เก่านิเทศศาสตร์ในแต่ละรุ่น การอ่านพระราชประวัติเพื่อระลึกถึงพระองค์ การแสดงรำศรีนวล และการแสดงของผู้นำเชียร์ของศิษย์นิเทศศาสตร์แต่ละรุ่น</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; การจัดพิธีมนัสคารวะ เริ่มต้นเมื่อ พ.ศ. 2541 โดยอาจารย์ณรงค์ อนุรักษ์ ผู้ช่วยคณบดีฝ่ายกิจการนักศึกษา เป็นกิจกรรมที่จัดต่อเนื่องเป็นประจำทุกปี &nbsp;ซึ่งปีนี้จัดขึ้นเป็นปีที่ 21 เนื่องด้วยในวันที่ 31 พฤษภาคม ของทุกปี เป็นวันคล้ายวันเสด็จทิวงคต สมเด็จพระนางเจ้าสุนันทากุมารีรัตน์ พระบรมราชเทวี นับเป็นวันสำคัญของมหาวิทยาลัยราชภัฏสวนสุนันทา กลุ่มสาขาวิชานิเทศศาสตร์ คณะวิทยาการจัดการ ร่วมกับชมรมสื่อสร้างสรรค์ มหาวิทยาลัยราชภัฏสวนสุนันทา จึงกำหนดจัดให้มี &ldquo;พิธีมนัสคารวะ&rdquo; ขึ้น&nbsp;&nbsp;</span></p>\r\n', '', ''),
(10100, 2, 1746, '', 1, '', '', ''),
(10101, 1, 1747, 'คณะวิทยาการจัดการ จัดอบรมเตรียมความพร้อมแก่นักศึกษา เดินทางร่วมอบรมเสริมทักษะอาชีพ ประเทศญี่ปุ่น ปีที่2', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/cea26742d8473e08cbd80660518f66588975a397.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/7d7b1161ce74032ff135050ea662742aab37b9c8.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/b01b9feb9fe2fc2099a4c437a2017535a3ed7ae9.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/723518598da19e4f49a91a7a98a891dcc60a4b5e.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/d3f01ad671522eeeb5ca3ef54430a3363436f9c2.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/e7f273b375fbb68468320b8890846765d34ab202.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190531/3b3e9959a65e2d0b12af4328d90930f47bc562ea.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;วันที่ 30-31 พฤษภาคม 2562 คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา จัดโครงการอบรมทักษะเบื้องต้นด้านการใช้อุปกรณ์ถ่ายภาพและเทคนิคการถ่ายภาพ &nbsp;เพื่อเตรียมความพร้อมแก่นักศึกษากลุ่มสาขาวิชาบริหารธุรกิจผู้ผ่านการคัดเลือกจำนวน 25 คน ให้ร่วมเดินทางไปอบรมระยะสั้นที่ Higashikawa,Otaru,Hokkaido,Japan &nbsp;ณ ห้องเรียน 5744 &nbsp;อาคาร 57 คณะวิทยาการจัดการ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;ในการนี้ได้รับเกียรติจาก ผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ เป็นประธานเปิดการอบรม ร่วมด้วยอาจารย์ ดร. สมศักดิ์ คล้ายสังข์ รองคณบดีฝ่ายบริหาร ผู้ช่วยศาสตราจารย์ ดร.พิสิษฐ์ พจนจารุวิทย์ รองคณบดีฝ่ายวิจัย และได้รับเกีบรติจากวิทยากรผู้เชี่ยวชาญด้านการถ่ายภาพ บรรยายให้ความรู้พร้อมฝึกปฏิบัติด้านการถ่ายภาพให้แก่ผู้เข้ารับการอบรม &nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp;สำหรับนักศึกษาที่ได้รับทุน จำนวน 25 คนดังกล่าว จะได้เดินทางไปเข้าร่วมการอบรมระยะสั้นด้านการถ่ายภาพ ณ Higashikawa,Otaru,Hokkaido,Japan เพื่อเรียนรู้วัฒนธรรมในช่วงปิดภาคเรียนฤดูร้อนตั้งแต่วันที่ 19 &ndash; 24 มิถุนายน &nbsp;2562 นี้</span></p>\r\n', '', ''),
(10102, 2, 1747, '', 1, '', '', ''),
(10103, 1, 1748, 'บรรยากาศการสอบสัมภาษณ์นักศึกษา ภาคปกติ ระบบ TCAS รอบที่ 4 ระบบกลาง Admissions คณะวิทยาการจัดการ ประจำปีการศึกษา 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/a4cdd2a98129d1271ca3c9da7889f7287199d838.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/740b0209ef34d12b084d4332b6cea8e5ef5a5b81.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/ab07ae0eaa9c290be231bc40098af7f54f7740e6.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/ca4adc37ca2741210222498689f6aac14e16b2b5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/390d3221a2ce34e71becfd0d1866f32ca4d8f9fc.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/85072129a92383e9cd990df5bd395d61eb0d022c.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190604/cd6f5138d8154bc7104e064ff4871cc9665d6003.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; วันที่ 4 มิถุนายน 2562 &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา ดำเนินการจัดสอบสัมภาษณ์คัดเลือกบุคคลเข้าศึกษา ในระดับปริญญาตรี ภาคปกติ ระบบ TCAS รอบที่ 4 ระบบกลาง Admissions ประจำปีการศึกษา 2562 &nbsp;โดยคณะวิทยาการจัดการ &nbsp;มีนักเรียนเข้าสอบสัมภาษณ์ในแต่ละสาขาวิชา &nbsp;ได้แก่ กลุ่มสาขาวิชาบริหารธุรกิจ กลุ่มสาขาวิชานิเทศศาสตร์ &nbsp; ซึ่งการสอบสัมภาษณ์ผ่านไปด้วยดี &nbsp;ประกาศรายชื่อผู้มีสิทธิ์เข้าศึกษา &nbsp;ในวันที่ 7 มิถุนายน 2562 &nbsp;ทาง &nbsp;http://admission.ssru.ac.th และ &nbsp;</span><span style=\"background-color:transparent; color:rgb(0, 0, 0); font-size:16px\"><a href=\"http://student.mytcas.com/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; text-shadow: none;\" target=\"_blank\">http://student.mytcas.com</a></span></p>\r\n', '', ''),
(10104, 2, 1748, '', 1, '', '', ''),
(10105, 1, 1749, 'ผู้บริหาร คณาจารย์ วจก. นำเสนอผลงานทางวิชาการระดับนานาชาติ ณ สมาพันธรัฐสวิส', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190402/035836464beccc28818352a7c05808bc8b2006ab.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา เดินหน้าเสริมสร้างศักยภาพด้านวิชาการของคณาจารย์ ยกระดับการนำเสนอผลงานวิชาการระดับนานาชาติ ตามยุทธศาสตร์ด้านพัฒนางานวิจัยและนวัตกรรมเพื่อเป็นฐานในการพัฒนามหาวิทยาลัย ชุมชน และประเทศชาติ &nbsp;ณ กรุงเจนีวา สมาพันธรัฐสวิส</span></h1>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;คณะวิทยาการจัดการ โดยผู้ช่วยศาสตราจารย์ ดร.ประทีป วจีทองรัตนา คณบดีคณะวิทยาการจัดการ นำคณาจารย์เข้าร่วมเสนอผลงานทางวิชาการระดับนานาชาติ &nbsp; ACE &ndash; 2019 &nbsp; Actual Economy : European Discourse on Global Challenges ระหว่างวันที่ 26 &ndash; 28 มีนาคม 2562 &nbsp; ณ กรุงเจนีวา สมาพันธรัฐสวิส &nbsp;ซึ่งการนำเสนอผลงานวิจัยของคณาจารย์ในครั้งนี้ &nbsp;ถือเป็นโอกาสในการเผยแพร่งานวิจัยซึ่งเป็นองค์ความรู้ใหม่ เรียนรู้ แลกเปลี่ยนองค์ความรู้กับนักวิจัยในต่างประเทศ &nbsp;และเป็นการเสริมสร้างศักยภาพทางด้านวิชาการรวมทั้งยกระดับการนำเสนอผลงานทางวิชาการและพัฒนาศักยภาพคณาจารย์คณะวิทยาการจัดการอย่างต่อเนื่อง</span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p>\r\n', '', ''),
(10106, 2, 1749, 'Members of Faculty of Management Science Giving International Academic Presentation in Switzerland', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190419/43f455450caa76d4e4a7a681200bfe54dec76af5.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; During 26 &ndash; 28 March 2019, Faculty of Management Science leading by Prof. Dr. Prateep Wajeetongratana and members of the faculty attended and gave academic presentation at the international conference &ldquo;ACE &ndash; 2019 Actual Economy: European Discourse on Global Challenges&rdquo; in Geneva, Switzerland. It was a great opportunity for faculty members to contribute and exchange knowledge with other foreign researchers. Also, the members could develop themselves in academic perspective.</span></p>\r\n', '', ''),
(10107, 1, 1750, 'นักศึกษาคณะวิทยาการจัดการ เข้ารับเข็มเชิดชูเกียรติ และเกียรติบัตรความประพฤติดี ประจำปี 2562', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190530/01d2eef884c9cf3a7502e8a754a36ce0a5a1a687.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา &nbsp;ขอแสดงความยินดีกับนางสาวศริญญา มะลิวัลย์ นักศึกษาชั้นปีที่ 2 แขนงวิชาภาพยนตร์และสื่อดิจิทัล กลุ่มสาขาวิชานิเทศศาสตร์ คณะวิทยาการจัดการ เนื่องในโอกาสเข้ารับเข็มเชิดชูเกียรติ และเกียรติบัตรรางวัลความประพฤติดี ประจำปี 2562 จากองค์กรพุทธสมาคมแห่งประเทศไทย ในพระบรมราชูปถัมภ์ ณ ศาลาอบรมสงฆ์วัดสามพระยาวรวิหาร เขตพระนคร กรุงเทพมหานคร &nbsp;เมื่อวันที่ 29 พฤษภาคม 2562 &nbsp;โดย ฯพณฯ ศาสตราจารย์ (พิเศษ) อรรถนิติ ดิษฐอำนาจ องคมนตรี เป็นประธานมอบรางวัลดังกล่าว</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;สำหรับรางวัลที่นักศึกษาได้รับ เป็นรางวัลที่ได้รับการพิจารณาคัดเลือกจากคณะกรรมการฯ ให้ได้รับรางวัลครั้งนี้ จะต้องให้เป็นผู้มีความประพฤติดี ตั้งมั่นในธรรมะขององค์สมเด็จพระสัมมาสัมพุทธเจ้า ดำรงตนเป็นคนดี มีคุณธรรม จริยธรรม เป็นตัวอย่างที่ดีแก่สังคม</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &ldquo;รู้สึกดีใจกับรางวัลนี้ ต้องขอบคุณทางฝ่ายกิจการนักศึกษา ที่คัดเลือกเป็นตัวแทนคณะ จนได้รับคัดเลือกจากทางมหาวิทยาลัย ให้ได้รับรางวัลความประพฤติดีนี้ &nbsp;ซึ่งสิ่งที่ได้จากรางวัลนี้คือความภาคภูมิใจ เพราะถือเป็นรางวัลที่การันตีความประพฤติของเราในรั้วมหาวิทยาลัย และจะตั้งใจประพฤติตัวดีให้สมกับรางวัลที่ได้รับค่ะ&rdquo; นางสาวศริญญา มะลิวัลย์ กล่าว</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
