(10109, 1, 1751, '“รีวอร์ด จิรัฏฐ์” หนุ่มหล่อแขนงวิชาการโฆษณาฯ วจก. ร่วมเดินแบบงาน Icon Siam Fashion Trend 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190318/e52e602e7480e995b68a951438c4cbea8b0583ce.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:656.797px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">&nbsp; &nbsp; &nbsp; &nbsp;นายจิรัฏฐ์ &nbsp;อาคาสุวรรณ &nbsp;(รีวอร์ด) &nbsp;นักศึกษาคณะวิทยาการจัดการ แขนงวิชาการโฆษณาและสื่อสารการตลาด &nbsp;ชั้นปีที่ 3 มหาวิทยาลัยราชภัฏสวนสุนันทา ร่วมเดินแบบงาน Icon Siam Fashion Trend 2019 &nbsp; &nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;นอกจากนี้ &ldquo;รีวอร์ด&rdquo; ผ่านเข้ารอบ 13 คนสุดท้าย ในการประกวด Cuteboy Thailand เป็นรายการเรียลลิตี้โชว์เพื่อค้นหา CUTEBOY คนแรกของประเทศไทย เพื่อก้าวขึ้นมาเป็น Cuteboy คนแรกของประเทศไทย พร้อมโอกาสในการเข้าสู่วงการบันเทิงอีกด้วย</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ติดตามเป็นกำลังใจและร่วมเชียร์น้องรีวอร์ด &nbsp;ในรายการ Cuteboy Thailand ได้ ทุกวันอาทิตย์ เวลา 21.15 น. ทาง True4U และแอปทรูไอดี เริ่ม 5 พฤษภาคม 2562 นี้</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', ''),
(10110, 2, 1751, '\"Rewards Jirat\", a handsome young man in the field of advertising participate in the Icon Siam Fashion Trend 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190419/d932d150a077c6c33382061fd306bf43ed89e616.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:656.8px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;Mr. Jirat Akasuwan (Rewards), Faculty of Management Science students Year 3 Advertising and Marketing Communication, Suan Sunandha Rajabhat University Participate in the Icon Siam Fashion Trend 2019.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp;In addition, &quot;Rewards&quot; passed the 13 finalists in the Cuteboy Thailand contest, a reality show to find the first CUTEBOY in Thailand. To step up to become the first Cuteboy in Thailand With the opportunity to enter the entertainment industry as well.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; Follow up and cheer for Rewards in the Cuteboy Thailand program every Sunday at 9:15 pm via True4U and True ID app starting May 5, 2019.</span></p>\r\n', '', ''),
(10111, 1, 1752, '“มีน ศิริประภา” นักศึกษา คณะวิทยาการจัดการ คว้ามงกุฎ Miss YB Thailand 2019', 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190311/05f343491df219b69e7151bb94cee03ba6f5778f.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.333px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; ศิริประภา พูลทรัพย์ (มีน) นักศึกษาแขนงวิชาวิทยุกระจายเสียงและวิทยุโทรทัศน์ &nbsp;โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ คณะวิทยาการจัดการ &nbsp;มหาวิทยาลัยราชภัฏสวนสุนันทา คว้ามงกุฎพร้อมตำแหน่งชนะเลิศ การประกวด Miss YB Thailand 2019 &nbsp;รับรางวัลมูลค่ากว่าหนึ่งแสนบาท &nbsp;ณ โรงละครแมมโบ้ กรุ่งเทพมหานคร &nbsp; เมื่อวันที่ 11 &nbsp;มีนาคม 2562 ที่ผ่านมา &nbsp;</span></p>\r\n\r\n<div>&nbsp;</div>\r\n', NULL, NULL),
(10112, 2, 1752, NULL, 1, '<p><img class=\"fr-dib fr-fic img-responsive\" src=\"http://fms.ssru.ac.th/useruploads/images/20190313/ff1d43c80855eefeca23810e6073b624ef7ae732.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:547.328px; max-width:100%; vertical-align:middle; width:821px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; Siriprapa Poonsap (Min) Radio and Television Program Students Special Education Program in Communication Arts Faculty of Management Science Suan Sunandha Rajabhat University Grab the crown and win the Miss YB Thailand 2019 contest. Get a prize worth over one hundred thousand baht at the Mambo Theater. Krungthep MahaNakhon on 11 March 2019 .</span></p>\r\n', NULL, NULL),
(10113, 1, 1753, 'ประกาศรายชื่อผู้มีสิทธิ์เข้าสอบสัมภาษณ์ระดับปริญญาตรี โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ (ภาคบ่าย)  รุ่น 14 ปี 2562 (รอบ 3)', 1, '<p>ประกาศรายชื่อผู้มีสิทธิ์เข้าสอบสัมภาษณ์ระดับปริญญาตรี โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ (ภาคบ่าย)&nbsp;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp;รายชื่อนักศึกษา รุ่น 14 ปี 2562 (รอบ 3)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://203.155.54.138/upload/userfile/images/%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%81%E0%B8%B2%E0%B8%A8%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%8A%E0%B8%B7%E0%B9%88%E0%B8%AD-%E0%B8%A3%E0%B8%B8%E0%B9%88%E0%B8%99-14-%E0%B8%A3%E0%B8%AD%E0%B8%9A-2-Copy.jpg\" style=\"height:1200px; width:830px\" /></p>\r\n', '', ''),
(10114, 2, 1753, 'ประกาศรายชื่อผู้มีสิทธิ์เข้าสอบสัมภาษณ์ระดับปริญญาตรี โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ (ภาคบ่าย)  รุ่น 14 ปี 2562 (รอบ 3)', 1, '<p>ประกาศรายชื่อผู้มีสิทธิ์เข้าสอบสัมภาษณ์ระดับปริญญาตรี โครงการจัดการศึกษาภาคพิเศษนิเทศศาสตร์ (ภาคบ่าย)&nbsp;คณะวิทยาการจัดการ มหาวิทยาลัยราชภัฏสวนสุนันทา&nbsp;รายชื่อนักศึกษา รุ่น 14 ปี 2562 (รอบ 3)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://203.155.54.138/upload/userfile/images/%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%81%E0%B8%B2%E0%B8%A8%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%8A%E0%B8%B7%E0%B9%88%E0%B8%AD-%E0%B8%A3%E0%B8%B8%E0%B9%88%E0%B8%99-14-%E0%B8%A3%E0%B8%AD%E0%B8%9A-2-Copy.jpg\" style=\"height:1200px; opacity:0.9; width:830px\" /></p>\r\n', '', ''),
