(10139, 1, 1757, 'ดาวน์โหลดเอกสาร', 1, '<div>เอกสารเบิกจ่ายของฝ่ายการเงินและบัญชี&nbsp;&nbsp;</div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 1.pdf\">1.ระเบียบค่าใช้จ่ายการเบิกจ่าย</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 2.pdf\">2.แบบแจ้งขอส่งเบิกจ่ายทั่วไป</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 3.pdf\">3.แบบฟอร์มเดินทางไปราชการ</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 4.pdf\">4.ใบสำคัญรับเงิน</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 5.pdf\">5.ใบสำคัญรับเงินวิทยากร</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 6.pdf\">6.แบบ-บก-กจ.9.</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 7.pdf\">7.ใบลงเวลาปฏิบัติงานนักศึกษาช่วยงาน</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 8.pdf\">8.ใบลงเวลาเข้าร่วมโครงการเบิกค่าอาหาร</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 9.pdf\">9.เส้นทาง-ขอนุมัติโครงการ</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>ฝ่ายวิชาการ&nbsp; &nbsp;- จรรยาบรรณบุคลากร&nbsp;</div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 10.pdf\">- จรรยาบรรณบุคลากร</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 11.pdf\">- เอกสารประกอบการยื่นคำร้องต่างๆ ของฝ่ายวิชาการ</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms 12.pdf\">- ขอความอนุเคราะห์ลงทะเบียนย้อนหลัง กรณีชำระค่าเทอมล่าช้า</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms13.pdf\">- ขอความอนุเคราะห์ลงทะเบียนล่าช้า</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms14.pdf\">- ขอความอนุเคราะห์ใช้ห้องเรียน คณะวิทยาการจัดการ</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms15.pdf\">- ขอสำเร็จการศึกษาแบบผิดลำดับขั้น</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms16.pdf\">- คำร้องขอเปิดวิชาเรียน</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms17.pdf\">- ขอความอนุเคราะห์เปลี่ยนรหัสวิชา</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms18.pdf\">- ขอความอนุเคราะห์คืนสภาพนักศึกษา</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms19.pdf\">- ขอความอนุเคราะห์ตามเกรด</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms20.pdf\">- คำร้องขอสอบภายหลังจากกำหนดการสอบปลายภาคเรียน</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms21.pdf\">- คำร้องขอเพิ่มรายวิชา</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms22.pdf\">- คำร้องขอถอดรายวิชา</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms23.pdf\">- คำร้องขอยกเลิกรายวิชา</a></div>\r\n\r\n<div>&nbsp;ฝ่ายบุคลากรและฝ่ายฝึกอบรม</div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms24.pdf\">- ใบลาอุปสมบท</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms25.pdf\">- แบบยกเลิกวันลา&nbsp;</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms26.pdf\">- หนังสือลาออกจากราชการ</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms27.pdf\">- ขออนุญาติเดินทางไปต่างประเทศ&nbsp;</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms28.pdf\">- ขอเพิ่มวุฒิการศึกษาในทะเบียนประวัติ</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms29.pdf\">- ขอแจ้งการเปลี่ยนแปลงข้อมูลส่วนบุคคล&nbsp;</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms30.pdf\">- คำขอมีบัตรประจำตัวบุคลากร&nbsp;</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms31.pdf\">- คำขอมีบัตร หรือขอบัตรประจำตัวใหม่&nbsp;</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms32.pdf\">- ใบสมัครเข้ารับการคัดเลือกพนักงานมหาวิทยาลัย (พนักงานชั่วคราว)&nbsp;</a></div>\r\n\r\n<div><a href=\"http://203.155.54.138/upload/userfile/files/fms33.pdf\">- ใบสมัครนักศึกษาช่วยงาน&nbsp;</a></div>\r\n\r\n<div>- คู่มือพนักงานมหาวิทยาลัยระเบียบ&nbsp;</div>\r\n\r\n<div>- พระราชบัญญัติระเบียบข้าราชการพลเรือน 2547</div>\r\n\r\n<div>- ข้อบังคับสภามหาวิทยาลัย&nbsp;</div>\r\n\r\n<div>- ระเบียบสำนักนายกรัฐมนตรีว่าด้วยพนักงานราชการ&nbsp;</div>\r\n\r\n<div>- ประกาศคณะกรรมการบริหารพนักงานราชการค่าตอบแทนและสิทธิประโยชน์&nbsp;</div>\r\n\r\n<div>- ระเบียบสภามหาวิทยาลัยฯ ว่าด้วยพนักนงานมหาวิทยาลัย พ.ศ 2550&nbsp;</div>\r\n\r\n<div>- ประกาศมหาวิทยาลัยราชภัฏสวนสุนันทา 1&nbsp;</div>\r\n\r\n<div>- ประกาศมหาวิทยาลัยราชภัฏสวนสุนันทา 2&nbsp;</div>\r\n\r\n<div>- ประกาศมหาวิทยาลัยราชภัฏสวนสุนันทาหลักเกณฑ์และวิธีลา</div>\r\n\r\n<div>- ประกาศมหาวิทยาลัยราชภัฏสวนสุนันทาหลักเกณฑ์และวิธีการการบรรจุบุคคล&nbsp;</div>\r\n\r\n<div>- ประกาศมหาวิทยาลัยราชภัฏสวนสุนันทาการประเมินผลการปฏิบัติงาน&nbsp;</div>\r\n\r\n<div>- แบบติดตามผลการนำความรู้ไปใช้</div>\r\n\r\n<div>- แบบรายงานการฝึกอบรมฯ</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;ฝ่ายพัสดุ&nbsp; &nbsp;</div>\r\n\r\n<div>- แบบขอเบิกพัสดุ&nbsp;</div>\r\n\r\n<div>- แบบฟอร์มการยืมครุภัณฑ์&nbsp;</div>\r\n\r\n<div>- แบบแจ้งความประสงค์ขอจัดซื้อ - จัดจ้าง</div>\r\n\r\n<div>- แบบขออนุญาตขนย้ายวัสดุ-ครุภัณฑ์เข้า-ออก&nbsp;&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>ฝ่ายวางแผนและพัฒนา&nbsp;</div>\r\n\r\n<div>- แบบเสนอคำขอตั้งงบประมาณรายจ่าย เงินนอกงบประมาณ ประจำปี&nbsp;</div>\r\n\r\n<div>- แบบฟอร์มคำขอตั้งงบประมาณประจำปี&nbsp;&nbsp;</div>\r\n\r\n<div>ฝ่ายธุรการ&nbsp; &nbsp;</div>\r\n\r\n<div>- บันทึกข้อความ&nbsp;</div>\r\n\r\n<div>- บันทึกข้อความ ออกหนังสือติดต่อราชการภายนอก&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;ฝ่ายกิจการนักศึกษาและกิจการพิเศษ&nbsp;&nbsp;</div>\r\n\r\n<div>- แบบขออนุญาตลาเรียนของนักศึกษา</div>\r\n\r\n<div>- แบบฟอร์มขอจองห้องประชุมสโมสรนักศึกษา</div>\r\n\r\n<div>- แบบยืมอุปกรณ์กีฬา</div>\r\n\r\n<div>&nbsp;&nbsp;</div>\r\n\r\n<div>ฝ่ายฝึกประสบการณ์วิชาชีพและสหกิจศึกศา</div>\r\n\r\n<div>แบบฟอร์มแบบตอบรับนักศึกษาฝึกงาน</div>\r\n\r\n<div>แบบฟอร์มแผนที่ฝึกงาน</div>\r\n\r\n<div>แบบฟอร์มขอจดหมายอนุเคราะห์เข้าฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>แบบฟอร์มประเมินผลการฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>แบบฟอร์มหนังสือรับรองการฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>ขั้นตอนการยื่นเอกสารฝึกสหกิจศึกษา</div>\r\n\r\n<div>ตัวอย่างการเชียนแบบฟอร์มขอจดหมายอนุเคราะห์เข้าฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>ประกาศเกณฑ์การออกฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา สำหรับนักศึกษาคณะวิทยาการจัดการ</div>\r\n\r\n<div>ประกาศคณะกรรมการงานฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>ประกาศมาตรฐานการนิเทศ สำหรับคณาจารย์คณะวิทยาการจัดการ</div>\r\n\r\n<div>รายละเอียดขั้นตอนการทำเอกสารฝึกงาน</div>\r\n\r\n<div>รูปแบบรายงานการฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>หน้าปกรายงานการฝึกประสบการณ์วิชาชีพ-สหกิจศึกษา</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;ศูนย์ปฏิบัติการวิทยุโทรทัศน์&nbsp; &nbsp;</div>\r\n\r\n<div>- SBC1 แบบขอยืมชุดผลิตรายการโทรทัศน์แบบเคลื่อนย้าย&nbsp;</div>\r\n\r\n<div>- SBC2 แบบขอยืมชุดผลิตรายการโทรทัศน์แบบเคลื่อนย้าย&nbsp;</div>\r\n\r\n<div>- SBC3 แบบขอใช้ห้องปฏิบัติการวิชาการ&nbsp;</div>\r\n\r\n<div>- SBC4 แบบขอใช้ห้องปฏิบัติการศูนย์วิทยุกระจายเสียง</div>\r\n\r\n<div>- SBC5 แบบฟอร์มขอยืมกล้องภาพนิ่ง&nbsp;</div>\r\n\r\n<div>- SBC6 แบบฟอร์มการยืมอุปกรณ์ประกอบการเรียนการสอน</div>\r\n\r\n<div>- SBC7 ทะเบียนประวัติผู้ใช้บริการ 1&nbsp;</div>\r\n\r\n<div>- SBC8 บันทึกการตรวจสอบอุปกรณ์</div>\r\n\r\n<div>- SBC9 แจ้งซ่อมอุปกรณ์การเรียนการสอน</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;ฝ่ายประกันคุณภาพ</div>\r\n\r\n<div>-&nbsp; ปก คำนำ สารบัญ SAR 2552 (ระดับคณะ)</div>\r\n\r\n<div>- ส่วนที่ 1 ข้อมูลพื้นฐานหน่วยงาน (ระดับคณะ)</div>\r\n\r\n<div>- ส่วนที่ 2 ผลปฏิบัติงานตามแผน (ระดับคณะ)</div>\r\n\r\n<div>- ส่วนที่ 3 รายงานการประเมินตนเอง (ระดับคณะ)</div>\r\n\r\n<div>- ส่วนที่ 4 สรุปผลการประเมินและทิศทางการพัฒนา (ระดับคณะ)&nbsp;</div>\r\n\r\n<div>- ส่วนที่ 5 ข้อมูลพื้นฐาน (ระดับคณะ)&nbsp;</div>\r\n\r\n<div>- ฟอร์มปก SAR 2552 (ระดับคณะ)&nbsp;</div>\r\n\r\n<div>- ฟอร์มคำนำ (ระดับสาขาวิช)&nbsp;</div>\r\n\r\n<div>- ส่วนที่ 1 บริบทของสาขา (ระดับสาขาวิชา)&nbsp;</div>\r\n\r\n<div>- ส่วนที่ 2 รายงานการประเมินตนเอง (ระดับสาขาวิชา)&nbsp;</div>\r\n\r\n<div>- ส่วนที่ 3 ผลการประเมินและการวิเคราะห์จุดแข็ง จุดอ่อน (ระดับสาขาวิชา)&nbsp;</div>\r\n\r\n<div>- ผลการนตรวจประเมินคุณภาพการศึกษาภายใน ระดับสาขาวิชา</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>ฝ่ายบริการการศึกษา&nbsp;</div>\r\n\r\n<div>- คู่มือการทวนสอบผลสัมฤทธิ์ตามมาตรฐานผลการเรียนรู้ของนักศึกษา&nbsp;</div>\r\n\r\n<div>- คำนำ&nbsp;</div>\r\n\r\n<div>- สารบัญ&nbsp;</div>\r\n\r\n<div>- เนื่อหา&nbsp;</div>\r\n', NULL, NULL),
