(10141, 1, 1758, '', 1, '<p><img src=\"http://fms.ssru.ac.th/useruploads/images/20190712/1d9c5998842bce6f6e29728015d5621904a7f839.jpg\" /></p>\r\n', '', ''),
(10142, 2, 1758, '', 1, '<p><img src=\"http://fms.ssru.ac.th/useruploads/images/20190712/1d9c5998842bce6f6e29728015d5621904a7f839.jpg\" /></p>\r\n', '', ''),
(10143, 1, 1759, 'นโยบาย', 1, '<p>1. จัดระบบการบริหารการจัดการในรูปแบบ บริหารเบ็ดเสร็จในจุดเดียว (One Stop Service)<br />\r\n2. ยึดมั่น ระบบคุณธรรม (Merit System) ในการทำงาน ทุกระบบงานโปร่งใสและตรวจสอบได้<br />\r\n3. ทำงานเป็นทีม กระจายอำนาจและรับผิดชอบ<br />\r\n4.จัดตั้งสภาอาจารย์คณะ พร้อมรับฟังความคิดเห็นและเปิดโอกาสให้คณาจารย์ มีส่วนร่วมในการบริหารคณะและตัดสินใจ<br />\r\n5. แถลงนโยบาย การบริหารและการจัดสรรงบประมาณต่อสภาอาจารย์คณะเป็ฯประจำทุกปี<br />\r\n6. ประมวลผลงานผู้บริหารปีละครั้ง<br />\r\n7. พิจารณาความดีความชอบอย่างเปิดเผยและเป็นธรรม โดยจะเฉลี่ยให้กับทุกคนที่ทำงาน การประเมินจะต้องเป็นรูปธรรม มีสิทธิขอทราบการประเมิน<br />\r\n8. จัดหาสิ่งอำนวยความสะดวกและเทคโนโลยีต่างๆ เพื่อสนับสนุนงานของอาจารย์และคณะ<br />\r\n9. สร้างสรรค์งาน กิจกรรมพิเศษ และโครงการต่างๆ อาทิ โครงการสามสิบบาทก็เรียนได้<br />\r\nโครงการศึกษาสำหรับชุมชน โครงการสหกิจศึกษา โครงการบริษัทจำลอง โครงการสวนวิชาการ (Garder of Knowledge)และอื่นๆเพื่อจัดตั้งกองทุนคณะ สร้างขวัญและกำลังใจ และความรักสมานสามัคคี<br />\r\n10.จัดทำผลวานทางวิชาการ เอกสารการสอน สื่อประกอบการสอน และตำราหลักในรายวิชา หลักของคณะ<br />\r\n11.ส่งเสริม สนับสนุน และเร่งพัฒนาอาจารย์ให้ได้ตำแหน่งวิชาการ<br />\r\n12.สนับสนุนให้บุคลากรทุกคนของคณะได้เข้าฝึกอบรม และดูงานอย่างน้อยปีละ 1 ครั้ง<br />\r\n13.จัดตั้งห้องสมุดคณะ<br />\r\n14.จัดตั้งคณะนิเทศศาสตร์<br />\r\n15.ดำเนินการให้โปรแกรมวิชาอุตสาหกรรมการท่องเที่ยวสังกัดคณะวิทยาการจัดการ และมีศูนย์ฝึกปฏิบัติการท่องเที่ยว<br />\r\n16.ขยายการศึกษาในระดับบัณฑิตศึกษาให้สอดคล้องกับศักยภาพของคณะ และความต้องการของประเทศ<br />\r\n17.สร้างพันธมิตรทางความคิดและธุรกรรม (Strategic Alliance and Synergy) แสวงหาความร่วมมือกับวงการวิชาการ ภายนอกทั้งหน่วยงานของภาครัฐและเอกชนสร้างเอกภาพและความเป็นเลิศทางวิชาการโดยจัดแผนการเรียน การสอนและบริหารจัดการให้เบ็ดเสร็จในระดับคณะ<br />\r\n18.สนับสนุนกิจกรรมนักศึกษาและศิษย์เก่า คณะวิทยาการจัดการ เพื่อสร้างสัมพันธ์ระหว่างศิษย์ เก่าและศิษย์ปัจจุบัน<br />\r\n19.สร้างบรรยากาศในการทำงานด้วยความรัก ความอบอุ่น และความเอื้ออาทร์ เสมือนเครือญาติคนในครอบครัว</p>\r\n', NULL, NULL),
(10144, 2, 1759, 'Policy', 1, '<p>1. Organizing of management system in the form of One Stop Service.<br />\r\n2. Adherence to Merit System for working.&nbsp; Every operational system is transparent and can be checked.<br />\r\n3. Working as team, distribution of power and responsibilities.<br />\r\n4. Establishment of the Faculty&rsquo;s Professor Council.&nbsp; Listening to comments and the opportunity is provided for the staff of professors to take part in the faculty management and making decisions.<br />\r\n5. Announcement of the policies, management and allocation of budget to the Faculty&rsquo;s Professor Council annually.<br />\r\n6. Evaluation of the executives&rsquo; work once a year.<br />\r\n7. Merit consideration in an open and fair manner by averaging for all working people. The assessment must be concrete.&nbsp; There is the right to be informed of evaluation.<br />\r\n8. Providing various facilities and technologies to support the work of professors and the Faculty.<br />\r\n9. Creation of work, special activities and projects of all kinds such as the thirty baht comprehensive learning project,&nbsp; educational project for community, Cooperative Education Project, model company project, Garden of Knowledge and more to set up the Faculty&rsquo;s fund, boost morale and spirit and create love, harmony.<br />\r\n10. Preparation of academic work, teaching documents, instructional media and textbooks of each major course of the Faculty.<br />\r\n11. Promotion, support and acceleration of professor development for getting academic positions.<br />\r\n12. Encouraging all staff of the Faculty to receive training and make a study trip at least 1 time per year.<br />\r\n13. Setting up the Faculty&rsquo;s library.<br />\r\n14. Establishment of the Faculty of Communication Arts<br />\r\n15. Arrangement for the tourism industry program under the Faculty of Management Science.&nbsp; There is also the Tourism Operation Center.<br />\r\n16. Educational expansion at the graduate level to accord with the Faculty&rsquo;s potential and the needs of the country.<br />\r\n17. Creating Strategic Alliance and Synergy.&nbsp; Seeking cooperation with outside academic circles, including the agencies of government and private&nbsp; sectors.&nbsp; Creation of unity and academic excellence by arrangement of educational plans and management in a one-stop manner&nbsp; at the faculty level.<br />\r\n18. Support for the activities of students and alumni, Faculty of Management Science to establish the relationship between alumni and current students.<br />\r\n19. Creation of work environment with love, warmth and mutual assistance like relatives, family members.</p>\r\n', NULL, NULL),
(10145, 1, 1760, 'คู่มือมาตรฐานการปฎิบัติงาน', 1, '<p>- ฝ่ายบริหารงานทั่วไป<br />\r\n- ฝ่ายคลังและพัสดุ<br />\r\n- ฝ่ายแผนงานละประกันคุณภาพ<br />\r\n- ฝ่ายพัฒนางานวิจัยและบริการวิชาการ<br />\r\n- ฝ่ายบริการการศึกษา<br />\r\n- ฝ่ายวิทยุโทรทัศน์และวิทยุกระจายเสียง<br />\r\n- คู่มือการปฏิบัติงานกระบวนการจัดการข้อร้องเรียนข้อเสนอแนะข้อคิดเห็นและคำชมเชย</p>\r\n', NULL, NULL),
(10146, 2, 1760, 'Guide Performance Standards', 1, '<p>- General Administration</p>\r\n\r\n<p>- Department of Finance and Supplies</p>\r\n\r\n<p>- Planning and Quality Assurance Department</p>\r\n\r\n<p>-Research and Academic Services Development Department</p>\r\n\r\n<p>- Education Services Department</p>\r\n\r\n<p>- Radio and television broadcasting</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL),
