(10183, 1, 1778, 'แขนงวิชาธุรกิจระหว่างประเทศ', 1, '<div>\r\n<p style=\"text-align:center\"><strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">หลักสูตรบริหารธุรกิจบัณฑิต<br />\r\nสาขาวิชาคอมพิวเตอร์ธุรกิจ<br />\r\nหลักสูตรปรับปรุง พ.ศ. 2559</span></span></strong><br />\r\n&nbsp;</p>\r\n\r\n<p><strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">ชื่อสถาบันอุดมศึกษา&nbsp;</span></span></strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">มหาวิทยาลัยราชภัฏสวนสุนันทา</span></span><br />\r\n<strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">วิทยาเขต/คณะ/ภาควิชา&nbsp;</span></span></strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">คณะวิทยาการจัดการ</span></span></p>\r\n\r\n<p style=\"text-align:center\"><br />\r\n<strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">หมวดที่ 1. ข้อมูลทั่วไป</span></span></strong></p>\r\n\r\n<p><br />\r\n<strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">รหัสและชื่อหลักสูตร<br />\r\nภาษาไทย&nbsp;</span></span></strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">หลักสูตรบริหารธุรกิจบัณฑิต สาขาวิชาคอมพิวเตอร์ธุรกิจ</span></span><br />\r\n<strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">ภาษาอังกฤษ&nbsp;</span></span></strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">Bachelor of Business Administration Program in Business<br />\r\nComputer</span></span><br />\r\n<strong><span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">ชื่อปริญญาและสาขาวิชา</span></span></strong><br />\r\n<span style=\"font-size:24px\"><span style=\"font-family:trebuchet ms,helvetica,sans-serif\">ชื่อเต็ม (ภาษาไทย) บริหารธุรกิจบัณฑิต (คอมพิวเตอร์ธุรกิจ)<br />\r\nชื่อเต็ม (ภาษาอังกฤษ) Bachelor of Business Administration (Business Computer)<br />\r\nชื่อย่อ (ภาษาไทย) บธ.บ. (คอมพิวเตอร์ธุรกิจ)<br />\r\nชื่อย่อ (ภาษาอังกฤษ) B.B.A. (Business Computer)</span></span></p>\r\n\r\n<p><span style=\"font-size:24px\"><strong style=\"font-family:trebuchet ms,helvetica,sans-serif\">วิชาเอก</strong></span></p>\r\n\r\n<h1>&nbsp;แขนงวิชาธุรกิจระหว่างประเทศ (International Business)</h1>\r\n</div>\r\n', '', ''),
